INSERT INTO `article_translation` VALUES (1,'Our objectives','<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span style=\"font-size: 12px;\">The goal of <span>Up2green</span> Reforestation team is <strong>to spread awareness to as many people as possible about</strong> <strong>Sustainable Development</strong> and protecting the planet.</span></p>\r\n','<p>\r\n	<span style=\"font-size: 12px;\"><strong><span style=\"color: rgb(0, 100, 0);\">Up2green Reforestation is a French non-profit association.</span></strong></span></p>\r\n<p>\r\n	<span style=\"font-size: 12px;\">The goal of Up2green Reforestation team is <strong>to spread awareness to as many people as possible about</strong> <strong>Sustainable Development</strong> and protecting the planet.</span></p>\r\n<p>\r\n	<span style=\"font-size: 12px;\">We have created a new Internet portal, <strong>committed to the fight against deforestation in the world and global warming...</strong></span></p>\r\n<p>\r\n	<span style=\"font-size: 12px;\"><strong>Two innovative solutions </strong>were dreamed up by the founders to reach this objective.&nbsp; These two solutions consist in offering an <strong>original economic model</strong> to <strong>businesses</strong> and to <strong>individuals</strong>, allowing them to become active participants in reforestation, at little cost.</span></p>\r\n<p>\r\n	<span style=\"font-size: 12px;\">The programs that we offer funding to are run directly by <span style=\"color: rgb(0, 100, 0);\"><strong>our reforestation partners in 2011</strong></span>: Projets Plus Actions (Benin), Baobab29 (Burkina Faso), Eco Preservation Society (Costa Rica), Ishpingo (Ecuador), CALA (Madagascar), Oceanium (Senegal), PATT Foundation (Thailand)</span></p>\r\n<p>\r\n	<span style=\"font-size: 12px;\">The <strong>programs</strong> that we have selected all respond to the issues of 3 pillars of sustainable development:</span></p>\r\n<p style=\"margin-left: 36pt;\">\r\n	<span style=\"font-size: 12px;\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>environmental protection, </strong></span></p>\r\n<p style=\"margin-left: 36pt;\">\r\n	<span style=\"font-size: 12px;\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>economic development, </strong></span></p>\r\n<p style=\"margin-left: 36pt;\">\r\n	<span style=\"font-size: 12px;\">-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>social promotion. </strong></span></p>\r\n<p style=\"margin-left: 36pt;\">\r\n	&nbsp;</p>\r\n<p>\r\n	<span style=\"font-size: 12px;\"><span style=\"color: rgb(0, 100, 0);\"><strong>A SOLUTION FOR BUSINESSES :</strong></span></span></p>\r\n<p>\r\n	<span style=\"font-size: 12px;\">Up2green offers any business, large or small, the possibility to <strong>become an active participant in reforestation</strong> by getting their clients and partners involved.</span></p>\r\n<p>\r\n	<span style=\"font-size: 12px;\">More and more businesses are looking to play a role for the planet and talk about their involvement.&nbsp; Up2green proposes not only being a <strong>contributor to reforestation</strong> in the world but also <strong>directly involving their clients and partners</strong>.&nbsp; Thus, a business can either:</span></p>\r\n<ol>\r\n	<li>\r\n		<span style=\"font-size: 12px;\"><strong>Commit to plant </strong><strong>trees</strong>with one or more reforestation programs with each purchase or each key moment in the client relationship, and communicate about this commitment</span></li>\r\n	<li>\r\n		<span style=\"font-size: 12px;\"><strong>Offer tree credits to their </strong><strong>clients</strong>during an &ldquo;eco-citizen&rdquo; campaign, for example, or at key moments in the client relationship.&nbsp; The clients themselves then choose where to plant their trees using our virtual planting platform.&nbsp; The business can also follow the use of these tree credits in real time via a special network.</span></li>\r\n</ol>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span style=\"font-size: 12px;\"><span style=\"color: rgb(0, 100, 0);\"><strong>A SOLUTION FOR INDIVIDUALS: a green websearch solution&nbsp;</strong></span></span></p>\r\n<p>\r\n	<span style=\"font-size: 12px;\">Up2green Reforestation allows individuals to collect free tree credits with each of their Internet researches.</span></p>\r\n<p>\r\n	<span style=\"font-size: 12px;\">Users who have created an account with Up2green get free tree credits along their web researches or with each of their online purchases, without any additional expense.&nbsp; They then choose where to plant their trees among the reforestation programs partnered with Up2green, on the virtual planting platform.</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span style=\"font-size: 12px;\"><strong><span>See our association website</span> :</strong> <a href=\"http://association.up2green.com\" target=\"_blank\">http://<span>association.up2green.com</span></a></span></p>\r\n','en','nos_objectifs'),(1,'Nos objectifs','<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span style=\"font-size: 12px;\"><strong>Up2green Reforestation est une association de loi 1901 </strong><strong><span style=\"font-family: arial,helvetica,sans-serif;\">&agrave; but non <span>lucratif</span></span></strong><strong> </strong>dont la mission essentielle est de d&eacute;velopper ses propres projets d&#39;agroforesterie et de soutenir d&rsquo;autres organisations associatives qui <strong>luttent &eacute;galement contre le changement climatique, la pauvret&eacute; et la perte de biodiversit&eacute;</strong>, par la mise en &oelig;uvre de <strong>projets de reforestation communautaire</strong>.</span></p>','<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"color: rgb(0, 128, 0);\"><strong>L&#39;association a pour objets de :</strong></span></span></span></p>\r\n<ul style=\"margin-left: 40px;\">\r\n	<li style=\"text-align: justify;\">\r\n		<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span dir=\"LTR\">Favoriser, d&eacute;velopper et promouvoir toute action positive en lien avec la <strong>lutte contre le r&eacute;chauffement climatique</strong> : reforestation, conservation de la biodiversit&eacute;, aide aux populations touch&eacute;es par les p&eacute;nuries d&#39;origine climatique, s&eacute;questration du CO2 atmosph&eacute;rique,&hellip;</span></span></span></li>\r\n	<li style=\"text-align: justify;\">\r\n		<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span dir=\"LTR\"><strong>Participer au financement de programmes de reforestation dans le monde</strong>.</span></span></span></li>\r\n	<li style=\"text-align: justify;\">\r\n		<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span dir=\"LTR\">Collecter des fonds </span>en vue du financement de ces programmes de reforestation ou de tout programme &agrave; vocation &eacute;cologique ;</span></span></li>\r\n	<li style=\"text-align: justify;\">\r\n		<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span dir=\"LTR\">Etablir des partenariats </span>avec des organismes de plantation en vue du financement des programmes</span></span></li>\r\n	<li style=\"text-align: justify;\">\r\n		<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong><span dir=\"LTR\">Aider les populations </span></strong>touch&eacute;es par la d&eacute;forestation ou par la perte de ma&icirc;trise fonci&egrave;re leur assurant une activit&eacute; locale durable</span></span></li>\r\n	<li style=\"text-align: justify;\">\r\n		<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Participer au d&eacute;ploiement en France et &agrave; l&#39;international <span dir=\"LTR\">de m&eacute;thodologies de certification des programmes de reforestation.</span></span></span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"color: rgb(0, 128, 0);\"><strong>Elle finance les programmes de reforestation en s&#39;appuyant sur :</strong></span></span></span></p>\r\n<ul style=\"list-style-type: square; margin-left: 40px;\">\r\n	<li style=\"text-align: justify;\">\r\n		<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>un moteur de recherche internet : <a href=\"http://www.up2green.com\" target=\"_blank\">www.up2green.com</a></strong></span></span></li>\r\n	<li style=\"text-align: justify;\">\r\n		<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong><a href=\"http://reforestation.up2green.com/\" target=\"_blank\">une </a><a href=\"http://reforestation.up2green.com/\" target=\"_blank\">plate-</a><a href=\"http://reforestation.up2green.com/\" target=\"_blank\">forme</a><a href=\"http://reforestation.up2green.com/\" target=\"_blank\"> de reforestation</a></strong> &agrave; destination des particuliers ou des b&eacute;n&eacute;ficiaires de coupons de plantation fournis par nos partenaires</span></span></li>\r\n	<li style=\"text-align: justify;\">\r\n		<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>des partenariats</strong> contractuels directs avec les entreprises et les collectivit&eacute;s locales</span></span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"color: rgb(0, 128, 0);\"><strong>Elle assure le contr&ocirc;le des plantations sur le terrain :</strong></span></span></span></p>\r\n<p style=\"text-align: justify; margin-left: 40px;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify; margin-left: 40px;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Notre principale pr&eacute;occupation est <strong>la transparence et la tra&ccedil;abilit&eacute;</strong> de l&#39;ensemble des actions men&eacute;es.</span></span></p>\r\n<p style=\"text-align: justify; margin-left: 40px;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Nous assurons sur le terrain la v&eacute;rification de l&#39;ensemble des crit&egrave;res permettant de garantir &agrave; nos partenaires et financeurs, la tra&ccedil;abilit&eacute; et l&#39;efficacit&eacute; des actions men&eacute;es dans plus de 10 pays.</span></span></p>\r\n<p style=\"text-align: justify; margin-left: 40px;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Maikov DUMAS, responsable des programmes agroforestiers, assure par ailleurs le pilotage des programmes directement engag&eacute;s par Up2green Reforestation : Colombie, P&eacute;rou.</span></span></p>\r\n<p style=\"text-align: justify; margin-left: 40px;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify; margin-left: 40px;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"color: rgb(0, 100, 0);\"><strong>En 2011, nos <span>partenaires</span> <span>planteurs</span> <span>sont</span> </strong></span>: <span><span>Projets</span></span> Plus Actions (Benin), <span><span>Baobab29</span></span> (Burkina Faso), Eco Preservation Society (Costa Rica), <span><span>Ishpingo</span></span> (<span>Equateur</span>), <span><span>CALA</span></span> (Madagascar), <span><span>Oceanium</span></span> (<span>S&eacute;n&eacute;gal</span>), <span><span>PATT</span></span> Foundation (<span>Thailande</span>)</span></p>\r\n<p style=\"text-align: justify; margin-left: 40px;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify; margin-left: 40px;\">\r\n	Voir le site de l&#39;association : <a href=\"http://association.up2green.com\" target=\"_blank\">http://association.up2green.com</a></p>\r\n','fr','nos_objectifs'),(2,'Our ambition','<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong><span class=\"long_text short_text\" lang=\"en\"><span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">ENCOURAGE</span> <span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">YOU</span> <span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">TO</span> <span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">BECOME</span> <span style=\"color: rgb(0, 128, 0);\"><span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">PLAYERS IN</span> <span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">REFORESTATION</span></span></span></strong></span></span></p>\r\n','<p style=\"text-align: justify;\">\r\n	<span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 12px;\"><span class=\"long_text\"><span style=\"background-color: rgb(255, 255, 255);\" title=\"L\'ambition de toute l\'équipe d\'UP2GREEN est de sensibiliser le plus de monde possible au Développement Durable et à la protection de la Planète en général.\">The ambition of </span></span></span></span><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 12px;\"><span class=\"long_text\"><span style=\"background-color: rgb(255, 255, 255);\" title=\"L\'ambition de toute l\'équipe d\'UP2GREEN est de sensibiliser le plus de monde possible au Développement Durable et à la protection de la Planète en général.\">UP2GREEN </span></span></span></span><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 12px;\"><span class=\"long_text\"><span style=\"background-color: rgb(255, 255, 255);\" title=\"L\'ambition de toute l\'équipe d\'UP2GREEN est de sensibiliser le plus de monde possible au Développement Durable et à la protection de la Planète en général.\">team is to educate the&nbsp; many people as possible to Sustainable Development and the protection of the planet in general.<br />\r\n	<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"L\'association UP2GREEN REFORESTATION développe des outils au service de la lutte contre la déforestation dans le Monde et le réchauffement climatique :\">The association UP2GREEN REFORESTATION develops tools for the fight against deforestation in the world and global warming:<br />\r\n	<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"background-color: rgb(255, 255, 255);\" title=\"* un site de recherche internet qui finance la reforestation : http://www.up2green.com/\">* Internet search site, which finances reforestation: <a href=\"http://www.up2green.com/\" target=\"_top\">http://www.up2green.com/</a><br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"background-color: rgb(235, 239, 249);\" title=\"* une plate-forme de reforestation virtuelle : http://reforestation.up2green.com/ pour planter des arbres (grâce aux coupons distribués par les entreprises partenaires ou directement par les particuliers qui ont collecté des crédits grâce au moteur de recherche).\">* Platform for </span></span></span></span><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 12px;\"><span class=\"long_text\"><span style=\"background-color: rgb(235, 239, 249);\" title=\"* une plate-forme de reforestation virtuelle : http://reforestation.up2green.com/ pour planter des arbres (grâce aux coupons distribués par les entreprises partenaires ou directement par les particuliers qui ont collecté des crédits grâce au moteur de recherche).\">reforestation&nbsp; <a href=\"http://reforestation.up2green.com/\" target=\"_blank\">http://reforestation.up2green.com/</a> to plant trees (through vouchers distributed by partner companies or directly by individuals who collected funds through the search engine).<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"background-color: rgb(255, 255, 255);\" title=\"* en développant des partenariats de reforestation ou en finançant ses propres programmes (détail sur le site de l\'Association : http://association.up2green.com/\">* Developing partnerships reforestation or funding its own programs (details on the Association website: <a href=\"http://association.up2green.com/\" target=\"_blank\">http://association.up2green.com/</a><br />\r\n	<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"L\'association UP2GREEN REFORESTATION finance :\">The association UP2GREEN REFORESTATION finance:<br />\r\n	<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"background-color: rgb(255, 255, 255);\" title=\"* ses propres programmes de reforestation : Pérou et Colombie\">* Its own reforestation programs: Peru and Colombia<br />\r\n	&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"background-color: rgb(255, 255, 255);\" title=\"* des partenaires spécialiés dans l\'agroforesterie : Organismes institutionnels, ONG, Associations, Fondations,...\">* Special partners in agroforestry: Institutional organizations, NGOs, Associations, Foundations, ...<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"Nous sélectionnons uniquement des programmes d\'agroforesterie qui participent au développement économique durable et à la promotion sociale des populations locales, et qui respectent et protègent ll\'environnement (essences locales et variées, respect de la biodiversité,...).\">We select only agroforestry programs that participate in sustainable economic development and social advancement of local populations, and that respect and protect ll&#39;environnement (local species and varied, maintaining biodiversity ,...).<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"Ainsi, UP2GREEN REFORESTATION permet d\'agir notamment dans les pays suivants : Brésil, Burundi, Colombie, Ethiopie, France, Inde, Indonésie, Haïti, Honduras, Mali, Pérou, Bolivie.\">Thus, UP2GREEN REFORESTATION can act in particular in the following countries: Brazil, Burundi, Colombia, Ethiopia, France, India, Indonesia, Haiti, Honduras, Mali, Peru, Bolivia.<br />\r\n	<br />\r\n	<br />\r\n	</span><br />\r\n	<span title=\"1.\">1. </span><span style=\"background-color: rgb(255, 255, 255);\" title=\"SOLUTION POUR LES ENTREPRISES/COLLECTIVITES : LA PLATE-FORME DE PLANTATION UP2GREEN\">SOLUTION FOR BUSINESS / COMMUNITY: THE PLATFORM FOR PLANTING UP2GREEN<br />\r\n	<br />\r\n	&nbsp;<br />\r\n	<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"UP2GREEN propose à toute organisation (entreprise, collectivité, association,...), petite ou grande, de devenir acteur de la reforestation en impliquant ses clients/partenaires et/ou ses collaborateurs.\">UP2GREEN offers to any organization (business, community, association ,...), large or small, to become an actor reforestation by involving customers / partners and / or its employees. </span><span title=\"En effet, de plus en plus d\'entreprises cherchent à jouer un rôle pour la Planète et à communiquer sur leur implication.\">Indeed, more and more companies are seeking to play a role for the Planet and to communicate about their involvement.<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"UP2GREEN leur propose non seulement d\'être acteur de la reforestation dans le Monde, mais aussi d\'impliquer directement leurs clients et collaborateurs.\">UP2GREEN their offers not only an actor of reforestation in the world, but also to directly involve their customers and employees.<br />\r\n	<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"En partenariat avec Up2green, une entreprise peut :\">In partnership with Up2green, a company can:<br />\r\n	<br />\r\n	</span><br />\r\n	<span title=\"1.\">1. </span><span style=\"background-color: rgb(255, 255, 255);\" title=\"Soit s\'engager à planter une quantité d\'arbres dans un ou plusieurs programmes de reforestation à chaque achat ou chaque moment clé de la relation client et communiquer sur cet engagement.\">Either commit to planting trees in an amount of one or several reforestation programs with every purchase or every time a key customer relationship and communicate that commitment.<br />\r\n	<br />\r\n	</span><br />\r\n	<span title=\"2.\">2. </span><span style=\"background-color: rgb(255, 255, 255);\" title=\"Soit offrir à ses clients des crédits arbres à l\'occasion d\'une campagne \'éco-citoyenne\' par exemple ou à tout moment de la relation client.\">Is offering its clients loans to trees during a campaign eco-citizen &#39;for example, or at any time of the customer relationship. </span><span style=\"background-color: rgb(255, 255, 255);\" title=\"Ce sont les clients eux-mêmes qui choisissent ensuite où les planter sur notre plate-forme virtuelle de plantation.\">These are the customers themselves who then choose where to plant them on our virtual platform planting. </span><span style=\"background-color: rgb(255, 255, 255);\" title=\"L\'entreprise peut par ailleurs suivre en temps réel l\'utilisation des crédits arbres via un petit intranet dédié.\">The company can also monitor in real time using credits via a small tree dedicated intranet.<br />\r\n	<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"Avec 1 crédit arbre inférieur à 1.5 euros, cette solution est très accessible économiquement.\">With a credit tree less than 1.5 euros, this solution is economically accessible.<br />\r\n	<br />\r\n	<br />\r\n	</span><br />\r\n	<span title=\"2.\">2. </span><span style=\"background-color: rgb(255, 255, 255);\" title=\"SOLUTION POUR LES PARTICULIERS : LE MOTEUR DE RECHERCHE UP2GREEN.COM\">SOLUTION FOR INDIVIDUALS: THE SEARCH ENGINE <a href=\"http://up2green.com\" target=\"_blank\">UP2GREEN.COM</a><br />\r\n	<br />\r\n	&nbsp;<br />\r\n	<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"UP2GREEN.COM permet aux particuliers de collecter gratuitement des crédits arbres au fil de leurs recherches sur Internet.\">UP2GREEN.COM allows individuals to collect credits for free trees over their Internet searches.<br />\r\n	<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"L\'internaute qui a créé un compte sur Up2green obtient des &quot;crédits-arbres&quot; à chacune des ses recherches en ligne, gratuitement.\">The user who created an account on Up2green gets &quot;credit-trees&quot; at each of their research online, for free. </span><span style=\"background-color: rgb(255, 255, 255);\" title=\"Il choisit ensuite où les planter parmi les programmes de reforestation partenaires d\'Up2green, sur la plate-forme de plantation virtuelle.\">It then chooses where to plant them among the reforestation programs Up2green partners on the platform of virtual plantation. </span></span></span></span></p>\r\n','en','notre_ambition'),(2,'Notre ambition','<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>VOUS INCITER A <span style=\"color: rgb(0, 128, 0);\">DEVENIR ACTEURS DE LA REFORESTATION</span></strong></span></span></p>\r\n','<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">L&#39;ambition de toute l&#39;&eacute;quipe d&#39;UP2GREEN est de sensibiliser le plus de monde possible au D&eacute;veloppement Durable et &agrave; la protection de la Plan&egrave;te en g&eacute;n&eacute;ral.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><strong><span style=\"font-family: arial,helvetica,sans-serif;\"><u>L&#39;association UP2GREEN REFORESTATION <span style=\"color: rgb(128, 0, 128);\">d&eacute;veloppe des outils</span> au service de la lutte contre la d&eacute;forestation dans le Monde et le r&eacute;chauffement climatique :</u></span></strong></span></p>\r\n<ul style=\"margin-left: 40px;\">\r\n	<li style=\"text-align: justify;\">\r\n		<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">un site de recherche internet qui finance la reforestation : <a href=\"http://www.up2green.com/\" target=\"_blank\">http://www.up2green.com/</a></span></span></li>\r\n	<li style=\"text-align: justify;\">\r\n		<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">une plate-forme de reforestation virtuelle : <a href=\"http://reforestation.up2green.com/\" target=\"_blank\">http://reforestation.up2green.com/</a> pour planter des arbres (gr&acirc;ce aux coupons distribu&eacute;s par les entreprises partenaires ou directement par les particuliers qui ont collect&eacute; des cr&eacute;dits gr&acirc;ce au moteur de recherche).</span></span></li>\r\n	<li style=\"text-align: justify;\">\r\n		<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">en d&eacute;veloppant des partenariats de reforestation ou en finan&ccedil;ant ses propres programmes (d&eacute;tail sur le site de l&#39;Association : <a href=\"http://association.up2green.com/\" target=\"_blank\">http://association.up2green.com/</a></span></span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><u><strong><span style=\"font-family: arial,helvetica,sans-serif;\">L&#39;association UP2GREEN REFORESTATION<span style=\"color: rgb(128, 0, 128);\"> finance</span> :</span></strong></u></span></p>\r\n<ul style=\"margin-left: 40px;\">\r\n	<li style=\"text-align: justify;\">\r\n		<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">ses propres programmes de reforestation : P&eacute;rou et Colombie</span></span></li>\r\n	<li style=\"text-align: justify;\">\r\n		<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">des partenaires sp&eacute;ciali&eacute;s dans l&#39;agroforesterie : Organismes institutionnels, ONG, Associations, Fondations,...</span></span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Nous s&eacute;lectionnons <strong>uniquement des programmes d&#39;agroforesterie</strong> qui participent au d&eacute;veloppement &eacute;conomique durable et &agrave; la promotion sociale des populations locales, et qui respectent et prot&egrave;gent ll&#39;environnement (essences locales et vari&eacute;es, respect de la biodiversit&eacute;,...).</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Ainsi, UP2GREEN REFORESTATION permet d&#39;agir notamment dans les pays suivants : Br&eacute;sil, Burundi, Colombie, Ethiopie, France, Inde, Indon&eacute;sie, Ha&iuml;ti, Honduras, Mali, P&eacute;rou, Bolivie.</span></span><span _fck_bookmark=\"1\" style=\"display: none;\"> </span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"color: rgb(128, 0, 128);\"><strong>1. SOLUTION POUR LES ENTREPRISES/COLLECTIVITES : <a href=\"http://reforestation.up2green.com/\" target=\"_blank\">LA PLATE-FORME DE PLANTATION UP2GREEN</a></strong></span></span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span _fck_bookmark=\"1\" style=\"display: none;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">UP2GREEN propose &agrave; toute organisation (entreprise, collectivit&eacute;, association,...), petite ou grande, de devenir acteur de la reforestation en impliquant ses clients/partenaires et/ou ses collaborateurs. En effet, de plus en plus d&#39;entreprises cherchent &agrave; jouer un r&ocirc;le pour la Plan&egrave;te et &agrave; communiquer sur leur implication.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">UP2GREEN leur propose non seulement d&#39;&ecirc;tre acteur de la reforestation dans le Monde, mais aussi d&#39;impliquer directement leurs clients et collaborateurs.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">En partenariat avec Up2green, une entreprise peut :</span></span></p>\r\n<p style=\"margin-left: 40px; text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"margin-left: 40px; text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">1. Soit <span style=\"color: rgb(0, 128, 0);\"><u><strong>s&#39;engager &agrave; planter une quantit&eacute; d&#39;arbres</strong></u> </span>dans un ou plusieurs programmes de reforestation &agrave; chaque achat ou chaque moment cl&eacute; de la relation client et communiquer sur cet engagement.</span></span></p>\r\n<p style=\"margin-left: 40px; text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"margin-left: 40px; text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">2. Soit <span style=\"color: rgb(0, 128, 0);\"><u><strong>offrir &agrave; ses clients des cr&eacute;dits arbres</strong></u></span> &agrave; l&#39;occasion d&#39;une campagne &#39;&eacute;co-citoyenne&#39; par exemple ou &agrave; tout moment de la relation client. Ce sont les clients eux-m&ecirc;mes qui choisissent ensuite o&ugrave; les planter sur notre plate-forme virtuelle de plantation. L&#39;entreprise peut par ailleurs suivre en temps r&eacute;el l&#39;utilisation des cr&eacute;dits arbres via un petit intranet d&eacute;di&eacute;.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><u><strong>Avec 1 cr&eacute;dit arbre inf&eacute;rieur &agrave; 1.5 euros</strong></u>, cette solution est tr&egrave;s accessible &eacute;conomiquement.</span></span><span _fck_bookmark=\"1\" style=\"display: none;\"> </span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"color: rgb(128, 0, 128);\"><strong>2. SOLUTION POUR LES PARTICULIERS : LE MOTEUR DE RECHERCHE <a href=\"http://www.up2green.com\" target=\"_blank\">UP2GREEN.COM</a></strong></span></span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span _fck_bookmark=\"1\" style=\"display: none;\">&nbsp;</span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><a href=\"http://www.up2green.com\" target=\"_blank\">UP2GREEN.COM</a> permet aux particuliers de collecter gratuitement des cr&eacute;dits arbres au fil de leurs recherches sur Internet.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">L&#39;internaute qui a cr&eacute;&eacute; un compte sur Up2green obtient des &quot;cr&eacute;dits-arbres&quot; &agrave; chacune des ses recherches en ligne, gratuitement. Il choisit ensuite o&ugrave; les planter parmi les programmes de reforestation partenaires d&#39;Up2green, sur la <a href=\"http://reforestation.up2green.com/\" target=\"_blank\">plate-forme de plantation virtuelle</a>.</span></span></p>\r\n','fr','notre_ambition'),(3,'Fonders','<br />\r\n','<br />\r\n','en','fondateurs'),(3,'Les fondateurs','<br />\r\n','<p style=\"text-align: justify;\">\r\n	<span style=\"color: rgb(0, 100, 0);\"><span style=\"font-size: 14px;\"><strong><span style=\"background-color: rgb(255, 255, 255);\">David COLON (37 </span><span style=\"background-color: rgb(255, 255, 255);\">ans</span><span style=\"background-color: rgb(255, 255, 255);\">) - Pr&eacute;sident </span></strong></span></span><span style=\"font-size: 14px;\"><span style=\"color: rgb(0, 100, 0);\"><strong><span>d&#39;Up2green</span> Reforestation</strong></span></span></p>\r\n<p style=\"margin-left: 40px; text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Apr&egrave;s l&#39;Ecole Polytechnique, il entre &agrave; l&#39;Ecole du G&eacute;nie Rural et des Eaux et For&ecirc;ts. Il aura l&#39;occasion d&#39;y mener notamment un projet de reforestation pour le service RTM de l&#39;ONF (Restauration des Terrains en Montagne). Il se sp&eacute;cialise ensuite dans la gestion des d&eacute;l&eacute;gations de services publics et la direction d&#39;entreprise. D&#39;abord en charge de la direction de centres d&#39;exploitations de services publics d&#39;eau et d&#39;assainissement en Angleterre et en France, il dirige actuellement en Ile-de-France les &eacute;tablissements et filiales de transport public de voyageurs de l&#39;un des groupes leaders des services &agrave; l&#39;Environnement. Exp&eacute;riment&eacute; dans le redressement des situations sociales et manag&eacute;riales difficiles, il d&eacute;veloppe notamment dans l&#39;une de entreprises qu&#39;il dirige une d&eacute;clinaison op&eacute;rationnelles des nouveaux principes de <a href=\"http://fr.wikipedia.org/wiki/Responsabilit%C3%A9_sociale_des_entreprises\" target=\"_blank\">responsabilit&eacute; soci&eacute;tale (RSE)</a> port&eacute;s par la toute r&eacute;cente norme <a href=\"http://fr.wikipedia.org/wiki/ISO_26000\" target=\"_blank\">ISO26000</a>.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">David est &eacute;galement membre de l&#39;Association X-Environnement (<a href=\"http://www.x-environnement.org\" target=\"_blank\">www.x-environnement.org</a>) et membre du <a href=\"http://www.club-horizons.com\" target=\"_blank\">Club Horizons</a>.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 14px;\"><span style=\"color: rgb(0, 100, 0);\"><strong>Antoine GERIGNE (36 ans) - Vice-Pr&eacute;sident d&#39;Up2green Reforestation</strong></span></span></p>\r\n<p style=\"text-align: justify; margin-left: 40px;\">\r\n	<span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 12px;\">A sa sortie de l&#39;Ecole Normale Sup&eacute;rieure de Lyon, il s&#39;oriente vers l&#39;Ecole Nationale du G&eacute;nie Rural, des Eaux et des For&ecirc;ts o&ugrave; il se sp&eacute;cialise dans la gestion de la ressource en eau et travaille deux ans en Am&eacute;rique du Sud sur les sch&eacute;mas directeurs d&#39;eau potable et d&#39;assainissement. Apr&egrave;s six ans pass&eacute;s dans le conseil en strat&eacute;gie de croissance et efficacit&eacute; commerciale aupr&egrave;s des grands groupes industriels, il choisit de revenir de plein pied dans les probl&eacute;matiques de d&eacute;veloppement durable en int&eacute;grant le groupe leader des services &agrave; l&#39;Environnement dans le domaine de l&#39;Energie, en tant que responsable Comptes Strat&eacute;giques. Il entre ensuite &agrave; la Direction du D&eacute;veloppement Durable de ce groupe pour enrichir les offres commerciales aupr&egrave;s des industriels et des collectivit&eacute;s sur les volets du environnemental et soci&eacute;tal.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 12px;\">Antoine est &eacute;galement administrateur du Club Horizons &laquo; Agir pour Demain &raquo; (<a href=\"http://www.club-horizons.com\" target=\"_blank\">www.club-horizons.com</a>).</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"color: rgb(0, 100, 0);\"><span style=\"font-size: 14px;\"><strong><span style=\"background-color: rgb(255, 255, 255);\">Maikov D<span _fck_bookmark=\"1\" style=\"display: none;\">&nbsp;</span>UMAS (27 <span>ans</span>)</span><span style=\"font-weight: bold;\"> - Directeur Technique d&#39;Up2green Reforestation</span></strong></span></span><span _fck_bookmark=\"1\" style=\"display: none;\"> </span></p>\r\n<p style=\"margin-left: 40px; text-align: justify;\">\r\n	<span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 12px;\">I<span>ng&eacute;nieur</span><span> en agro-d&eacute;veloppement international depuis 2007 (ISTOM), il s&#39;est sp&eacute;cialis&eacute; dans le secteur forestier tout au long de son parcours. Apr&egrave;s une premi&egrave;re exp&eacute;rience en Institut de Recherche en foresterie tropicale en Malaisie, il a travaill&eacute; en exploitation foresti&egrave;re au Cameroun et en RD Congo en tant qu&#39;am&eacute;nagiste des for&ecirc;ts &eacute;quatoriales. Son parcours s&#39;est &eacute;galement ponctu&eacute; d&#39;une &eacute;tude d&#39;impact environnementale d&#39;un programme de reforestation en Colombie pour le compte d&#39;ONF International . Il a par la suite particip&eacute; et lanc&eacute; des programmes d&#39;agroforesterie avec son association <a href=\"http://www.forestever.org\" target=\"_blank\">FORESTEVER </a>pour sensibiliser et former des communaut&eacute;s locales en Amazonie. Il a rejoint par la suite l&#39;&eacute;quipe fondatrice de l&#39;Association Up2green Reforestation afin d&#39;assurer le suivi op&eacute;rationnel des plantations financ&eacute;es directement par Up2green Reforestation, <a href=\"http://www.youtube.com/watch?v=---TWhc7h2Q\" target=\"_blank\">notamment celles d&eacute;j&agrave; engag&eacute;es avec Forestever.</a></span></span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 12px;\"><span>Maikov d&eacute;veloppe actuellement une m&eacute;thodologie de contr&ocirc;le et d&#39;audit des plantations en lien avec des organismes d&#39;&eacute;co-certification.</span></span></span></p>\r\n<hr />\r\n<p style=\"text-align: justify;\">\r\n	<strong><u><span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Quelques vid&eacute;os anciennent avec les fondateurs :</span></span></u></strong></p>\r\n<ul style=\"margin-left: 40px;\">\r\n	<li>\r\n		<span style=\"color: rgb(0, 128, 0);\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 11px;\"><a href=\"http://www.youtube.com/watch?v=WfLBqEMoNs8\" target=\"_blank\">France3 - <span>pr&eacute;sentation</span> du <span>1er</span> site <span>Up2green</span> avant <span>sa</span> <span>refonte</span> en 2010</a></span></span></span></li>\r\n	<li>\r\n		<a href=\"http://www.youtube.com/watch?v=za0-2hCmri4\" target=\"_blank\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 11px;\">Une initiative &agrave; Copenhague en 2009 : le site one-million-trees.com</span></span></a><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"color: rgb(0, 128, 0);\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 11px;\"><a href=\"http://www.youtube.com/watch?v=---TWhc7h2Q\" target=\"_blank\"><span>Maikov</span> Dumas et de <span>ses</span> <span>premi&egrave;res</span> actions <span>avec</span> <span>Forestever</span> avant de <span>rejoindre</span> <span>Up2green</span> Reforestation</a></span></span></span></li>\r\n</ul>\r\n','fr','fondateurs'),(4,'About deforestation','<br />\r\n','<br />\r\n','en','Deforestation'),(4,'La Déforestation','<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>La d&eacute;forestation en bref...</strong></span></span></p>\r\n','<p>\r\n	Ce diagramme r&eacute;sume de longues explications :</p>\r\n<p>\r\n	<img alt=\"\" src=\"/uploads/ck/images/800px-Deforestation.png\" style=\"width: 549px; height: 305px; float: left;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><em><strong>D&#39;apr&egrave;s la FAO</strong></em></span></span></p>\r\n<ul>\r\n	<li>\r\n		<p style=\"margin-left: 40px;\">\r\n			<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">13 millions d&#39;Hectares sont d&eacute;truits chaque ann&eacute;e</span></span></p>\r\n	</li>\r\n	<li>\r\n		<p style=\"margin-left: 40px;\">\r\n			<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">soit 1 terrain de football chaque seconde</span></span></p>\r\n	</li>\r\n	<li>\r\n		<p style=\"margin-left: 40px;\">\r\n			<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">soit la surface de l&#39;Angleterre par an</span></span></p>\r\n	</li>\r\n	<li>\r\n		<p style=\"margin-left: 40px;\">\r\n			<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">soit 86% de la for&ecirc;t fran&ccedil;aise par an</span></span></p>\r\n	</li>\r\n</ul>\r\n<p style=\"margin-left: 40px;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">La perte annuelle de for&ecirc;t dans le Monde est de 0.18%.</span></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><em><strong>D&#39;apr&egrave;s le LAROUSSE</strong></em></span></span></p>\r\n<p style=\"margin-left: 40px;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Au rythme de destruction actuel, les enfants qui naissent au d&eacute;but du 21&egrave;me si&egrave;cle devraient assister avant la fin de leur vie &agrave; la disparition totale des for&ecirc;ts primaires du monde, &agrave; l&#39;exception de rares espaces difficilement accessibles. Les for&ecirc;ts primaires sont dans la situation la plus critique car, au rythme de la d&eacute;forestation actuel, elles auront disparu :</span></span></p>\r\n<ul>\r\n	<li style=\"margin-left: 40px;\">\r\n		<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">en Afrique dans 10 ans</span></span></li>\r\n	<li style=\"margin-left: 40px;\">\r\n		<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">en Asie du Sud- Est dans 15 ans</span></span></li>\r\n	<li style=\"margin-left: 40px;\">\r\n		<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">en Amazonie dans 40 ans maximum</span></span></li>\r\n</ul>\r\n<p style=\"margin-left: 40px;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Concernant la for&ecirc;t amazonienne, on estime sa perte de superficie &agrave; pr&egrave;s de 5 millions d&#39;hectares/an et, &agrave; ce rythme, les &eacute;tudes scientifiques ne garantissent pas le cycle de 25 &agrave; 30 ans n&eacute;cessaire pour sa r&eacute;g&eacute;n&eacute;ration.</span></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><em><strong>Pour en savoir plus : <a href=\"http://fr.wikipedia.org/wiki/D%C3%A9forestation\" target=\"_blank\">l</a><a href=\"http://fr.wikipedia.org/wiki/D%C3%A9forestation\" target=\"_blank\">a </a><a href=\"http://fr.wikipedia.org/wiki/D%C3%A9forestation\" target=\"_blank\">d&eacute;forestation (wikipedia)</a></strong></em></span></span></p>\r\n','fr','Deforestation'),(5,'7 good raisons to plant trees','<br />\r\n','<br />\r\n','en','7-bonnes-raisons-de-planter-des-arbres'),(5,'7 bonnes raisons de planter des arbres','<p>\r\n	<span style=\"color: rgb(0, 128, 0);\"><strong>Plantons des arbres</strong></span></p>\r\n<p>\r\n	Au-delà de l\'importance symbolique de l\'arbre au sein des différentes sociétés, cultures ou religions, celui-ci revêt une importance capitale pour la fabrication d\'un grand nombre de produits et matières premières ainsi que pour la protection de l\'environnement.</p>\r\n','<p align=\"center\">\r\n	 </p>\r\n<p align=\"center\">\r\n	<span style=\"color: rgb(0, 128, 0);\"><strong>7 bonnes raisons de planter des arbres</strong></span></p>\r\n<p>\r\n	<strong>1.</strong> Les arbres font reculer la désertification ; ils limitent l\'érosion en stabilisant le sol et en réduisant le ruissellement.</p>\r\n<p>\r\n	<strong>2.</strong> Ils contribuent à ralentir le réchauffement climatique en absorbant le CO2 de l\'atmosphère lorsqu\'ils sont en croissance ; ils constituent ainsi de véritables “puits de carbone?, réduisant la concentration des gaz à effet de serre dans l\'atmosphère.</p>\r\n<p>\r\n	<strong>3.</strong> Ils retiennent l\'eau grâce à leurs racines et à la couche d\'humus ; ils épurent les sols grâce à leur système racinaire qui agit comme un filtre vis-à-vis des polluants ; ils permettent d\'alimenter les nappes phréatiques en eau de qualité, minérale et organique, très stable.</p>\r\n<p>\r\n	<strong>4.</strong> Ils rafraîchissent l\'air et jouent un rôle de tampon vis-à-vis des variations climatiques.</p>\r\n<p>\r\n	<strong>5.</strong> Ils abritent la faune et la flore ; les forêts tropicales abriteraient plus de 75% des espèces vivantes sur Terre.</p>\r\n<p>\r\n	<strong>6.</strong> Ils nous offrent de nombreux produits (bois, fruits, ingrédients de médicaments, boissons, fourrage)</p>\r\n<p>\r\n	<strong>7.</strong> Ils servent d\'écran au bruit et de brise-vent.</p>\r\n','fr','7-bonnes-raisons-de-planter-des-arbres'),(6,'Certicfication and labels','<br />\r\n','<br />\r\n','en','certifications-et-labels'),(6,'Certifications et labels','<p>\r\n	Quelques notions sur les certifications et labels courants que nous renconrons au quotidien sur les produits manufacturés que nous achetons.</p>\r\n','<p>\r\n	<span style=\"color: rgb(0, 128, 0);\"><strong>Certificat FSC<br />\r\n	(</strong><strong>Forest</strong><strong>Stewardship</strong><strong> Council) :</strong>  </span></p>\r\n<p>\r\n	Le label FSC garantit que le bois que vous achetez n\'a pas contribué à la disparition de forêts anciennes, il s\'agit d\'une écocertification. En résumé, c\'est une certification qui garantit une exploitation durable de la forêt avec en prime un traitement juste et équitable pour les populations autochtones et les travailleurs forestiers.<br />\r\n	<br />\r\n	Cette certification concerne en priorité les bois exotiques dont les essences sont utilisées principalement pour les bois exposés à l\'humidité (mobilier de jardin, fenêtres, bijoux en bois...). Pour les autres types de mobilier, mieux vaut préférer des essences locales moins menacées.</p>\r\n<p>\r\n	<br />\r\n	<span style=\"color: rgb(0, 128, 0);\"><strong>Certificat PEFC<br />\r\n	(Programme européen des forêts certifiées) :</strong>    </span></p>\r\n<p>\r\n	Cette certification est attribuée aux forêts gérées selon les principes de la gestion forestière durable, adoptés lors de la conférence paneuropéenne d\'Helsinki, en 1993.<br />\r\n	<br />\r\n	Il est indispensable d\'exploiter régulièrement la forêt, et le bois énergie constitue un débouché qui permet aux «forestiers»de rentabiliser cette exploitation.</p>\r\n','fr','certifications-et-labels'),(7,'Accepted ideas','<br />\r\n','<br />\r\n','en','quelques-idees-recues'),(7,'Quelques idées reçues','<p>\r\n	<strong>Les enjeux de reforestation en quelques questions !!</strong></p>\r\n','<p style=\"margin-left: 18pt;\">\r\n	<span style=\"color: rgb(0, 128, 0);\"><strong>En plantant des arbres, je stocke du CO2 ! </strong></span></p>\r\n<p style=\"margin-left: 18pt;\">\r\n	<strong><em>VRAI ET FAUX !</em></strong></p>\r\n<p style=\"margin-left: 80px; text-align: justify;\">\r\n	<span style=\"font-size: 12px;\">Le jour, un arbre absorbe du gaz carbonique pour fabriquer la cellulose et le bois qui le constitue, gr&acirc;ce &agrave; la photosynth&egrave;se. En retour, il lib&egrave;re de l&#39;oxyg&egrave;ne. La nuit au contraire, il &eacute;met du CO2 lors de la respiration.</span></p>\r\n<p style=\"margin-left: 80px; text-align: justify;\">\r\n	<span style=\"font-size: 12px;\">Aussi, <strong>une for&ecirc;t doit &ecirc;tre globalement en croissance pour absorber plus de CO2 qu&#39;elle n&#39;en rejette</strong>. Une for&ecirc;t adulte peut en effet pr&eacute;senter un bilan carbone neutre voire n&eacute;gatif si elle est en d&eacute;clin. A maturit&eacute;, une for&ecirc;t lib&egrave;re en effet des gaz &agrave; effet de serre par putr&eacute;faction (respiration des micro-organismes qui se nourrissent du bois mort).</span></p>\r\n<p style=\"margin-left: 80px; text-align: justify;\">\r\n	<span style=\"font-size: 12px;\">Par ailleurs, le stockage du CO2 de l&#39;atmosph&egrave;re par un arbre en croissance (qui consomme plus de CO2 qu&#39;il n&#39;en rejette lors de sa respiration) est d&#39;autant plus important que l&#39;esp&egrave;ce croit vite. Le choix de l&#39;essence &agrave; planter est donc importante.</span><span _fck_bookmark=\"1\" style=\"display: none;\">&nbsp;</span></p>\r\n<p style=\"margin-left: 18pt;\">\r\n	&nbsp;</p>\r\n<p style=\"margin-left: 18pt;\">\r\n	<span style=\"color: rgb(0, 128, 0);\"><strong>La for&ecirc;t europ&eacute;enne est en danger !</strong></span></p>\r\n<p>\r\n	<span _fck_bookmark=\"1\" style=\"display: none;\">&nbsp;</span></p>\r\n<p style=\"margin-left: 18pt;\">\r\n	<strong><em>FAUX !</em></strong></p>\r\n<p style=\"margin-left: 80px; text-align: justify;\">\r\n	<span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 12px;\">Couper du bois (de mani&egrave;re raisonn&eacute;e) ne fait pas dispara&icirc;tre les for&ecirc;ts, mais les entretient, et permet leur extension et leur accroissement.</span></span></p>\r\n<p style=\"margin-left: 80px; text-align: justify;\">\r\n	<span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 12px;\">Il convient donc d&#39;exploiter et de g&eacute;rer la for&ecirc;t durablement, c&#39;est-&agrave;-dire de ne pas pr&eacute;lever plus que son accroissement annuel, et de laisser sur le sol un minimum de mati&egrave;re et de r&eacute;manents pour r&eacute;g&eacute;n&eacute;rer les sols.</span></span></p>\r\n<p style=\"margin-left: 80px; text-align: justify;\">\r\n	<span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"font-size: 12px;\">Une &eacute;tude de l&#39;EEA (Agence Europ&eacute;enne de l&#39;Environnement), int&eacute;grant des crit&egrave;res environnementaux accrus ainsi qu&#39;une utilisation raisonn&eacute;e des for&ecirc;ts, a montr&eacute; que le potentiel &eacute;nerg&eacute;tique de la for&ecirc;t en Europe &eacute;tait encore grand. Toutefois cette &eacute;tude a permis de montrer que le seuil acceptable d&#39;exploitation de la for&ecirc;t est en passe d&#39;&ecirc;tre atteint dans certains pays.</span></span><span _fck_bookmark=\"1\" style=\"display: none;\">&nbsp;</span></p>\r\n<p style=\"margin-left: 18pt;\">\r\n	&nbsp;</p>\r\n<p style=\"margin-left: 18pt;\">\r\n	<span style=\"color: rgb(0, 128, 0);\"><strong>Br&ucirc;ler du Bois, &ccedil;a pollue !</strong></span></p>\r\n<p>\r\n	<span _fck_bookmark=\"1\" style=\"display: none;\">&nbsp;</span></p>\r\n<p style=\"margin-left: 18pt;\">\r\n	<strong><em>VRAI ET FAUX !</em></strong></p>\r\n<p style=\"margin-left: 80px; text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">D&#39;un point de vue des &eacute;missions en CO2, on consid&egrave;re que le bois est neutre car <strong>il rejette, lors de la combustion, le CO2 qu&#39;il a capt&eacute; pendant sa croissance</strong>.</span></span></p>\r\n<p style=\"margin-left: 80px; text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">En revanche, les fum&eacute;es de bois comportent un certain nombre de composants qui sont r&eacute;glement&eacute;s (NOx, SOx, CO, poussi&egrave;res&hellip;). Ils d&eacute;pendent en partie de la qualit&eacute; et composition du combustible et du bon r&eacute;glage des installations. C&#39;est pourquoi les chaufferies industrielles sont &eacute;quip&eacute;es de traitements de fum&eacute;es.</span></span></p>\r\n','fr','quelques-idees-recues'),(8,'How to plant a tree !','','<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span class=\"long_text\" id=\"result_box\" lang=\"en\"><span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">1</span><span title=\"Cliquer ici pour voir d\'autres traductions\">.</span> <span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">You</span> <span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">must</span> <span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">first</span> <span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">dig</span> <span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">a</span> <span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">hole</span> <span class=\"hps atn\" title=\"C