dans le trou.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Le plant doit toujours &ecirc;tre manipul&eacute; par les racines et jamais par le tronc.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Il faut &eacute;taler au maximum les racines.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><img alt=\"\" src=\"/uploads/ck/images/planter_arbre.jpg\" style=\"width: 322px; height: 319px;\" /></span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">2. Une fois l&#39;arbre pos&eacute; dans le trou, vous pouvez combler celui-ci de terre. Le plant doit tenir bien droit. Il faut ensuite tasser la terre le plus fermement possible.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">&nbsp;</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">3. Les engrais ne sont pas n&eacute;cessaires au moment de la plantation. En revanche, il faut <strong>arroser abondamment le plant </strong>pour permettre notamment &agrave; la terre de bien se stabiliser.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">N&#39;oubliez pas que la croissance de l&#39;arbuste doit ensuite &ecirc;tre surveill&eacute;e afin notamment de le prot&eacute;ger des insectes et des animaux. Il faut bien entendu d&eacute;sherber r&eacute;guli&egrave;rement.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">&nbsp;</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">NB : Si vous plantez plusieurs arbustes, n&#39;oubliez pas de les espacer.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">En effet ils ont besoin d&#39;a&eacute;ration pour la croissance des branches. Il faut &eacute;galement faire attention &agrave; la s&eacute;cheresse et penser &agrave; les arroser r&eacute;guli&egrave;rement, surtout pendant les premiers mois. Surveillez bien le jaunissement des feuilles et n&#39;h&eacute;sitez pas &agrave; tailler les branches pour limiter la propagation des maladies et des parasites.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<a href=\"http://www.linternaute.com/jardin/arbre-arbuste/tutoriel-pratique/planter-un-arbre/1.shtml\" target=\"_blank\"><span style=\"color: rgb(0, 128, 0);\"><span style=\"font-size: 14px;\"><em><strong><span style=\"font-family: arial,helvetica,sans-serif;\">En savoir plus...</span></strong></em></span></span></a></p>\r\n<p style=\"text-align: center;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><img alt=\"\" src=\"/uploads/ck/images/Plant_a_tree.jpg\" style=\"width: 140px; height: 183px;\" /></span></span></p>\r\n','fr','savez-vous-planter-un-arbre'),(9,'Reforestation programs','<p>\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span class=\"long_text\" lang=\"en\"><span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">Agroforestry</span><span title=\"Cliquer ici pour voir d\'autres traductions\">:</span> <span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">maintainin