pour voir d\'autres traductions\">Peru</span><span title=\"Cliquer ici pour voir d\'autres traductions\">, Brazil,</span> <span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">Colombia</span><span title=\"Cliquer ici pour voir d\'autres traductions\">)</span> <span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">than</span> <span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">those</span> <span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">we fund</span> <span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">through our</span> <span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">partners</span><span title=\"Cliquer ici pour voir d\'autres traductions\">.</span></span></div>\r\n</div>\r\n<p style=\"text-align: center;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><img alt=\"\" src=\"../../uploads/ck/images/Agroforesterie_Up2green.jpg\" style=\"width: 408px; height: 273px;\" /></span></span></p>\r\n','en','reforestation-programs'),(9,'Nos programmes de reforestation','<p>\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"color: rgb(0, 128, 0);\"><strong>L&#39;agroforesterie : </strong></span>respect de la biodiversit&eacute;, &eacute;thique et <a href=\"http://fr.wikipedia.org/wiki/D%C3%A9veloppement_durable\" target=\"_blank\">d&eacute;veloppement durable</a> pour les populations locales.</span></span></p>\r\n','<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">UP2GREEN REFORESTATION offre 2 types de programmes :</span></span></p>\r\n<ul style=\"margin-left: 40px;\">\r\n	<li style=\"text-align: justify;\">\r\n		<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">ceux que nous finan&ccedil;ons et pilotons directement sur le terrain</span></span></li>\r\n</ul>\r\n<p>\r\n	&nbsp;</p>\r\n<ul style=\"margin-left: 40px;\">\r\n	<li style=\"text-align: justify;\">\r\n		<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">ceux que nous finan&ccedil;ons via des partenaires.</span></span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Tous les programmes d&#39;UP2GREEN REFORESTATION sont <span style=\"color: rgb(0, 128, 0);\">durables</span> car ils sont strictement s&eacute;lectionn&eacute;s pour respecter les principes de l&#39;<a href=\"http://fr.wikipedia.org/wiki/Agroforesterie\" target=\"_blank\"><span style=\"color: rgb(0, 128, 0);\">agroforesterie</span></a> : implication et soutien des populations locales qui les exploitent, respect des essences locales et de la biodiversit&eacute;, capacit&eacute; &agrave; g&eacute;n&eacute;rer une &eacute;conomie locale p&eacute;renne.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Ceci est le cas aussi bien pour les programmes que nous d&eacute;veloppons directement (P&eacute;rou, Br&eacute;sil, Colombie) que pour ceux que nous finan&ccedil;ons via nos partenaires.</span></span></p>\r\n<p style=\"text-align: center;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><img alt=\"\" src=\"/uploads/ck/images/Agroforesterie_Up2green.jpg\" style=\"width: 408px; height: 273px;\" /></span></span></p>\r\n','fr','nos-programmes-de-reforestation'),(10,'Our partners for plantation','<br />\r\n','<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span class=\"long_text\" id=\"result_box\"><strong><span style=\"color: rgb(0, 128, 0);\"><span style=\"background-color: rgb(255, 255, 255);\" title=\"L\'Office National des Fôrets (ONF) :\">The french National Forests Office (ONF):<br />\r\n	</span></span></strong><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"L\'ONF gère directement pour le compte de l\'Etat et des Collectivités Locales plus de 12 millions d\'hectares de forêts et d\'espaces naturels d\'une grande diversité.\">The ONF operates directly on behalf of the State and Local Government over 12 million hectares of forests and natural areas of great diversity. </span><span style=\"background-color: rgb(255, 255, 255);\" title=\"L\'Etat a confié à l\'Office quatre grandes missions d\'intérêt général et qui le place parmi les acteurs incontournables du Développement Durable :\">The state has contracted with the Office four major missions of general interest and which places it among the key players of Sustainable Development:<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"• La protection - du territoire par la gestion des risques naturels - de la forêt par la création de réserves naturelles et biologique;\">&bull; Protection - the territory by the management of natural risks - the forest through the establishment of nature reserves and biological;<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"• La production en conjugant les exigences économiques, écologiques et sociales;\">&bull; Production in combing of economic, ecological and social<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"• L\'accueil du public par les aménagements, l\'information et la sensibilisation à l\'environnement;\">&bull; Public reception by the facilities, information and environmental awareness;<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"• L\'activité de \'partenaire naturel\' au service de tous les responsables de milieux naturels (au plan national et international)\">&bull; The activity of &#39;natural partner&#39; in the service of all those responsible for natural areas (national and international)<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"L\'ONF intervient sur la dynamique d\'évolution des milieux pour :\">The ONF on the dynamics of changing environments for:<br />\r\n	<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"• Assurer le renouvellement des peuplements forestiers;\">&bull; Ensure the renewal of forest stands;<br />\r\n	</span><br />\r\n	<span title=\"• Maintenir la biodiversité;\">&bull; Maintain biodiversity;<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"• Favoriser la restauration d\'un équilibre quand il est dégradé;\">&bull; Promote restoration of a balance when it is degraded;<br />\r\n	</span><br />\r\n	<span title=\"• Limiter certaines dynamiques d\'évolutions;\">&bull; Limit some dynamic changes;<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"• Minimiser les impacts négatifs sur les milieux;\">&bull; Minimize adverse impacts on the environment;<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"Pour plus d\'informations, nous vous invitons à visiter le site de notre partenaire : www.onf.fr\">For more information, please visit our partner: www.onf.fr</span></span></span></span><br />\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<br />\r\n	<br />\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span class=\"long_text\"><span style=\"color: rgb(0, 128, 0);\"><strong><span title=\"Planète-Urgence :\">Plan&egrave;te-Urgence:<br />\r\n	<br />\r\n	</span></strong></span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"Planète Urgence est une association en pleine croissance, particulièrement innovante, active, utile et efficace pour former les Hommes et protéger la Nature.\">Plan&egrave;te Urgence is an association growing, highly innovative, active, useful and effective to train men and protect nature.<br />\r\n	<br />\r\n	</span><br />\r\n	<span title=\"Ainsi, elle permet à tous de partir en congé solidaire au Sud.\">Thus, it allows everyone to go on Leave for the South. </span><span style=\"background-color: rgb(255, 255, 255);\" title=\"Les volontaires bénévoles partent en mission d\'appui à des initiatives.\">The volunteers go on a mission to support the initiatives.<br />\r\n	<br />\r\n	</span><br />\r\n	<span title=\"Son objectif est de favoriser les initiatives des citoyens du Sud, de leur transmettre des savoir-faire; pas de se substituer à eux.\">Its objective is to promote the initiatives of citizens of the South, to pass on know-how, not to replace them. </span><span style=\"background-color: rgb(255, 255, 255);\" title=\"Qu\'il s\'agisse de missions de formation, de soutien ou de renforcement des capacités, ses partenaires du Sud définissent eux-mêmes les besoins et les objectifs auxquels Planète-Urgence cherche à répondre.\">Whether training missions, support or capacity building, its southern partners define their own needs and goals that Planet Emergency seeks to address.<br />\r\n	<br />\r\n	</span><br />\r\n	<span title=\"Via ses packs de reforestation, cette association permet de compenser ses émissions de CO2.\">Via its packs reforestation, this association can offset its CO2 emissions.</span><br />\r\n	<br />\r\n	<br />\r\n	<span title=\"Pour plus d\'informations, nous vous invitons à visiter le site de notre partenaire : www.planete-urgence.org\">For more information, please visit our partner: www.planete-urgence.org</span></span></span></span><br />\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<br />\r\n	<br />\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span class=\"long_text\"><span style=\"color: rgb(0, 128, 0);\"><strong><span title=\"Trees For the Future :\">Trees For the Future:<br />\r\n	<br />\r\n	</span></strong></span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"Trees For the Future est une ONG américaine qui mène des actions concrètes sur le terrain dans le domaine de l\'agro-foresterie.\">Trees For the Future is an American NGO which conducts actions on the ground in the field of agro-forestry.<br />\r\n	<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"Par le biais de la distribution des semences, de création de pépinières, d\'encadrement et de formation à l\'agroforesterie et à la gestion durable des forêts, TFT contribue depuis 1989 à protéger l\'environnement et à préserver les moyens de subsistance traditionnels des\">Through seed distribution, creation of nurseries, coaching and training in agroforestry and sustainable forest management, TFT contributes since 1989 to protect the environment and preserve traditional livelihoods of </span><span style=\"background-color: rgb(255, 255, 255);\" title=\"populations locales.\">local populations.<br />\r\n	<br />\r\n	</span><br />\r\n	<span title=\"Ainsi, TFT fournit des connaissances techniques sur l\'agroforesterie et le développement durable, ainsi que du matériel de plantation, afin que les collectivités puissent réhabiliter leurs terres souvent dégradées et promouvoir une production durable.\">Thus, TFT provides technical knowledge on agroforestry and sustainable development, as well as planting material, so that communities can often rehabilitate degraded lands and promote sustainable production.<br />\r\n	<br />\r\n	</span><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"Pour plus d\'informations, nous vous invitons à visiter le site de notre partenaire (en anglais ou espagnol) : www.treesftf.org\">For more information, please visit our partner (in English or Spanish): www.treesftf.org<br />\r\n	<br />\r\n	</span><br />\r\n	<strong><span style=\"color: rgb(0, 128, 0);\"><span title=\"Eco-Kyoto :\">Eco-Kyoto<br />\r\n	<br />\r\n	</span></span></strong><br />\r\n	<span style=\"background-color: rgb(255, 255, 255);\" title=\"La fondation Eco-Kyoto/Guinéea été créée en 2007 en Guinée Conakry à l\'image de la Fondation Eco-Kyoto Canada qui a pour mission principale d\'accompagner des différents intervenants environnementaux pour l\'attente des objectifs du « Protocole de Kyoto ».\">Eco-Kyoto/Guin&eacute;ea Foundation was established in 2007 in Guinea Conakry in the image of the Canada-Kyoto Eco Foundation whose mission is primarily to support various environmental stakeholders for the achievement of objectives of the &quot;Kyoto Protocol&quot;.<br />\r\n	</span></span></span></span></p>\r\n','en','our-partners-for-plantation'),(10,'Nos partenaires planteurs','<br />\r\n','<p>\r\n	<span style=\"color: rgb(0, 128, 0);\"><strong>L&#39;Office National des F&ocirc;rets (ONF) :</strong></span></p>\r\n<p>\r\n	L&#39;ONF g&egrave;re directement pour le compte de l&#39;Etat et des Collectivit&eacute;s Locales plus de 12 millions d&#39;hectares de for&ecirc;ts et d&#39;espaces naturels d&#39;une grande diversit&eacute;. L&#39;Etat a confi&eacute; &agrave; l&#39;Office quatre grandes missions d&#39;int&eacute;r&ecirc;t g&eacute;n&eacute;ral et qui le place parmi les acteurs incontournables du D&eacute;veloppement Durable :</p>\r\n<p>\r\n	&bull; La protection - du territoire par la gestion des risques naturels - de la for&ecirc;t par la cr&eacute;ation de r&eacute;serves naturelles et biologique;</p>\r\n<p>\r\n	&bull; La production en conjugant les exigences &eacute;conomiques, &eacute;cologiques et sociales;</p>\r\n<p>\r\n	&bull; L&#39;accueil du public par les am&eacute;nagements, l&#39;information et la sensibilisation &agrave; l&#39;environnement;</p>\r\n<p>\r\n	&bull; L&#39;activit&eacute; de &#39;partenaire naturel&#39; au service de tous les responsables de milieux naturels (au plan national et international)</p>\r\n<p>\r\n	L&#39;ONF intervient sur la dynamique d&#39;&eacute;volution des milieux pour :</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&bull; Assurer le renouvellement des peuplements forestiers;</p>\r\n<p>\r\n	&bull; Maintenir la biodiversit&eacute;;</p>\r\n<p>\r\n	&bull; Favoriser la restauration d&#39;un &eacute;quilibre quand il est d&eacute;grad&eacute;;</p>\r\n<p>\r\n	&bull; Limiter certaines dynamiques d&#39;&eacute;volutions;</p>\r\n<p>\r\n	&bull; Minimiser les impacts n&eacute;gatifs sur les milieux;</p>\r\n<p>\r\n	Pour plus d&#39;informations, nous vous invitons &agrave; visiter le site de notre partenaire : www.onf.fr</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span style=\"color: rgb(0, 128, 0);\"><strong>Plan&egrave;te-Urgence :</strong></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Plan&egrave;te Urgence est une association en pleine croissance, particuli&egrave;rement innovante, active, utile et efficace pour former les Hommes et prot&eacute;ger la Nature.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Ainsi, elle permet &agrave; tous de partir en cong&eacute; solidaire au Sud. Les volontaires b&eacute;n&eacute;voles partent en mission d&#39;appui &agrave; des initiatives.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Son objectif est de favoriser les initiatives des citoyens du Sud, de leur transmettre des savoir-faire; pas de se substituer &agrave; eux. Qu&#39;il s&#39;agisse de missions de formation, de soutien ou de renforcement des capacit&eacute;s, ses partenaires du Sud d&eacute;finissent eux-m&ecirc;mes les besoins et les objectifs auxquels Plan&egrave;te-Urgence cherche &agrave; r&eacute;pondre.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Via ses packs de reforestation, cette association permet de compenser ses &eacute;missions de CO2.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Pour plus d&#39;informations, nous vous invitons &agrave; visiter le site de notre partenaire : www.planete-urgence.org<span _fck_bookmark=\"1\" style=\"display: none;\"> <span _fck_bookmark=\"1\" style=\"display: none;\"> </span></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span style=\"color: rgb(0, 128, 0);\"><strong>Trees For the Future :</strong></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Trees For the Future est une ONG am&eacute;ricaine qui m&egrave;ne des actions concr&egrave;tes sur le terrain dans le domaine de l&#39;agro-foresterie.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Par le biais de la distribution des semences, de cr&eacute;ation de p&eacute;pini&egrave;res, d&#39;encadrement et de formation &agrave; l&#39;agroforesterie et &agrave; la gestion durable des for&ecirc;ts, TFT contribue depuis 1989 &agrave; prot&eacute;ger l&#39;environnement et &agrave; pr&eacute;server les moyens de subsistance traditionnels des populations locales.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Ainsi, TFT fournit des connaissances techniques sur l&#39;agroforesterie et le d&eacute;veloppement durable, ainsi que du mat&eacute;riel de plantation, afin que les collectivit&eacute;s puissent r&eacute;habiliter leurs terres souvent d&eacute;grad&eacute;es et promouvoir une production durable.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Pour plus d&#39;informations, nous vous invitons &agrave; visiter le site de notre partenaire (en anglais ou espagnol) : www.treesftf.org</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span style=\"color: rgb(0, 128, 0);\"><strong>Eco-Kyoto : </strong></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	La fondation Eco-Kyoto/Guin&eacute;ea &eacute;t&eacute; cr&eacute;&eacute;e en 2007 en Guin&eacute;e Conakry &agrave; l&#39;image de la Fondation Eco-Kyoto Canada qui a pour mission principale d&#39;accompagner des diff&eacute;rents intervenants environnementaux pour l&#39;attente des objectifs du &laquo; Protocole de Kyoto &raquo;.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Elle intervient dans les domaines ci-apr&egrave;s :</p>\r\n<p>\r\n	&eacute;tudes d&#39;incidence environnementale (am&eacute;nagement du territoire- urbanisme- gestion des d&eacute;chets - gestion de l&#39;eau)- Conseils en environnement (Eco-audits- expertises de terrain sur le plan environnemental)- Gestion de projets d&#39;assainissements-G&eacute;otechnique (&eacute;tudes de sol, ing&eacute;nierie) - Implantation d&#39;Eco-village - Education &agrave; l&#39;environnement- Traitements des eaux et des sols -R&eacute;habilitation des sites miniers - Reboisement &ndash; Industrie ( manufacturi&egrave;res &ndash; mini&egrave;res &ndash; chimiques)- Energies- renouvelables &ndash; Eco/ tourismes &ndash; agriculture durable.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	C&#39;est dans cette perspective que la fondation ECO-KYOTO a initi&eacute; le projet intitul&eacute; &#39;Reboisement d&#39;un million d&#39;arbres dans les 16 pr&eacute;fectures des r&eacute;gions de Haute et Basse Guin&eacute;e en 2009/2010&#39;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Pour plus d&#39;informations, nous vous invitons &agrave; visiter le site de notre partenaire : www.fondationecokyoto.org</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span style=\"color: rgb(0, 128, 0);\"><strong>CALA : </strong></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Le Comit&eacute; d&#39;Aide aux L&eacute;preux d&#39;Antalaha a &eacute;t&eacute; cr&eacute;&eacute; en 1988, afin d&#39;intervenir dans deux villages situ&eacute;s aux alentours d&#39;Antalaha (nord-est malgache).</p>\r\n<p>\r\n	Les habitants de ces villages, maintenant gu&eacute;ris de la l&egrave;pre, ne peuvent revenir dans leurs villages natals car ils sont d&eacute;laiss&eacute;s tant par la communaut&eacute; ainsi que par les autorit&eacute;s locales.</p>\r\n<p>\r\n	Les personnes les ayant soign&eacute;s ont donc d&eacute;cid&eacute; de cr&eacute;er une association pour les aider &agrave; se r&eacute;ins&eacute;rer socialement et &eacute;conomiquement dans la soci&eacute;t&eacute;.</p>\r\n<p>\r\n	CALA a pour but :</p>\r\n<p>\r\n	- de rendre leur dignit&eacute; aux anciens malades</p>\r\n<p>\r\n	- de les aider &agrave; se nourrir, se v&ecirc;tir et se loger</p>\r\n<p>\r\n	- de les aider &agrave; avoir un revenu les rendant ind&eacute;pendants</p>\r\n<p>\r\n	- de les &eacute;duquer, ainsi que leurs enfants, entre autres pour l&#39;&eacute;ducation sanitaire.</p>\r\n<p>\r\n	- de rentabiliser les propri&eacute;t&eacute;s occup&eacute;es en cr&eacute;ant des p&eacute;pini&egrave;res d&#39;arbres vivriers.</p>\r\n<p>\r\n	L&#39;Ecole Verte - l&#39;agroforesterie pour cr&eacute;er une activit&eacute; &eacute;conomique viable et p&eacute;renne : aider les jeunes &agrave; se prendre en main et &agrave; acqu&eacute;rir une formation d&#39;avenir. C&#39;est l&agrave; l&#39;objet de l&#39;&eacute;cole verte : former les jeunes adolescents &agrave; la culture des plants d&#39;arbres. R&eacute;colter les graines en for&ecirc;t, les faire germer, les mettre en semis, puis en plants et les commercialiser. Cela concerne autant le bois de chauffage que les bois pr&eacute;cieux (&eacute;b&egrave;ne, bois de rose, palissandre) dont le commerce fortement r&eacute;glement&eacute; induit toute sorte de trafic. D&eacute;j&agrave; plusieurs dizaines de milliers de plants sont disponibles et mis &agrave; la vente ou plant&eacute;s dans une serre tropicale &agrave; ciel ouvert.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Pour plus d&#39;informations, nous vous invitons &agrave; visiter le site de notre partenaire : http://cala-france.asso-web.com</p>\r\n','fr','nos-partenaires-planteurs'),(11,'Biodiversity','<p>\r\n	<span id=\"result_box\" lang=\"en\"><span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">A</span> <span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">major challenge</span> <span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">met</span> <span class=\"hps\" title=\"Cliquer ici pour voir d\'autres traductions\">by</span> <span class=\"hps\" title=\"Cliquer ici pour v