rial,helvetica,sans-serif;\">Les for&ecirc;ts tropicales sont les plus grands r&eacute;servoirs de biodiversit&eacute; de notre plan&egrave;te.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><img alt=\"\" src=\"/uploads/ck/images/Papillon_biodiversité.jpg\" style=\"width: 140px; height: 95px;\" /></span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Ce sont des &eacute;cosyst&egrave;mes extr&ecirc;mement riches et complexes dont l&#39;&eacute;quilibre est menac&eacute;. Au fil des ann&eacute;es l&#39;homme a souvent exploit&eacute; la nature pour ses richesses sans se pr&eacute;occuper de sa capacit&eacute; &agrave; se r&eacute;g&eacute;n&eacute;rer pleinement.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><a href=\"http://umr-system.cirad.fr/programmes_finalises/les_agroforets_en_zones_tropicales_humides\" target=\"_blank\"><span style=\"color: rgb(0, 128, 0);\"><strong>Les agrofor&ecirc;ts sont des contre- exemples de ce constat. </strong></span></a></span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">L&#39;association complexe des esp&egrave;ces &agrave; valeur alimentaire, m&eacute;dicinale et cosm&eacute;tique au sein de leur milieu forestier permettent &agrave; ceux qui les mettent en place de subvenir &agrave; leurs besoins tout en respectant les fonctions &eacute;cologiques de la for&ecirc;t et du paysage.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Ces agrofor&ecirc;ts sont le moyen parfait de d&eacute;velopper des esp&egrave;ces locales et de lutter contre les syst&egrave;mes de monoculture mangeurs d&#39;espaces naturels et d&#39;intrants n&eacute;fastes pour l&#39;environnement.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Dans les programmes qu&#39;elle co-d&eacute;veloppe sur le terrain, UP2GREEN REFORESTATION veut donc cr&eacute;er des mod&egrave;les agroforestiers productifs o&ugrave; la biodiversit&eacute; locale est pr&eacute;serv&eacute;e et enrichie.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<a href=\"http://www.greenfacts.org/fr/biodiversite/index.htm#1\" target=\"_blank\"><em><strong><span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Pour en savoir plus sur les enjeux de biodiversit&eacute;.</span></span></strong></em></a></p>\r\n','fr','la-biodiversite'),(12,'Legal Policy','<br />\r\n','<br />\r\n','en','legal-policy'),(12,'Informations légales','<br />\r\n','<p>\r\n	Le <span>pr&eacute;sent</span> site web <span>est</span> accessible via <span>l&#39;adresse</span> URL : <a href=\"http://www.up2green.com/\">http://<span>association.up2green.com</span>/</a></p>\r\n<p>\r\n	UP2GREEN REFORESTATION est une Association Loi 1901 a but non lucratif.</p>\r\n<p>\r\n	Date de parution au Journal Officiel : 28/11/2009</p>\r\n<p>\r\n	N&deg; d&#39;identification R.N.A. : <b><span>W751202385</span></b></p>\r\n<p>\r\n	<br />\r\n	No de <span>parution</span> : <b>20090048</b></p>\r\n<p>\r\n	<span>D&eacute;partement</span> (<span>R&eacute;gion</span>)<b><span> : </span></b><b>Paris (<span>&Icirc;le-de-France</span>)</b></p>\r\n','fr','informations-legales'),(13,'Welcome','<p>\r\n	<strong><span lang=\"en\"><span class=\"hps\" title=\"Cliquer ici pour voir d\'au