 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>Un moteur de recherche (<a href=\"http://www.up2green.com\" target=\"_blank\">www.up2green.com</a>) </strong>qui vous permet de collecter gratuitement des arbres dans votre compte au fil de vos recherches, que vous choisissez ensuite o&ugrave; planter dans les programmes soutenus sur la Plan&egrave;te.</span></span></li>\r\n</ul>\r\n<ul style=\"margin-left: 40px;\">\r\n	<li style=\"text-align: justify;\">\r\n		<span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>Une plate-forme de plantation</strong> en ligne <strong>(<a href=\"http://reforestation.up2green.com\" target=\"_blank\">http://reforestation.up2green)</a></strong>, pour nos partenaires entreprises ou collectivit&eacute;s qui peuvent offrir des arbres &agrave; planter sur la Plan&egrave;te &agrave; leurs clients, collaborateurs ou administr&eacute;s et suivre leur for&ecirc;t grandir sur la Plan&egrave;te.</span></span></li>\r\n</ul>\r\n<ul style=\"margin-left: 40px;\">\r\n	<li style=\"text-align: justify;\">\r\n		<span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>Le site associatif</strong> </span></span><span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>(<a href=\"http://association.up2green.com\" target=\"_blank\">http://association.up2green.com</a>) </strong></span></span><span style=\"font-size: 14px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">pour vous donner un maximum d&#39;informations sur : notre action, nos partenaires, un peu d&#39;actualit&eacute;s,...</span></span></li>\r\n</ul>\r\n','fr','bienvenue'),(14,'Clause de confidentialité','<br />\r\n','<br />\r\n','en','clause-de-confidentialite'),(14,'Clause de confidentialité','<p>\r\n	Ce site web <span>est</span> <span>g&eacute;r&eacute;</span> par <span>l&rsquo;Association</span> <span>UP2GREEN</span> REFORESTATION (Association <span>fran&ccedil;aise</span> de <span>loi</span><br />\r\n	1901). <span>Lors</span> de <span>votre</span> <span>visite</span> de <span>ce</span> site, <span>l&rsquo;Association</span> <span>Up2green</span> Reforestation <span>peut</span> <span>recueillir</span> <span>des</span> <span>donn&eacute;es</span><br />\r\n	<span>personnelles</span> <span>vous</span> <span>concernant</span> : un e-mail et de <span>fa&ccedil;on</span> <span>optionnelle</span> un nom et un <span>pr&eacute;nom</span> <span>sur</span> la base de<br />\r\n	<span>votre</span> <span>choix</span> de <span>renseignement</span>.</p>\r\n','<p>\r\n	L&rsquo;Association UP2GREEN REFORESTATION pourra utiliser ces donn&eacute;es exclusivement dans le<br />\r\n	cadre des objectifs fix&eacute;s par la pr&eacute;sente clause de confidentialit&eacute;, et prendra les mesures n&eacute;cessaires<br />\r\n	&agrave; la protection des donn&eacute;es personnelles.<br />\r\n	<br />\r\n	<u><strong>Objectifs de la collecte des donn&eacute;es</strong></u><br />\r\n	<br />\r\n	L&rsquo;Association UP2GREEN REFORESTATION recueille et g&egrave;re les donn&eacute;es des clients et des<br />\r\n	visiteurs de ce site internet dans le cadre de sa gestion associative, pour nous permettre d&rsquo;am&eacute;liorer<br />\r\n	le service rendu par les sites (moteur de recherche, plate-forme de plantation), et pour &eacute;tablir des<br />\r\n	statistiques internet. Les informations que vous nous transmettez (e-mail) peuvent &ecirc;tre utilis&eacute;es<br />\r\n	pour nous permettre de vous contacter en cas de besoin, par exemple pour vous tenir inform&eacute;<br />\r\n	de modifications des fonctionnalit&eacute;s internet ou pour vous proposer de nouveaux services que<br />\r\n	vous seriez susceptible d&rsquo;appr&eacute;cier (sauf si vous avez pr&eacute;cis&eacute; que vous ne d&eacute;siriez pas recevoir<br />\r\n	d&rsquo;information sur les &eacute;volutions de l&rsquo;Association UP2GREEN REFORESTATION).<br />\r\n	<br />\r\n	<u><strong>Cookies</strong></u><br />\r\n	<br />\r\n	Les sites de l&rsquo;Association UP2GREEN REFORESTATION n&rsquo;installe aucun cookie sur votre ordinateur.<br />\r\n	<br />\r\n	<u><strong>Sites tiers</strong></u><br />\r\n	<br />\r\n	Cette clause de confidentialit&eacute; ne s&rsquo;applique pas aux site tiers reli&eacute;s &agrave; ce site au moyen de liens.<br />\r\n	<br />\r\n	<u><strong>Droits d&#39;auteur, marques de fabrique et autres droits de propri&eacute;t&eacute; intellectuelle</strong></u><br />\r\n	<br />\r\n	Le contenu de ce site Internet, y compris sans toutefois s&#39;y limiter les logos, les marques de fabrique,<br />\r\n	les appellations commerciales, le texte, les images, les graphiques, le son, l&#39;animation et les<br />\r\n	fichiers vid&eacute;o ainsi que leur disposition sur le site Internet appartiennent &agrave; l&rsquo;Association UP2GREEN<br />\r\n	REFORESTATION et ledit contenu est soumis &agrave; la protection de la propri&eacute;t&eacute; intellectuelle. Aucun<br />\r\n	contenu du site Internet ne peut &ecirc;tre reproduit, copi&eacute;, transf&eacute;r&eacute;, publi&eacute;, distribu&eacute;, modifi&eacute;, d&eacute;plac&eacute;, ou<br />\r\n	transf&eacute;r&eacute; sur d&#39;autres sites Internet ou documents sans autorisation &eacute;crite pr&eacute;alable. Tous les droits<br />\r\n	de propri&eacute;t&eacute; intellectuelle contenus dans le site Internet, y compris les droits d&#39;auteur sont r&eacute;serv&eacute;s et<br />\r\n	toute utilisation sans autorisation &eacute;crite pr&eacute;alable par l&#39;utilisateur respectif est formellement interdite.<br />\r\n	Rien de ce qui est contenu sur ce site Internet ne sera interpr&eacute;t&eacute; comme accordant la moindre<br />\r\n	licence expresse ou implicite ou le moindre droit d&#39;utiliser la propri&eacute;t&eacute; intellectuelle de l&rsquo;Association<br />\r\n	UP2GREEN REFORESTATION ou de toute tierce partie.<br />\r\n	<br />\r\n	<u><strong>Questions</strong></u><br />\r\n	<br />\r\n	En cas de questions concernant cette clause de confidentialit&eacute;, nos activit&eacute;s dans le domaine de<br />\r\n	la gestion des donn&eacute;es ou votre utilisation de ce site, vous pouvez vous contacter &agrave; l&rsquo;aide de notre<br />\r\n	adresse email webmaster@up2green.com<br />\r\n	<br />\r\n	<u><strong>Modifications de cette Clause de confidentialit&eacute;</strong></u><br />\r\n	<br />\r\n	L&rsquo;Association Up2green Reforestation se r&eacute;serve le droit d&rsquo;apporter des modifications &agrave; cette clause<br />\r\n	de confidentialit&eacute;. Nous vous conseillons de consulter r&eacute;guli&egrave;rement cette clause de confidentialit&eacute;<br />\r\n	pour vous tenir inform&eacute; des &eacute;ventuelles modifications.<br />\r\n	<br />\r\n	L&rsquo;Association Up2green Reforestation</p>\r\n<div firebugversion=\"1.5.4\" id=\"_firebugConsole\" style=\"display: none;\">\r\n	&nbsp;</div>\r\n<br />\r\n','fr','clause-de-confidentialite'),(15,'International year of Forest 2011','<p>\r\n	The United Nations declared 2011 as the <a href=\"http://www.un.org/en/events/iyof2011/\" target=\"_blank\">International Year of Forests</a> to raise awareness of sustainable forest management, conservation and climate change</p>\r\n','<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Forests play an integral part in the livelihoods of 1.6 billion people worldwide, supply the habitat for millions of species, and play a critical role in mitigating the effects of climate change. But <span style=\"color: rgb(0, 128, 0);\"><strong>deforestation continues at a rate of 50,000 square miles per year</strong></span>.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">With this in mind, the UN established the <a href=\"http://www.un.org/en/events/iyof2011/index.shtml\" target=\"_blank\">International Year of Forests 2011</a> with a resolution back on December 20, 2006 and invited world governments, non-governmental organizations, and the private sector to make a concerted effort to raise awareness to strengthen conservation and sustainable development of all forests. The launch of the International Year of Forests will take place February 2, 2011 at United Nations headquarters during the ninth session of the United Nations Forum on Forests.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Various activities have been organized to celebrate the International Year and foster an exchange of strategies to promote sustainable forest practices. These activities include high-level panel discussions, film screenings, the issuance of the United Nations commemorative stamp series for the International Year, and other public events. Competitions ranging from photo, art, slogan, and essay writing are also being promoted in Bulgaria, Cyprus, the Czech Republic, Georgia, Jamaica, Lebanon, Poland and the Republic of Korea.</span></span></p>\r\n','en','international-year-of-forest-2011'),(15,'Année Internationale de la Forêt','<p>\r\n	Le site officiel de l&#39;ONU pour l&#39;Ann&eacute;e Internationale de la For&ecirc;t : <a href=\"http://www.un.org/en/events/iyof2011/\" target=\"_blank\">ici</a></p>\r\n','<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Afin de renforcer les initiatives visant &agrave; promouvoir la gestion durable, la pr&eacute;servation et le d&eacute;veloppement des for&ecirc;ts sur le plan mondial, l&rsquo;Assembl&eacute;e g&eacute;n&eacute;rale des Nations Unies a adopt&eacute; le 20 d&eacute;cembre &agrave; New York&nbsp; une r&eacute;solution proclamant 2011, <strong>Ann&eacute;e internationale de la for&ecirc;t</strong>.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Les for&ecirc;ts sont une partie int&eacute;grante du d&eacute;veloppement mondial durable: les activit&eacute;s &eacute;conomiques relatives aux for&ecirc;ts ont une incidence sur l&rsquo;existence de 1,6 milliard de personnes au plan mondial, apportent des bienfaits socioculturels, servent de fondement aux savoirs autochtones et, en tant qu&rsquo;&eacute;cosyst&egrave;mes, jouent un r&ocirc;le primordial en mati&egrave;re d&rsquo;att&eacute;nuation des r&eacute;percussions des changements climatiques et de protection de la biodiversit&eacute;.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">L&rsquo;Ann&eacute;e internationale de la for&ecirc;t s&rsquo;emploiera &agrave; faire &oelig;uvre de sensibilisation et &agrave; <strong>renforcer les initiatives visant &agrave; g&eacute;rer, conserver et d&eacute;velopper tous les types de </strong><strong>for&ecirc;t</strong>s, y compris les arbres hors for&ecirc;ts. &laquo;&nbsp;C&rsquo;est une invitation permanente &agrave; la communaut&eacute; mondiale&nbsp;&raquo; a d&eacute;clar&eacute; Pekka Patosaari, Directeur du Secr&eacute;tariat du Forum des Nations Unies sur les for&ecirc;ts &laquo;&nbsp;&agrave; s&rsquo;entendre et &agrave; coop&eacute;rer avec les gouvernements, les organisations internationales et la soci&eacute;t&eacute; civile, afin de veiller &agrave; ce que nos for&ecirc;ts soient g&eacute;r&eacute;es durablement dans l&rsquo;int&eacute;r&ecirc;t des g&eacute;n&eacute;rations pr&eacute;sentes et futures&nbsp;&raquo;.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong><span style=\"color: rgb(0, 128, 0);\">Chaque jour, quelque 350 km<sup>2</sup> de couverture foresti&egrave;re sont d&eacute;truits &agrave; travers le monde</span></strong>. &nbsp;La conversion en terres agricoles, un abattage incontr&ocirc;l&eacute;, une gestion des sols inefficace ainsi que la multiplication des &eacute;tablissements humains sont les causes principales de cette perte de zones foresti&egrave;res.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Les efforts en cours en mati&egrave;re de plantations sur terrain libre et de reboisement ont contribu&eacute; &agrave; freiner la perte nette en zones foresti&egrave;res sur le plan mondial, mais des initiatives compl&eacute;mentaires sont indispensables, notamment &laquo;&nbsp;la cr&eacute;ation d&rsquo;un instrument international sur les for&ecirc;ts ainsi qu&rsquo;une participation &eacute;largie du public et une mise en valeur des comp&eacute;tences et des exp&eacute;riences pratiques des professionnels de la for&ecirc;t &agrave; l&rsquo;&eacute;chelle de la plan&egrave;te&nbsp;&raquo;, a indiqu&eacute; M. Patosaari.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Le Secr&eacute;tariat du Forum des Nations Unies sur les for&ecirc;ts servira de point de contact pour la mise en &oelig;uvre de l&rsquo;Ann&eacute;e internationale de la for&ecirc;t qui &laquo;&nbsp;repr&eacute;sentera une excellente occasion de renforcer notre collaboration avec des organisations travaillant sur les probl&egrave;mes du secteur forestier au sein du syst&egrave;me des Nations Unies, notamment la FAO et d&rsquo;autres partenaires internationaux, r&eacute;gionaux et nationaux&nbsp;&raquo;, a d&eacute;clar&eacute; M. Patosaari.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Un site internet pour l&rsquo;Ann&eacute;e internationale de la for&ecirc;t a &eacute;t&eacute; &eacute;tabli au sein du site web du Forum des Nations Unies sur les for&ecirc;ts, &agrave; <a href=\"http://www.un.org/esa/forests/2011.html\">www.un.org/esa/forests/2011.html</a>.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<br />\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Pour des informations compl&eacute;mentaires ou des interviews, veuillez contacter Mita Sen, au Secr&eacute;tariat du Forum des Nations Unies sur les for&ecirc;ts, D&eacute;partement des affaires &eacute;conomiques et sociales, t&eacute;l: 1-917 367-5069, courriel: <a href=\"mailto:sen@un.org\">sen@un.org</a>; ou Dan Shepard, au D&eacute;partement de l&rsquo;information, t&eacute;l: 1 212 963 9495, courriel: <a href=\"mailto:shepard@un.org\">shepard@un.org</a></span></span></p>\r\n','fr','annee-internationale-de-la-foret');
/*!40000 ALTER TABLE `article_translation` ENABLE KEYS */;
UNLOCK TABLES;

