INSERT INTO `newsletter_translation` VALUES (1,'Confirmation d\'inscription','<p>\r\n	&nbsp;</p>\r\n<table cellpadding=\"0\" cellspacing=\"0\" style=\"width: 100%;\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align: center;\">\r\n				<a href=\"http://up2green.smartit.fr/\" style=\"cursor: pointer;\"><img alt=\"Up2green Reforestation\" src=\"http://up2green.smartit.fr/images/newsletter/header.png\" /></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<table cellpadding=\"20\" cellspacing=\"0\" style=\"width: 100%;\">\r\n					<tbody>\r\n						<tr>\r\n							<td colspan=\"2\">\r\n								<h1 style=\"color: rgb(44, 138, 64);\">\r\n									<span><span><span><span>Bienvenue sur Up2green !</span></span></span></span></h1>\r\n								<p>\r\n									<strong>Bonjour %username%,</strong></p>\r\n								<p>\r\n									<strong><span><span>Nous</span></span> <span><span>avons</span></span> le <span><span>plaisir</span></span> de <span><span>vous</span></span> <span><span>confirmer</span></span> <span><span>votre</span></span> inscription <span><span>sur</span></span> <span><span>up2green</span></span>.</strong></p>\r\n								<p>\r\n									<strong><span><span>Votre</span></span> mot de <span><span>passe</span></span> <span><span>est</span></span> : %password%</strong></p>\r\n								<p>\r\n									<strong><span><span>Gardez</span></span> <span><span>bien</span></span> <span><span>cet</span></span> email car pour des raisons de <span><span>s&eacute;curit&eacute;</span></span> <span><span>nous</span></span> ne <span><span>pourrons</span></span> <span><span>retrouver</span></span> <span><span>votre</span></span> mot de <span><span>passe</span></span> pour <span><span>vous</span></span>, <span><span>vous</span></span> <span><span>devrez</span></span> le <span><span>r&eacute;initialiser</span></span> <span><span>si</span></span> <span><span>vous</span></span> le <span><span>perdez</span></span></strong></p>\r\n								<p>\r\n									<strong><span><span>Vous</span></span> <span><span>pouvez</span></span> <span><span>d&egrave;s</span></span> <span><span>&agrave;</span></span> <span><span>pr&eacute;sent</span></span> <span><span>commencer</span></span> la <span><span>collecte</span></span> de <span><span>vos</span></span> <span><span>cr&eacute;dits</span></span> <span><span>arbres</span></span> <span><span>gr&acirc;ce</span></span> au <span><span>moteur</span></span> de <span><span>recherche</span></span>.</strong></p>\r\n								<p>\r\n									<br />\r\n									<strong>A <span><span>tr&egrave;s</span></span> <span><span>bient&ocirc;t</span></span> <span><span>sur</span></span> http://<span><span>up2green.com</span></span>/</strong></p>\r\n							</td>\r\n						</tr>\r\n						<tr>\r\n							<td colspan=\"2\" style=\"vertical-align: top;\">\r\n								<h1 style=\"color: rgb(44, 138, 64);\">\r\n									<span><span><span><span><span>Up2green</span></span></span> en <span><span><span>quelques</span></span></span> mots :</span></span></h1>\r\n								<p>\r\n									<strong><span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span><span><span>L&#39;ambition</span></span></span> de <span><span><span>toute</span></span></span> <span><span><span>l&#39;&eacute;quipe</span></span></span> <span><span><span>d&#39;UP2GREEN</span></span></span> <span><span><span>est</span></span></span> de <span><span><span>sensibiliser</span></span></span> le plus de <span><span><span>monde</span></span></span> possible au <span><span><span>D&eacute;veloppement</span></span></span> Durable et <span><span><span>&agrave;</span></span></span> la protection de la <span><span><span>Plan&egrave;te</span></span></span> en <span><span><span>g&eacute;n&eacute;ral</span></span></span>.</span></span></strong></p>\r\n							</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"border-right: 1px solid rgb(170, 170, 170); vertical-align: top;\">\r\n								<p style=\"text-align: justify;\">\r\n									<span style=\"font-size: 16px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span style=\"color: rgb(0, 128, 0);\"><strong><span><span><span><span><span>L&#39;association</span></span></span></span></span> <span><span><span><span><span>up2green</span></span></span></span></span> Reforestation a pour <span><span><span><span><span>objecits</span></span></span></span></span> de :</strong></span></span></span></p>\r\n								<p>\r\n									<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span dir=\"LTR\"><span><span><span><span>Favoriser</span></span></span></span>, <span><span><span><span>d&eacute;velopper</span></span></span></span> et <span><span><span><span>promouvoir</span></span></span></span> <span><span><span><span>toute</span></span></span></span> action positive en lien <span><span><span><span>avec</span></span></span></span> la <strong><span><span><span><span>lutte</span></span></span></span> <span><span><span><span>contre</span></span></span></span> le <span><span><span><span>r&eacute;chauffement</span></span></span></span> <span><span><span><span>climatique</span></span></span></span></strong> : reforestation, conservation de la <span><span><span><span>biodiversit&eacute;</span></span></span></span>, aide aux populations <span><span><span><span>touch&eacute;es</span></span></span></span> par les <span><span><span><span>p&eacute;nuries</span></span></span></span> <span><span><span><span>d&#39;origine</span></span></span></span> <span><span><span><span>climatique</span></span></span></span>, <span><span><span><span>s&eacute;questration</span></span></span></span> du CO2 <span><span><span><span>atmosph&eacute;rique</span></span></span></span>,&hellip;</span></span></span></p>\r\n								<p>\r\n									<br />\r\n									<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span dir=\"LTR\"><strong><span><span><span><span>Participer</span></span></span></span> au <span><span><span><span>financement</span></span></span></span> de <span><span><span><span>programmes</span></span></span></span> de reforestation <span><span><span><span>dans</span></span></span></span> le <span><span><span><span>monde</span></span></span></span></strong>.</span></span></span><br />\r\n									<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span dir=\"LTR\"><span><span><span><span>Collecter</span></span></span></span> des fonds </span>en <span><span><span><span>vue</span></span></span></span> du <span><span><span><span>financement</span></span></span></span> de <span><span><span><span>ces</span></span></span></span> <span><span><span><span>programmes</span></span></span></span> de reforestation <span><span><span><span>ou</span></span></span></span> de tout <span><span><span><span>programme</span></span></span></span> <span><span><span><span>&agrave;</span></span></span></span> vocation <span><span><span><span>&eacute;cologique</span></span></span></span> ;</span></span><br />\r\n									<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span dir=\"LTR\"><span><span><span><span>Etablir</span></span></span></span> des <span><span><span><span>partenariats</span></span></span></span> </span><span><span><span><span>avec</span></span></span></span> des <span><span><span><span>organismes</span></span></span></span> de plantation en <span><span><span><span>vue</span></span></span></span> du <span><span><span><span>financement</span></span></span></span> des <span><span><span><span>programmes</span></span></span></span></span></span></p>\r\n								<p>\r\n									<br />\r\n									<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong><span dir=\"LTR\"><span><span><span><span>Aider</span></span></span></span> les populations </span></strong><span><span><span><span>touch&eacute;es</span></span></span></span> par la <span><span><span><span>d&eacute;forestation</span></span></span></span> <span><span><span><span>ou</span></span></span></span> par la <span><span><span><span>perte</span></span></span></span> de <span><span><span><span>ma&icirc;trise</span></span></span></span> <span><span><span><span>fonci&egrave;re</span></span></span></span> <span><span><span><span>leur</span></span></span></span> <span><span><span><span>assurant</span></span></span></span> <span><span><span><span>une</span></span></span></span> <span><span><span><span>activit&eacute;</span></span></span></span> locale durable</span></span><br />\r\n									<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span><span><span><span>Participer</span></span></span></span> au <span><span><span><span>d&eacute;ploiement</span></span></span></span> en France et <span><span><span><span>&agrave;</span></span></span></span> <span><span><span><span>l&#39;international</span></span></span></span> <span dir=\"LTR\">de <span><span><span><span>m&eacute;thodologies</span></span></span></span> de certification des <span><span><span><span>programmes</span></span></span></span> de reforestation.</span></span></span></p>\r\n							</td>\r\n							<td style=\"border-left: 1px solid rgb(221, 221, 221); vertical-align: top;\">\r\n								<p style=\"text-align: justify;\">\r\n									<span style=\"color: rgb(0, 128, 0);\"><span style=\"font-size: 16px;\"><strong><span style=\"font-family: arial,helvetica,sans-serif;\"><span><span><span>L&#39;association</span></span></span> <span><span><span>UP2GREEN</span></span></span> REFORESTATION <span><span><span>d&eacute;veloppe</span></span></span> des <span><span><span>outils</span></span></span> au service de la <span><span><span>lutte</span></span></span> <span><span><span>contre</span></span></span> la <span><span><span>d&eacute;forestation</span></span></span> <span><span><span>dans</span></span></span> le <span><span><span>Monde</span></span></span> et le <span><span><span>r&eacute;chauffement</span></span></span> <span><span><span>climatique</span></span></span> :</span></strong></span></span></p>\r\n								<p>\r\n									<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">un site de <span><span><span>recherche</span></span></span> internet qui finance la reforestation : <a href=\"http://www.up2green.com/\" target=\"_blank\">http://<span><span><span>www.up2green.com</span></span></span>/</a></span></span></p>\r\n								<p>\r\n									<br />\r\n									<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span><span><span>une</span></span></span> <span><span><span>plate-forme</span></span></span> de reforestation <span><span><span>virtuelle</span></span></span> : <a href=\"http://reforestation.up2green.com/\" target=\"_blank\">http://<span><span><span>reforestation.up2green.com</span></span></span>/</a> pour planter des <span><span><span>arbres</span></span></span> (<span><span><span>gr&acirc;ce</span></span></span> aux coupons <span><span><span>distribu&eacute;s</span></span></span> par les <span><span><span>entreprises</span></span></span> <span><span><span>partenaires</span></span></span> <span><span><span>ou</span></span></span> <span><span><span>directement</span></span></span> par les <span><span><span>particuliers</span></span></span> qui <span><span><span>ont</span></span></span> <span><span><span>collect&eacute;</span></span></span> des <span><span><span>cr&eacute;dits</span></span></span> <span><span><span>gr&acirc;ce</span></span></span> au <span><span><span>moteur</span></span></span> de <span><span><span>recherche</span></span></span>).</span></span></p>\r\n								<p>\r\n									<br />\r\n									<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">en <span><span><span>d&eacute;veloppant</span></span></span> des <span><span><span>partenariats</span></span></span> de reforestation <span><span><span>ou</span></span></span> en <span><spa