></span> <span><span>o&ugrave;</span></span> planter <span><span>vos</span></span> <span><span>arbres</span></span> ! </strong></li>\r\n									<li>\r\n										<strong>Un module de <span><span>paiement</span></span> via <span><span>Paypal</span></span> pour <span><span>cr&eacute;diter</span></span> <span><span>facilement</span></span> <span><span>votre</span></span> <span><span>compte</span></span> <span><span>Up2green</span></span> en <span><span>arbres</span></span> !</strong></li>\r\n								</ul>\r\n								<p style=\"margin-bottom: 0.5cm\">\r\n									<b><span><span>Nous</span></span> <span><span>am&eacute;liorons</span></span> <span><span>notre</span></span> communication en <span><span>vous</span></span> <span><span>proposant</span></span> de <span><span>suivre</span></span> <span><span>Up2green</span></span> Reforestation <span><span>sur</span></span> les <span><span>r&eacute;seaux</span></span> <span><span>sociaux</span></span> et <span><span>d&#39;&ecirc;tre</span></span> <span><span>tenu</span></span> au courant des <span><span>nouveaut&eacute;s</span></span>&nbsp; : </b><b><span>d&egrave;s</span></b><b> <span>maintenant</span> <span>suivez</span> <span>notre</span> <span>actualit&eacute;</span> <span>sur</span> <a href=\"http://twitter.com/up2green\" target=\"_blank\"><span style=\"color:#008000;\">Twitter</span></a> et <a href=\"http://www.facebook.com/pages/Up2green/224019854294331\" target=\"_blank\"><span style=\"color:#008000;\">Facebook</span></a></b></p>\r\n							</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"vertical-align: top; border-right: #aaa 1px solid; width: 50%;\">\r\n								<p style=\"margin-bottom: 0.5cm\">\r\n									<strong><font color=\"#008000\"><font face=\"arial, helvetica, sans-serif\"><font size=\"3\"><strong><font color=\"#008000\"><font face=\"arial, helvetica, sans-serif\"><font size=\"3\"><span>Parrainez</span> <span>vos</span> <span>amis</span> et <span>gagnez</span> encore plus de <span>cr&eacute;dits</spa