ravail <span>sur</span> la <span>google</span> map de la <span>plate-forme</span> de plantation en <span>ligne</span>. <span>Cela</span> <span>vous</span> <span>permet</span> de <span>visualiser</span> plus en <span>d&eacute;tails</span> nos <span>programmes</span> de reforestation <span>communautaires</span>.</p>\r\n								<p style=\"margin-bottom: 0.5cm\">\r\n									<span>Une</span> <span>partie</span> de <span>notre</span> <span>&eacute;quipe</span> <span>est</span> <span>d&#39;ailleurs</span> <span>actuellement</span> entrain de <span>collecter</span> les <span>coordonn&eacute;es</span> GPS <span>sur</span> le terrain <span>afin</span> de <span>visualiser</span> <span>chaque</span> <span>parcelle</span> de plantation !</p>\r\n								<p style=\"margin-bottom: 0.5cm\">\r\n									<span>Vous</span> <span>avez</span>&nbsp;<span>&eacute;galement</span> la <span>possibilit&eacute;</span> de <span>voir</span> la <span>capacit&eacute;</span> de plantation des <span>programmes</span> <span>afin</span> de <span>pouvoir</span> <span>juger</span> par <span>vous</span> <span>m&ecirc;me</span> de <span>l&#39;avancement</span> des plantations et de <span>voir</span> les <span>programmes</span> qui <span>ont</span> le plus <span>besoin</span> de&nbsp;<span>vous</span>.</p>\r\n							</td>\r\n							<td style=\"border-left: #ddd 1px solid; vertical-align: top\">\r\n								<p>\r\n									<strong><font color=\"#008000\"><font face=\"arial, helvetica, sans-serif\"><font size=\"3\"><span><span>Up2green</span></span> <span><span>s&#39;enrichit</span></span> <span><span>d&#39;un</span></span> module de <span><span>paiement</span></span> via <span><span>Paypal</span></span> !</font></font></font></strong></p>\r\n								<p>\r\n									<span><span>Maintenant</span></span> <span><span>vous</span></span> <span><span>pouvez</span></span> <span><span>participer</span></span> encore plus <span><span>activement</span></span> <span><span>&agrave;</span></span> la reforestation en <span