ctivement</span> pour <span>que</span> <span>vous</span> puissiez accompagner <span>vos</span> utilisateurs dans leur actes de reforestation ! <span>Vous</span> <span>pouvez</span> d&eacute;sormais <span>mieux</span> g&eacute;rer <span>vos</span> coupons dans la section &quot;Mes coupons&quot; de <span>votre</span> profil et exporter les donn&eacute;es si <span>vous</span> en <span>avez</span> <span>besoin</span>.</p>\r\n								<p style=\"margin-bottom: 0.5cm\">\r\n									<span>Nous</span> travaillons <span>actuellement</span> pour <span>pouvoir</span> <span>vous</span> permettre de modifier simplement <span>votre</span> logo, <span>votre</span> accroche et <span>&eacute;galement</span> <span>vous</span> permettre de cr&eacute;er <span>votre</span> page personnalis&eacute;e pour <span>vos</span> visiteurs !</p>\r\n								<p style=\"margin-bottom: 0.5cm\">\r\n									Suivez l&#39;actualit&eacute; de l&#39;Association <span>Up2green</span> Reforestation, <span>ces</span> nouvelles fonctionnalit&eacute;s approchent !</p>\r\n							</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<table style=\"width: 100%;\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"width: 100%;\">\r\n								<ul>\r\n									<li>\r\n										<span style=\"font-size:12px;\"><strong><a href=\"http://association.up2green.com/article/nos_objectifs\"><span style=\"color: rgb(0, 128, 0);\">Qui sommes <span>nous</span> ?</span></a></strong></span></li>\r\n									<li>\r\n										<span style=\"font-size:12px;\"><strong><a href=\"http://reforestation.up2green.com/\"><span style=\"color: rgb(0, 128, 0);\">Plantez un <span>arbre</span> !</span></a></strong></span></li>\r\n									<li>\r\n										<span style=\"font-size:12px;\"><strong><a href=\"http://up2green.com/checkout/coupon\"><span style=\"color: rgb(0, 128, 0);\"><span>Offrez</span> un arbe !</span></a></strong></span></li>\r\n									<li>\r\n										<span style=\"font-size: