/header_06.gif) no-repeat transparent\" width=\"241\">\r\n								<span style=\"font-size:10px;\"><strong><span style=\"color: rgb(255, 255, 255);\">17 Juin 2011</span></strong></span></td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<table cellpadding=\"10\" cellspacing=\"0\" style=\"width: 100%;\">\r\n					<tbody>\r\n						<tr>\r\n							<td colspan=\"2\">\r\n								<h1 style=\"color: #2c8a40\">\r\n									<span style=\"color:#008000;\">Up2green &eacute;volue !<span _fck_bookmark=\"1\" style=\"display: none;\">&nbsp;<span _fck_bookmark=\"1\" style=\"display: none;\">&nbsp;</span></span></span></h1>\r\n								<p style=\"margin-bottom: 0.5cm\">\r\n									Up2green a beaucoup chang&eacute;, nous avons fait un gros travail ces derni&egrave;res semaines pour vous proposer de nouvelles fonctionnalit&eacute;s afin que nous plantions ensemble encore plus d&#39;arbres sur la Plan&egrave;te.</p>\r\n								<span _fck_bookmark=\"1\" style=\"display: none;\">&nbsp;</span><span _fck_bookmark=\"1\" style=\"display: none;\">&nbsp;</span>\r\n								<p style=\"margin-bottom: 0.5cm;\">\r\n									<strong>Au programme :</strong></p>\r\n								<ul>\r\n									<li>\r\n										<strong><span>Plantez</span> <span><span>gratuitement </span></span>des <span>arbres</span> au <span>fil</span> de <span>vos</span> <span>recherches </span>sur Internet !</strong></li>\r\n									<li>\r\n										<strong><span>Parrainez</span> <span>vos</span> <span>amis</span> ! </strong></li>\r\n									<li>\r\n										<strong><span>Offrez</span> des <span>arbres</span> <span>&agrave;</span> planter <span>sur</span> la <span>Plan&egrave;te</span> ! </strong></li>\r\n									<li>\r\n										<strong><span>D&eacute;couvrez</span> les programmes sur <span>notre</span> nouvelle <span>google</span> map ! </strong></li>\r\n								</ul>\r\n								<p style=\"margin-bottom: 0.5cm\">\r\n									<span>Nous</span> <span>am&eacute;liorons</span> <span>notre</span> communication en <span>vous</span> <span>proposant</span> de <span>suivre</span> <span>Up2green</span> Reforestation <span>sur</span> les <span>r&eacute;seaux</span> <span>sociaux</span> et <span>d&#39;&ecirc;tre</span> <span>tenu</span> au courant des <span>nouveaut&eacute;s</span>&nbsp; : d&egrave;s maintenant suivez notre actualit&eacute; sur <a href=\"http://twitter.com/up2green\" target=\"_blank\"><span style=\"color:#008000;\">Twitter</span></a> et <a href=\"http://www.facebook.com/pages/Up2green/224019854294331\" target=\"_blank\"><span style=\"color:#008000;\">Facebook</span></a></p>\r\n							</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"vertical-align: top; border-right: #aaa 1px solid; width: 50%;\">\r\n								<p style=\"margin-bottom: 0.5cm\">\r\n									<strong><font color=\"#008000\"><font face=\"arial, helvetica, sans-serif\"><font size=\"3\"><strong><font color=\"#008000\"><font face=\"arial, helvetica, sans-serif\"><font size=\"3\">Parrainez vos amis et gagnez encore plus de cr&eacute;dits arbres !</font></font></font></strong></font></font></font></strong></p>\r\n								<p style=\"margin-bottom: 0.5cm\">\r\n									<font face=\"arial, helvetica, sans-serif\"><font face=\"arial, helvetica, sans-serif\"><font face=\"arial, helvetica, sans-serif\">Un <strong>nouveau <span>syst&egrave;me</span> de <span>parrainage</span></strong> <span>vous</span> <span>permet</span> <span>d&#39;inviter</span> <span>vos</span> <span>proches</span> <span>&agrave;</span> <span>nous</span> <span>rejoindre.</span></font></font></font></p>\r\n								<p style=\"margin-bottom: 0.5cm;\">\r\n									<font face=\"arial, helvetica, sans-serif\"><font face=\"arial, helvetica, sans-serif\"><font face=\"arial, helvetica, sans-serif\">Au fil des recherches de vos filleuls <strong>vous accumulez 10 % de leurs gains en cr&eacute;dits arbres </strong>que vous pouvez ensuite planter via la plate-forme de reforestation !</font></font></font></p>\r\n								<p style=\"margin-bottom: 0.5cm\">\r\n									<font face=\"arial, helvetica, sans-serif\"><font face=\"arial, helvetica, sans-serif\"><font face=\"arial, helvetica, sans-serif\">N&#39;h&eacute;sitez donc pas a faire conna&icirc;tre Up2green &agrave; votre famille et &agrave; vos amis !</font></font></font></p>\r\n							</td>\r\n							<td style=\"border-left: #ddd 1px solid; vertical-align: top width: 50%;\">\r\n								<p>\r\n									<strong><font color=\"#008000\"><font face=\"arial, helvetica, sans-serif\"><font size=\"3\">Faites d&eacute;couvrir up2green en offrant un coupon de plantation &agrave; votre famille et &agrave; vos amis !</font></font></font></strong></p>\r\n								<p>\r\n									<strong>Un cadeau unique</strong> &agrave; l&#39;un de vos proches ?</p>\r\n								<p>\r\n									Pourquoi ne pas lui <strong>offrir des arbres &agrave; planter sur la Plan&egrave;te&nbsp;?</strong></p>\r\n								<p>\r\n									Vous pouvez d&egrave;s maintenant lui offrir un coupon plantation en utilisant votre compte up2green.</p>\r\n								<p>\r\n									<strong>Il choisira lui-m&ecirc;me o&ugrave; les planter sur la plan&egrave;te </strong>parmi les programmes auxquels il d&eacute;sire contribuer !</p>\r\n							</td>\r\n						</tr>\r\n						<tr>\r\n							<td style=\"vertical-align: top; border-right: #aaa 1px solid\">\r\n								<p style=\"margin-bottom: 0.5cm\">\r\n									<strong><font color=\"#008000\"><font face=\"arial, helvetica, sans-serif\"><font size=\"3\">Nouvelle Google Map !</font></font></font></strong></p>\r\n								<p style=\"margin-bottom: 0.5cm\">\r\n									L&#39;&eacute;quipe d&#39;Up2green Reforestation a fait un gros travail sur la google map de la plate-forme de plantation en ligne. Cela vous permet de visualiser plus en d&eacute;tails nos programmes de reforestation communautaires.</p>\r\n								<p style=\"margin-bottom: 0.5cm\">\r\n									Une partie de notre &eacute;quipe est d&#39;ailleurs actuellement entrain de <strong>collecter les coordonn&eacute;es GPS sur le terrain </strong>afin de visualiser chaque parcelle de plantation !</p>\r\n								<p style=\"margin-bottom: 0.5cm\">\r\n									Vous avez&nbsp;&eacute;galement la possibilit&eacute; de voir <strong>la capacit&eacute; de plantation des programmes</strong> afin de pouvoir juger par vous m&ecirc;me de l&#39;avancement des plantations et de voir les programmes qui ont le plus besoin de&nbsp;vous.</p>\r\n							</td>\r\n							<td style=\"border-left: #ddd 1px solid; vertical-align: top\">\r\n								<p>\r\n									<strong><font color=\"#008000\"><font face=\"arial, helvetica, sans-serif\"><font size=\"3\"><span>Up2green</span> <span>s&#39;enrichit</span> <span>d&#39;un</span> module de <span>paiement</span> via <span>Paypal</span> !</font></font></font></strong></p>\r\n								<p>\r\n									<span>Maintenant</span> <span>vous</span> <span>pouvez</span> <span>participer</span> encore plus <span>activement</span> <span>&agrave;</span> la reforestation en <span>cr&eacute;ditant</span> <span>votre</span> <span>compte</span> en <span>arbres.</span></p>\r\n								<p>\r\n									<strong><span>D&egrave;s</span> <span>maintenant</span> <span>vous</span> <span>pouvez</span> <span>acheter</span> <span>directement</span> des <span>cr&eacute;dits</span> <span>arbres</span> via <span>Paypal</span></strong> et les planter dans le programme de <span>votre</span> <span>choix</span> ! Les <span>cr&eacute;dits</span> <span>arbres</span> <span>achet&eacute;s</span> via <span>Paypal</span> <span>sont</span> <span>identiques</span> aux <span>cr&eacute;dits</span> <span>arbres</span> <span>accumul&eacute;s</span> <span>gratuitement</span>&nbsp;<span>lors</span> de <span>vos</span> <span>recherches</span> <span>sur le moteur</span> <span>Up2green</span>. <span>Vous</span> <span>pouvez</span> <span>ensuite</span> les planter via la <span>plateforme</span> de reforestation <span>dans</span> le <span>programme</span> de <span>votre</span> <span>choix</span>.</p>\r\n							</td>\r\n						</tr>\r\n						<tr>\r\n							<td colspan=\"2\" style=\"vertical-align: top\">\r\n								<p style=\"margin-bottom: 0.5cm\">\r\n									<strong><font color=\"#4b0082\"><font size=\"3\">Partenaires, pour vous aussi le plein de nouveaut&eacute;s !</font></font></strong></p>\r\n								<p style=\"margin-bottom: 0.5cm;\">\r\n									<strong>Des cartes cadeau reforestation pour vos clients ou collaborateurs, utilisables via une plate-forme de plantation en ligne personnalisable !</strong></p>\r\n								<p style=\"margin-bottom: 0.5cm;\">\r\n									Vous pouvez d&eacute;sormais visualiser directement <strong>l&#39;utilisation en temps r&eacute;el des coupons</strong> que vous avez offerts dans la section &quot;Mes coupons&quot; de votre profil partenaire. Il est &eacute;galement possible d<strong>&#39;exporter</strong><strong> les donn&eacute;es</strong> si vous souhaitez les analyser plus en d&eacute;tails.</p>\r\n								<p style=\"margin-bottom: 0.5cm\">\r\n									Nous travaillons par ailleurs sur une version avanc&eacute;e de l&#39;interface d&#39;administration vous permettant de <strong>personnaliser la plate-forme de reforestation </strong>que nous mettons &agrave; votre disposition. Vous pourrez ainsi modifier simplement votre logo, votre accroche, l&#39;attestation de plantation et cr&eacute;er votre page personnelle pour accueillir vos visiteurs !</p>\r\n								<p style=\"margin-bottom: 0.5cm\">\r\n									Suivez l&#39;actualit&eacute; de l&#39;Association Up2green Reforestation, ces nouvelles fonctionnalit&eacute;s approchent !</p>\r\n							</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<table style=\"width: 100%;\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"width: 100%;\">\r\n								<ul>\r\n									<li>\r\n										<span style=\"font-size:12px;\"><strong><a href=\"http://association.up2green.com/article/nos_objectifs\"><span style=\"color: rgb(0, 128, 0);\">Qui sommes nous ?</span></a></strong></span></li>\r\n									<li>\r\n										<span style=\"font-size:12px;\"><strong><a href=\"http://reforestation.up2green.com/\"><span style=\"color: rgb(0, 128, 0);\">Plantez un arbre !</span></a></strong></span></li>\r\n									<li>\r\n										<span style=\"font-size:12px;\"><strong><a href=\"http://up2green.com/checkout/coupon\"><span style=\"color: rgb(0, 128, 0);\">Offrez des arbres !</span></a></strong></span></li>\r\n									<li>\r\n										<span style=\"font-size:12px;\"><strong><a href=\"http://up2green.com/checkout/credit\"><span style=\"color: rgb(0, 128, 0);\">Aidez l&#39;association</span></a></strong></span></li>\r\n								</ul>\r\n							</td>\r\n							<td>\r\n								<img src=\"/images/newsletter/footer-plante.gif\" /></td>\r\n							<td>\r\n								<table cellpadding=\"15\" cellspacing=\"0\" height=\"220\" style=\"background: url(/images/newsletter/footer-right.jpg) no-repeat transparent\" width=\"280\">\r\n									<tbody>\r\n										<tr>\r\n											<td style=\"text-align: right; height: 80px;\">\r\n												<a href=\"http://association.up2green.com/\" target=\"_blank\"><span style=\"color:#008000;\"><span style=\"font-size: 11px;\"><strong>Le blog de l&#39;association</strong></span></span></a></td>\r\n										</tr>\r\n										<tr>\r\n											<td style=\"text-align: right; height: 70px;\">\r\n												<a href=\"http://www.up2green.com/\" target=\"_blank\"><span style=\"color:#008000;\"><span style=\"font-size: 11px;\"><strong>Le moteur de recherche</strong></span></span></a></td>\r\n										</tr>\r\n										<tr>\r\n											<td style=\"text-align: right;\">\r\n												<p>\r\n													<a href=\"http://reforestation.up2green.com/\" target=\"_blank\"><span style=\"color:#008000;\"><span style=\"font-size: 11px;\"><strong>plateforme de reforestation</strong></span></span></a></p>\r\n											</td>\r\n										</tr>\r\n									</tbody>\r\n								</table>\r\n			