INSERT INTO `organisme_translation` VALUES (2,'Trees For The Future Fondation','<p>\r\n	<span style=\"font-size: 11px;\">Since 1989, Trees for the Future has been helping communities around the world plant trees. Through seed distribution, agroforestry training, and our country programs, we have empowered rural groups to restore tree cover to their lands. Planting trees protects the environment and helps to preserve traditional livelihoods and cultures for generations.</span></p>\r\n','<p>\r\n	<span style=\"font-size: 11px;\">Our mission and history demonstrate how dedicated we are to sustainable agroforestry.</span></p>\r\n','en','trees-for-the-future-fondation'),(2,'Trees For The Future','<p>\r\n	<span style=\"font-size: 11px;\">Since 1989, Trees for the Future has been helping communities around the world plant trees. Through seed distribution, agroforestry training, and our country programs, we have empowered rural groups to restore tree cover to their lands. Planting trees protects the environment and helps to preserve traditional livelihoods and cultures for generations.</span></p>\r\n','<p>\r\n	<span style=\"font-size: 11px;\">Our mission and history demonstrate how dedicated we are to sustainable agroforestry.</span></p>\r\n','fr','fondation-trees-for-the-future'),(5,'CALA Fondation','<br />\r\n','<br />\r\n','en','cala-fondation'),(5,'CALA','<p>\r\n	Le <strong><span>Comit&eacute;</span> <span>d&rsquo;Aide</span> aux <span>L&eacute;preux</span> <span>d&rsquo;Antalaha</span></strong> <span>est</span> <span>l&rsquo;une</span> des <span>rares</span> institutions <span>priv&eacute;es</span> <span>la&iuml;ques</span> <span>oeuvrant</span> pour la <span>r&eacute;insertion</span> <span>sociale</span> et <span>professionnelle</span> des <span>anciens</span> <span>malades</span> de la <span>l&egrave;pre</span> <span>dans</span> la <span>r&eacute;gion</span> <span>d&rsquo;Antalaha</span>. <span>Ce</span> <span>centre</span> <span>priv&eacute;</span> <span>est</span> <span>soutenu</span> <span>entre</span> <span>autres</span>, par <span>l&rsquo;Association</span> <span>Fran&ccedil;aise</span> <span>Raoul</span> <span>Follereau</span>. Sa&nbsp; vocation <span>est</span> de <span>venir</span> en aide <span>m&eacute;dicalement</span> et <span>socialement</span> aux plus <span>d&eacute;munis</span>.</p>\r\n','<p>\r\n	<strong>Le centre priv&eacute; </strong><strong>CALA</strong>a &eacute;t&eacute; cr&eacute;&eacute; <strong>le 02 ao&ucirc;t 1988.</strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Le CALA se donne comme objectif d&rsquo;aider les anciens malades de la l&egrave;pre de la r&eacute;gion d&rsquo;Antalaha &agrave; vivre comme les autres, au moyen de dons en m&eacute;dicaments, en nature ou financiers et d&rsquo;activit&eacute;s lucratives.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Le but est de mettre en place des assistances m&eacute;dicales et p&eacute;cuniaires, une &eacute;ducation sanitaire, des moyens d&rsquo;exploiter leurs aptitudes professionnelles, des aides au logement et &agrave; l&rsquo;&eacute;ducation de leurs enfants et donner une autonomie &agrave; tous ceux que la maladie a rendus handicap&eacute;s.</p>\r\n<p>\r\n	<strong>La reforestation des zones d&eacute;vast&eacute;es par les </strong><strong>diff&eacute;rents</strong><strong>cyclones</strong> par la cr&eacute;ation de p&eacute;pini&egrave;res et d&rsquo;une activit&eacute; &eacute;conomique li&eacute;e &agrave; l&rsquo;exploitation de ces plantations, est &rsquo;un des moyens de redonner cette autonomie.</p>\r\n','fr','fondation-cala'),(6,'Oceanium Fondation','<br />\r\n','<br />\r\n','en','oceanium-fondation'),(6,'Fondation Oceanium','<p>\r\n	<strong>L&rsquo;Oc&eacute;anium</strong> est &agrave; la fois une <strong>Association de protection de l&rsquo;environnement</strong> et un Centre de loisir proposant des activit&eacute;s subaquatiques (plong&eacute;e) ainsi qu&rsquo;un h&eacute;bergement type auberge de jeunesse.</p>\r\n<p>\r\n	L&rsquo;un des objectifs de l&rsquo;Association de protection de l&rsquo;environnement est de&nbsp;<strong>reboiser pour lutter contre la d&eacute;sertification et le r&eacute;chauffement climatique</strong>.</p>\r\n','<p>\r\n	Une forte pression anthropique p&egrave;se sur les for&ecirc;ts, avec une utilisation abusive du bois de chauffe, du charbon de bois, des bois d&rsquo;oeuvre, les feux de brousse, le surp&acirc;turage et la divagation du b&eacute;tail si bien que le couvert v&eacute;g&eacute;tal ne peut plus assurer sa r&eacute;g&eacute;n&eacute;ration naturelle. Pour lutter contre la d&eacute;forestation, l&rsquo;Association a mis en place au si&egrave;ge &agrave; Dakar et &agrave; son antenne de Tambacounda des p&eacute;pini&egrave;res d&rsquo;arbres fruitiers et d&rsquo;essence locales (manguiers, ditakh, citronniers, papayers..).</p>\r\n<p>\r\n	Elle appuie des initiatives de reboisement ou aide techniquement et/ou financi&egrave;rement &agrave; la <strong>mise en place de p&eacute;pini&egrave;res villageoises, vergers, p&eacute;rim&egrave;tres agro forestiers</strong> et mise en place de for&ecirc;ts communautaires.</p>\r\n<p>\r\n	L&rsquo;organisme milite &eacute;galement pour des <strong>pratiques biologiques</strong> : promotion des engrais et insecticides naturels. Par ailleurs les produits des r&eacute;coltes d&rsquo;arbres fruitiers permettent d&rsquo;augmenter les revenus et les apports nutritifs des populations locales.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Elle m&egrave;ne &eacute;galement depuis quelques ann&eacute;es des campagnes de <strong>reboisement de mangrove</strong> pour une gestion durable des ressources marines et c&ocirc;ti&egrave;res.</p>\r\n','fr','fondation-oceanium'),(7,'Projets + Actions','<br />\r\n','<br />\r\n','en','projetsplusactions'),(7,'Projets + Actions','<p>\r\n	Projets Plus Actions est une Organisation de Solidarité Internationale intervenant sur les 5 continents. </p>\r\n','<h4>\r\n	L\'O.S.I. /</h4>\r\n<p>\r\n	Projets Plus Actions est une Organisation de Solidarité Internationale intervenant sur les 5 continents. Projets Plus Actions intervient en soutien à des initiatives locales par le financement de microprojets et l\'apport de compétences techniques pour les réaliser.</p>\r\n<h4>\r\n	L\'histoire de Projets Plus Actions /</h4>\r\n<p>\r\n	Janvier 2006 : Début des actions de co-développement par Jean-Marc CIVIERE avec l\'ONG beninoise Andia. Financement d\'un cheptel de caprins et ovins dans le cadre d\'un projet d\'une ferme école.<br />\r\n	25 décembre 2006 : Création des statuts de Projets Plus Actions.<br />\r\n	Projets Plus Actions a été enregistré le 28 décembre 2006.<br />\r\n	N° 0953017593 à la sous-préfecture de Pontoise.</p>\r\n<h4>\r\n	Son fonctionnement /</h4>\r\n<p>\r\n	Janvier 2006 : Début des actions de Projets Plus Actions soutien volontairement un nombre limité de projets afin de les soutenir le mieux possible et d\'en contrôler la réalisation. Les partenariats sont créés pour une durée de 3 à 10 ans et ont pour perspectives l\'autonomie des populations. L\'amélioration des conditions de vie, l\'autonomisation des populations, le respect des cadres de développement nationaux, l\'approche pertinente, novatrice et durable déterminent le choix des projets aidés et des partenariats contractés.<br />\r\n	Les donateurs, sous certaines conditions, peuvent venir voir sur le terrain à quelles actions et comment sont utilisés les fonds qui sont confiés à Projets Plus Actions.</p>\r\n','fr','projetsplusactions'),(8,'Up2green Reforestation','<br />\r\n','<br />\r\n','en','up2green-en'),(8,'Up2green Reforestation','','<p>\r\n	L\'association a pour buts de :</p>\r\n<ul>\r\n	<li>\r\n		<span dir=\"ltr\">Favoriser, développer et promouvoir toute action positive en lien avec la lutte contre le réchauffement climatique : reforestation, conservation de la biodiversité, aide aux populations touchées par les pénuries d\'origine climatique, séquestration du CO2 atmosphérique,…</span></li>\r\n	<li>\r\n		<span dir=\"ltr\"><u>Participer au financement de programmes de reforestation dans le </u></span><span dir=\"ltr\"><u>monde.</u></span>Ces programmes peuvent être réalisés par tout type d\'organisme (associatif, fondation, ONG,…), Etat, entreprise privée ou établissement public,…</li>\r\n	<li>\r\n		<span dir=\"ltr\"><u>Collecter des </u></span><span dir=\"ltr\"><u>fonds</u></span>en vue du financement de ces programmes de reforestation ou de tout programme à vocation écologique ;</li>\r\n	<li>\r\n		<span dir=\"ltr\"><u>Etablir des </u></span><span dir=\"ltr\"><u>partenariats</u></span>avec ces organismes en vu du financement des programmes</li>\r\n	<li>\r\n		<span dir=\"ltr\"><u>Aider les </u></span><span dir=\"ltr\"><u>populations</u></span>touchées par la déforestation ou par la perte de maîtrise foncière leur assurant une activité locale durable</li>\r\n	<li>\r\n		<span dir=\"ltr\">Participer au déploiement en France et à l\'international de méthodologies de certification des programmes de reforestation.</span></li>\r\n</ul>\r\n','fr','up2green'),(9,'','<br />\r\n','<br />\r\n','en',''),(9,'ONF','<p>\r\n	Etablissement public à caractère industriel et commercial créé en 1966, l\'ONF a pour principales missions la gestion des forêts domaniales et des forêts publiques relevant du Régime forestier ainsi que la réalisation de missions d\'intérêt général confiées par l\'Etat.<br />\r\n	L\'ONF développe également diverses prestations de services : gestion, expertise, travaux, au profit de tous clients dans ses domaines d\'excellence que sont les espaces naturels, l\'environnement, la filière forêt bois et le développement des territoires.</p>\r\n','<h3 class=\"first\">\r\n	L\'ONF en bref :</h3>\r\n<p>\r\n	Etablissement public à caractère industriel et commercial créé en 1966, l\'ONF a pour principales missions la gestion des forêts domaniales et des forêts publiques relevant du Régime forestier ainsi que la réalisation de missions d\'intérêt général confiées par l\'Etat.</p>\r\n<p>\r\n	L\'ONF développe également diverses prestations de services : gestion, expertise, travaux, au profit de tous clients dans ses domaines d\'excellence que sont les espaces naturels, l\'environnement, la filière forêt bois et le développement des territoires.</p>\r\n<h3 class=\"first\">\r\n	La gestion des forêts publiques françaises</h3>\r\n<p>\r\n	Le coeur de métier de l\'ONF est centré sur la gestion durable des forêts appartenant à l\'Etat ou aux collectivités territoriales. Il est par essence fondé sur les principes du développement durable, affirmés par le Code forestier : l\'efficacité économique, la performance environnementale et la responsabilité sociale.<br />\r\n	<br />\r\n	L\'ONF gère ainsi en métropole 1,8 Mha de forêts domaniales et 2,9 Mha de forêts communales, départementales, régionales ou d\'établissements publics. Soit 27% de la forêt française et plus de 8% du territoire national. S\'y ajoutent 6 Mha dans les départements d\'Outre-mer (Guyane, Guadeloupe, Martinique et La Réunion).<br />\r\n	 </p>\r\n<h3>\r\n	Un seul régime pour toutes les forêts publiques : le Régime forestier</h3>\r\n<p>\r\n	Le Régime forestier est d\'abord un ensemble de garanties permettant de préserver la forêt sur le long terme forestier : il constitue un véritable statut de protection du patrimoine forestier contre les aliénations, les défrichements, les dégradations, les surexploitations et les abus de jouissance.<br />\r\n	<br />\r\n	C\'est aussi un régime de gestion avec un souci de renouvellement des ressources en bois, des autres produits et services fournis par les forêts, et de transmission aux générations futures de ces ressources. Ces objectifs se matérialisent au travers de \'l\'aménagement forestier\' établi pour chaque forêt. </p>\r\n<h3>\r\n	Un contrat pluriannuel avec l\'Etat</h3>\r\n<p>\r\n	L\'exercice des différentes missions de l\'ONF est encadré par un contrat pluriannuel d\'objectifs et de moyens avec l\'Etat. Signé en juin 2006, ce contrat couvre la période 2007/2011.<br />\r\n	<br />\r\n	Par ce contrat, l\'ONF s\'engage en particulier sur :</p>\r\n<ul>\r\n	<li class=\"puce_verte\">\r\n		une gestion durable, innovante et exemplaire des forêts publiques</li>\r\n	<li class=\"puce_verte\">\r\n		une contribution renforcée à l\'approvisionnement régulier de la filière bois et au développement des usages énergétiques du bois</li>\r\n	<li class=\"puce_verte\">\r\n		un développement de ses activités de prestation de services dans un double souci de réponse aux attentes des marchés et de financement de ses actions d\'intérêt général, notamment dans l\'environnement, l\'accueil du public en forêt et la prévention des risques naturels. </li>\r\n</ul>\r\n<h3>\r\n	La mise en oeuvre des missions d\'intérêt général confiées par l\'Etat</h3>\r\n<p>\r\n	L\'ONF assure différentes missions d\'intérêt général (MIG) qui lui sont confiées par conventions avec le ministère chargé de la forêt et celui chargé de l\'écologie et du développement durable.<br />\r\n	<br />\r\n	Elles portent sur la prévention des risques naturels et la sécurité des biens et des personnes : en montagne avec le service de Restauration des terrains en montagne (RTM), dans les zones sensibles aux incendies (Défense des forêts contre les incendies), dans les DOM et sur les dunes du littoral. </p>\r\n<h3>\r\n	La mobilisation et la récolte de la ressource bois disponible</h3>\r\n<p>\r\n	L\'ONF mobilise et met en vente l\'ensemble des bois issus des opérations sylvicoles d\'amélioration et de régénération des forêts publiques, soit près de 40% des bois mis en marché sur le territoire national.<br />\r\n	<br />\r\n	Pour le bois d\'oeuvre, les forêts publiques fournissent plus de 50% du Chêne, 85% du Hêtre et 50% du Sapin-Epicéa mis en marché, ce qui confère à l\'ONF une responsabilité particulière au sein de la filière-bois.</p>\r\n<h3>\r\n	Le développement de prestations de services</h3>\r\n<p>\r\n	L\'expertise de l\'ONF en matière de forêt s\'étend également aux autres espaces naturels. L\'ONF propose ainsi aux collectivités, entreprises ou particuliers des prestations de services dans différents domaines : gestion de l\'arbre, évaluation et prévention des risques naturels, qualité des paysages, réhabilitation de sites, protection et valorisation des milieux naturel, gestion de l\'eau, développement des loisirs nature...<br />\r\n	<br />\r\n	Dans les pays en développement, l\'ONF valorise à travers sa filiale ONF International (ONF I), un savoir-faire reconnu par des prestations de conseil, d\'expertise et d\'ingénierie en matière de séquestration de carbone biologique.</p>\r\n','fr','onf'),(10,'','<br />\r\n','<br />\r\n','en','1'),(10,'Ishpingo','<p>\r\n	Ishpingo est une association &eacute;quatorienne qui d&eacute;veloppe la plantation d&#39;esp&egrave;ces fruiti&egrave;res et d&#39;esp&egrave;ces &agrave; bois avec les communaut&eacute;s d&#39;indiens d&#39;Amazonie Equatorienne.</p>\r\n','','fr','ishpingo'),(11,'Eco Preservation Society','<h3>\r\n	<span style=\"color: rgb(51, 51, 51);\">Eco Preservation Society is actively engaged in sustainably focused programming for the purpose of wildlife conservation and reforestation. </span></h3>\r\n','<br />\r\n','en','eco-preservation-society'),(11,'Eco Preservation Society','<p>\r\n	EPS, en plus de mener des projets deprotection d&rsquo;esp&egrave;ces menac&eacute;es au Costa Rica (tortues marines et singes Titi), a lanc&eacute; en 2010 un projet de pr&eacute;servation du littoral incluant un projet pilote de reforestation (2000 arbres) pour la cr&eacute;ation d&rsquo;un corridor biologique.</p>\r\n','<p>\r\n	Le programme se situe au Costa Rica, dans le Parc National Manuel Antonio, r&eacute;gion Pacifico Central, communaut&eacute;s CoopeSilencio et Matapalo, Playa el Rey.</p>\r\n','fr','eco-preservation-society');
