INSERT INTO `partenaire` VALUES (1,2,'c188161dc944a4680835b266299e3afe82aebb71.jpg','DYRUP','<p>\r\n	<span style=\"font-size: 14px;\"><strong>DYRUP vous souhaite une belle ann&eacute;e 2011</strong> et&nbsp;vous offre un arbre &agrave; planter sur la Plan&egrave;te &agrave; l&#39;occasion de l&#39;ann&eacute;e internationale de la For&ecirc;t !</span></p>\r\n','<br />\r\n','http://dyrup.fr/','2010-09-06 11:35:34','2010-12-08 22:24:36',NULL,NULL),(2,3,'ac845805c4f537762f8eb346a9974b0182e61ab1.jpg','Etude Notariale','<p>\r\n	Nous vous offrons un arbre &agrave; planter sur la Plan&egrave;te</p>\r\n','<br />\r\n','http://www.exemple.com','2010-09-20 23:05:29','2010-10-21 20:31:30',NULL,NULL),(3,4,'e4e1aeb9857febb420c116759432a85c3398b46e.png','Partenaire de test','<p>\r\n	accroche du partenaire</p>','<p>\r\n	Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla dictum convallis ipsum, eu sagittis purus convallis ac. Quisque quis urna arcu. Mauris enim quam, pellentesque et porttitor et, pellentesque sed risus. Proin tempus mollis urna, hendrerit ornare nibh consectetur ac. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae; Vivamus et lectus magna. Fusce sed tellus eros, id consequat arcu. Vivamus urna nunc, vehicula nec facilisis vel, luctus vel elit. Quisque mattis tempus porttitor. Maecenas lobortis, tellus ut gravida feugiat, turpis magna bibendum erat, bibendum vehicula nisi nulla eget magna. Etiam sit amet sem eget sapien vestibulum mollis tristique et justo. Cras at ligula vitae lectus cursus vestibulum. Phasellus et est justo. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Fusce varius volutpat dignissim. Curabitur mollis gravida quam, at tincidunt ligula fringilla ac. Praesent congue turpis et arcu pretium tincidunt. Vivamus congue ultricies sapien sit amet vulputate. Phasellus nec sapien eu nisi tincidunt elementum.</p>\r\n','http://www.up2green.com','2010-09-20 23:37:44','2010-09-22 23:23:19',NULL,NULL),(4,5,'de28bdd34be5a0439104dd83ca0246f4ec3d4e51.jpg','Dalkia','<p>\r\n	A <span>l&#39;occasion</span> de 2011, <span>ann&eacute;e</span> <span>internationale</span> de la <span>for&ecirc;t</span>, <span>plantez</span> 1 <span>arbre</span> <span>sur</span> la Terre <span>avec</span> la Direction <span>des</span> <span>Comptes</span> <span>Strat&eacute;giques</span> de <span>DALKIA</span> !</p>\r\n','<p>\r\n	A modifier</p>\r\n','http://www.dalkia.fr/','2010-10-21 20:39:04','2010-10-21 20:59:23',NULL,NULL),(5,7,NULL,'AJT','<p>\r\n	L&#39;association des Anciens de Jet Tours vous offre un arbre &agrave; planter sur la Plan&egrave;te &agrave; l&#39;occasion de 2011, ann&eacute;e internationale de la for&ecirc;t !</p>\r\n<div firebugversion=\"1.5.4\" id=\"_firebugConsole\" style=\"display: none;\">\r\n	&nbsp;</div>\r\n<br />\r\n','<p>\r\n	...</p>\r\n<div firebugversion=\"1.5.4\" id=\"_firebugConsole\" style=\"display: none;\">\r\n	&nbsp;</div>\r\n<br />\r\n','http://www.ajt.com','2010-11-06 12:47:13','2010-11-06 12:50:09',NULL,NULL),(6,9,'0b13ac179b3777671b475617d412d92861f9949d.jpg','TECHNIKARTe','<p>\r\n	<span style=\"font-size: 14px;\">L&#39;association <strong>UP2GREEN REFORESTATION</strong> offre un <span>arbre</span> <span>&agrave;</span> planter <span>sur</span> la <span>Plan&egrave;te </span>aux 100 premiers porteurs <strong>TECHNIKART&#39;e</strong>.</span></p>\r\n<p>\r\n	<span style=\"font-size: 14px;\">2011 sera l&#39;ann&eacute;e internationale de la for&ecirc;t !</span></p>\r\n','<p>\r\n	...</p>\r\n','http://www.aqoba.com','2010-11-09 18:42:04','2010-11-11 17:50:10',NULL,NULL),(7,10,'e7fde2bbbec2fafa96b3e8b2e976cd5c7c66e917.jpg','URBIPARC','<p>\r\n	<span style=\"font-size: 14px;\">A l&#39;occasion de la pose de la premi&egrave;re pierre des <strong>Reflets du Vercors</strong>, URBIPARC vous offre <strong>un arbre &agrave; planter sur la Plan&egrave;te !</strong></span><br />\r\n	&nbsp;</p>\r\n','<p>\r\n	...</p>\r\n','http://www.urbiparc.com/','2010-11-12 18:13:07','2010-11-12 18:13:07',NULL,NULL),(8,12,'5d4095d667451cc1f9731ae8ea49e5f4fd9b217b.jpg','Veolia Eau IDF et le SEDIF','<p>\r\n	<span style=\"font-size: 14px\"><strong>Veolia Eau d&#39;Ile de France</strong> vous offre <strong>un arbre</strong> &agrave; planter sur la Plan&egrave;te en 2011, ann&eacute;e internationale de la for&ecirc;t.</span></p>\r\n','<p>\r\n	...</p>\r\n','http://www.sedif.com/','2010-11-16 22:17:51','2011-06-28 15:45:23','<p align=\"center\">\r\n	<span style=\"font-size:24px;\"><span style=\"color: rgb(240, 255, 240);\"><span style=\"font-family: verdana,geneva,sans-serif;\"><strong>Programme de reforestation soutenu par </strong></span></span></span></p>\r\n<p align=\"center\">\r\n	<span style=\"font-size: 24px;\"><span style=\"color: rgb(240, 255, 240);\"><span style=\"font-family: verdana,geneva,sans-serif;\"><strong>le Syndicat des Eaux d&rsquo;Ile-de-France </strong></span></span></span></p>\r\n<p align=\"center\">\r\n	<span style=\"font-size: 24px;\"><span style=\"color: rgb(240, 255, 240);\"><span style=\"font-family: verdana,geneva,sans-serif;\"><strong>et Veolia Eau d&rsquo;Ile-de-France</strong></span></span></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p style=\"text-align: center;\">\r\n	<span style=\"font-size:16px;\"><strong>Objectif &laquo;&nbsp;z&eacute;ro carbone&nbsp;&raquo;</strong></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Le programme de reforestation, s&rsquo;inscrit dans une d&eacute;marche globale et rigoureuse de prise en compte des enjeux climatiques et environnementaux. La production et la distribution de l&rsquo;eau potable entra&icirc;nent de fortes d&eacute;penses &eacute;nerg&eacute;tiques que le Syndicat des Eaux d&rsquo;Ile-de-France et son d&eacute;l&eacute;gataire Veolia Eau d&rsquo;Ile-de-France entendent r&eacute;duire consid&eacute;rablement d&rsquo;ici 2022. Pour cela, ils se sont engag&eacute;s &agrave; &laquo;&nbsp;neutraliser&nbsp;&raquo; les &eacute;missions de gaz &agrave; effet de serre de leurs activit&eacute;s en s&rsquo;appuyant sur 3 leviers&nbsp;:</p>\r\n<ul>\r\n	<li style=\"margin-left: 36pt;\">\r\n		les &eacute;conomies d&rsquo;&eacute;nergie dans l&rsquo;exploitation globale du service de l&rsquo;eau,</li>\r\n	<li style=\"margin-left: 36pt;\">\r\n		un retour accru aux &eacute;nergies renouvelables,</li>\r\n	<li style=\"margin-left: 36pt;\">\r\n		le soutien de plusieurs programmes de reforestation sur la plan&egrave;te.</li>\r\n</ul>\r\n<p>\r\n	&nbsp;</p>\r\n<p style=\"text-align: center;\">\r\n	<span style=\"font-size:20px;\">1 arbre plant&eacute; = 100 kg de CO2 absorb&eacute;</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<table align=\"left\" border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"width: 607px; height: 107px;\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:629px;height:65px;\">\r\n				<p style=\"text-align: center;\">\r\n					<span style=\"font-size:16px;\"><strong>Jusqu&rsquo;&agrave; 500&nbsp;000 arbres par an.</strong></span></p>\r\n				<p style=\"text-align: center;\">\r\n					La quantit&eacute; d&rsquo;arbres plant&eacute;s sera r&eacute;&eacute;valu&eacute;e chaque ann&eacute;e en fonction des bilans &laquo;carbone &raquo;</p>\r\n				<p style=\"text-align: center;\">\r\n					de Veolia Eau d&rsquo; Ile-de-France.</p>\r\n				<p>\r\n					&nbsp;</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p style=\"text-align: center;\">\r\n	<span style=\"font-size:16px;\"><strong>Soutenir la reforestation</strong></span></p>\r\n<p>\r\n	Le SEDIF et Veolia Eau d&rsquo;Ile-de-France ont choisi Up2green Reforestation, association de loi 1901, pour la s&eacute;lection et le suivi des programmes de plantation. Au niveau local, d&rsquo;autres associations partenaires interviennent pour concr&eacute;tiser le projet. Les enjeux varient d&rsquo;un programme &agrave; l&rsquo;autre&nbsp;: r&eacute;cup&eacute;ration de la Mangrove et de la biodiversit&eacute; au S&eacute;n&eacute;gal, lutte contre la d&eacute;sertification et d&eacute;veloppement de l&rsquo;&eacute;co-tourisme au Burkina Faso, d&eacute;veloppement des syst&egrave;mes agro forestiers et diversification alimentaire au P&eacute;rou ...</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<a href=\"http://www.ecocert.fr\"><span style=\"color: rgb(240, 255, 255);\">L&rsquo;op&eacute;ration de reforestation est certifi&eacute;e par ECOCERT</span></a></p>\r\n',NULL),(9,20,'0e03f5b417e5d903a77996b41ba13716d9919d4e.gif','KONE','<p>\r\n	<span style=\"font-size: 14px;\">Toute les &eacute;quipes de <strong>KONE </strong>vous souhaitent une <strong>excellente ann&eacute;e 2011 </strong>et vous offre <strong>un arbre &agrave; planter sur la Plan&egrave;te </strong>&agrave; l&#39;occasion de cette ann&eacute;e internationale de la for&ecirc;t !</span></p>\r\n','<br />\r\n','http://www.kone.com/countries/fr_FR/Pages/default.aspx','2010-11-23 14:40:38','2010-11-23 14:48:11',NULL,NULL),(10,22,'15e06a1c8feed09f8a2e33957869cf550975f72d.jpg','DLIFESTYLE','<p>\r\n	<span style=\"font-size: 16px;\">Let&#39;s plant<strong> your tree on the Planet</strong> with <strong>Dlifestyle </strong>! </span><br />\r\n	&nbsp;</p>\r\n','<br />\r\n','http://www.dlifestyle.net','2010-11-24 19:32:26','2010-11-24 19:33:39',NULL,NULL),(11,6,'37ab6225a961460c7562143a02ed0199643eb747.png','STORISTES DE FRANCE','<p>\r\n	<span style=\"font-size: 14px;\"><strong>Offrez un arbre &agrave; la Plan&egrave;te </strong>avec <strong>Storistes de France</strong> &agrave; l&#39;occasion de l&#39;ann&eacute;e internationale de la for&ecirc;t !</span></p>\r\n','<br />\r\n','http://www.storistes-de-france.com/','2010-11-24 22:46:10','2011-03-13 23:18:13',NULL,NULL),(12,27,'1b480cb4b19d28c8f8763d3390557b90632f26c5.jpg','SIEMENS','<p>\r\n	<span style=\"font-size: 14px;\">A l&#39;occasion de ses voeux pour la nouvelle ann&eacute;e, <strong>les &eacute;quipes de SIEMENS</strong> ont le plaisir de vous <strong>offrir 1 arbre &agrave; planter sur la Plan&egrave;te</strong>.</span></p>\r\n<p>\r\n	2011 sera l&#39;ann&eacute;e internationale de la for&ecirc;t !</p>\r\n','<br />\r\n','http://www.siemens.com/entry/fr/fr/','2010-12-05 17:46:59','2010-12-05 17:46:59',NULL,NULL),(13,35,'787c04a74538af3820614d3e4c7e95ec90094dd9.jpg','ADLER Technologies','<p>\r\n	<span style=\"font-size: 14px;\"><strong>Les &eacute;quipes d&#39;ADLER Technologies</strong> sont heureuses de vous offrir <strong>un arbre &agrave; planter sur la Plan&egrave;te</strong> en 2011, ann&eacute;e internationale de la For&ecirc;t !</span></p>\r\n','<br />\r\n','http://www.adler-tech.com/','2010-12-21 08:11:14','2010-12-24 07:48:17',NULL,NULL),(14,36,'8bad379803cecbc2a5122574ef2eb2d9f4a8b1a5.jpg','l\'association A.S.P.F.','<p>\r\n	<span style=\"font-size: 14px;\"><strong>L&#39;association A.S.P.F. </strong>est heureuse de vous<strong> offrir un arbre &agrave; planter sur la Plan&egrave;te</strong> en 2011, ann&eacute;e internationale de la for&ecirc;t !</span></p>\r\n','<br />\r\n','http://www.association-aspf.org/','2010-12-22 08:08:10','2010-12-22 08:08:10',NULL,NULL),(15,37,'4d8388b3330e6312f91377eef392375fcb5c60e9.jpg','FIMEC','<p>\r\n	<span style=\"font-size: 14px;\"><strong>Les &eacute;quipes de FIMEC</strong> sont heureuses de vous offrir <strong>un arbre &agrave; planter sur la Plan&egrave;te en 2011</strong>, ann&eacute;e internationale de la For&ecirc;t !</span></p>\r\n','<br />\r\n','http://www.fimec-tech.com/','2010-12-24 07:54:31','2010-12-24 07:54:31',NULL,NULL),(16,39,'aec1841c42e9d8e90264d6f742beea84f7edb7ac.jpg','PRIXIS','<p>\r\n	<span style=\"font-size: 14px;\"><strong>PRIXIS </strong>est heureux de vous <strong>offrir un arbre &agrave; planter sur la Plan&egrave;te </strong>&agrave; l&#39;occasion de l&#39;ann&eacute;e internationale de la for&ecirc;t en 2011 !</span></p>\r\n','<br />\r\n','http://fr.linkedin.com/in/masson','2010-12-31 18:18:56','2010-12-31 18:19:24',NULL,NULL),(17,76,'5e668224114b000e367275293205afea3364a13b.jpg','ESTHETIC CENTER','<p>\r\n	ESTHETIC CENTER est heureux de vous offrir un arbre &agrave; planter sur la Plan&egrave;te !</p>\r\n','<br />\r\n','http://www.esthetic-center.com/','2011-02-22 14:05:45','2011-02-22 14:18:04',NULL,NULL),(18,91,'da20a75208db255ad5e3c917f1f4c0827c0d7df4.jpg','Bus Occitan','<p>\r\n	Nous sommes heureux de vous offir un arbre &agrave; planter sur la Plan&egrave;te avec le Bus Occitan, &agrave; l&#39;occasion de l&#39;ann&eacute;e internationale de la for&ecirc;t !</p>\r\n','<br />\r\n','http://www.busoccitan.com/','2011-03-28 19:57:10','2011-03-28 19:57:10',NULL,NULL),(19,96,'b4c3347d87c33a5cbca976046bf3b6a3b2ada290.jpg','GREEN BODGHAYA','<p>\r\n	Plantez un arbre &agrave; Green Bodghaya, un autre sur la Plan&egrave;te et &eacute;crivez votre souhait qui sera accroch&eacute; &agrave; votre arbre &agrave; Green Bodghaya !</p>\r\n','<br />\r\n','http://www.greenbodhgaya.org/spip.php?lang=fr','2011-04-09 16:03:26','2011-04-09 16:03:58',NULL,NULL);
