INSERT INTO `programme_translation` VALUES (2,'Brasil','<p>\r\n	In areas of Guraghe, Konso and Lake Tana, the aim is to fight against desertification and provide incomes to local people (fruit, honey, furniture, lumber, etc..)</p>\r\n','','en','brasil'),(2,'Brésil (Etat de Sao Paulo)','<p>\r\n	Dans la r&eacute;gion de Sao Paulo , pour am&eacute;liorer la production agricole, lutter contre la pauvret&eacute; rurale et apprendre les techniques agro-sylvicoles aux populations locales.</p>\r\n','','fr','bresil-etat-de-sao-paulo'),(3,'Honduras','<p>\r\n	In the mountains, to protect the aquifer and prevent the water shortage. Planting multiple species for different uses: fruit, firewood and construction.</p>\r\n','<br />\r\n','en','honduras'),(3,'Honduras','<p>\r\n	Dans les montagnes, pour prot&eacute;ger les aquif&egrave;res et &eacute;viter la p&eacute;nurie d&#39;eau. Plantation de multiples essences pour diff&eacute;rents usages : production de fruits, de bois de chauffage et de construction.</p>\r\n','<br />\r\n','fr','honduras'),(4,'Haiti (Arcanie Cost)','<p>\r\n	In coastal area of Arcadins in order to restore the hillside and develop an economical activity (charcoal, biofuels, agriculture hillside).</p>\r\n','<br />\r\n','en','haiti-arcanie-cost'),(4,'Haiti (Arcanie)','<p>\r\n	Dans la r&eacute;gion c&ocirc;ti&egrave;re d&#39;Arcadine, pour restaurer les flans de colline et d&eacute;velopper une activit&eacute; &eacute;conomique (charbon de bois, biocarburants, agriculture &agrave; flan de coteau).</p>\r\n','<br />\r\n','fr','haiti-cote-d-arcanie'),(5,'Burundi','<p>\r\n	To fight against malnutrition by planting &#39;Morinfa oleifera&#39; specie tree which contains twice more calcium than milk and 4 times more vitamin A.</p>\r\n','<p>\r\n	<u><strong><span class=\"fontTXBLKund\">Environmental Issues </span></strong></u><br />\r\n	Burundi suffers from a history of unsustainable land-use, even before colonization. The percentage of people living rurally and dependent on agriculture is extremely high at 90% with the average for sub Saharan Africa at 60%. Land is either held by small farmers, of which 80% is less than 1.5 hectares, or is leased to local communes. However, the majority, around 95%, of the land is under no land protection. As a result, agricultural expansion, overgrazing and fuelwood collection have seriously degraded the soil. Only around 6% of Burundi is forested and, in total, between 1990 and 2005 close to 50% of the forest cover was lost. Rampant deforestation has resulted in serious soil erosion, nutrient poor soils, and decreased water resources. Moreover, the long history of conflicts decimated the livestock populations, decreasing an important source of natural fertilizer. Burundi&#39;s wildlife diversity is also threatened. Many species are considered endangered, including the magnificent mountain gorillas in the highland</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><u><span class=\"fontTXBLKund\">Social Issues </span></u></strong><br />\r\n	Burundi is one of the most impoverished nations in Africa, with average annual income at $100. The ethnic conflicts between the Tutsis and the Hutus, largely over decreased natural resources, throughout the 1980s and 1990s crippled the country. Even worse, the AIDS epidemic that ravages the country has left over half of the 8 million inhabitants under the age of 14. Its current development is being further slowed by climatic events including drought, fires and torrential rains which cause flooding and landslides. This, along with unsustainable land-use practices have deeply affected this agrarian population, to the point that 53% of children under the age of five are suffering from chronic malnutrition. For these reasons and more, Trees for the Future and Hope for Burundi are committed in partnership to combat these issues.</p>\r\n<p>\r\n	<u><strong><span class=\"fontTXBLKund\">Response of Trees For the Future :<br />\r\n	</span></strong></u><span class=\"fontTXBLK\">We began working in Burundi in 1996, supporting small community reforestation projects. Since 2008, TREES has partnered with John Bosco Hakizimana of Hope for Burundi. John&#39;s approach &mdash; utilizing trees to reclaim degraded lands, feed starving people, and provide a source of income &mdash; has effectively brought together people and cultures who have been in conflict for too many years. A strong focus has been placed on the planting of <em>Morinfa oleifera. </em> In a country where 57% of children under 5 suffer from chronic malnutrition, <em>Moringa, </em>also called &ldquo;the miracle tree&rdquo; boasts twice the calcium as milk and four times as much Vitamin A (which prevents blindness) as in carrots. Moreover, Hope for Burundi has brought Hutu and Tutsi together in the staff of his organization and has administered community training in non-violent communication to promote Burundian solidarity. People are being educated about agroforestry technologies, sustainable agriculture production, including the development of the Forest Garden model.</span></p>\r\n','en','burundi'),(5,'Burundi','<p>\r\n	Pour lutter contre la malnutrition en plantant l&#39;arbre &#39;Morinfa oleifera&#39; qui contient 2 fois plus de calcium que le lait et 4 fois plus de vitamine A.</p>\r\n','<p>\r\n	<u><strong><span class=\"fontTXBLKund\">Environmental Issues </span></strong></u><br />\r\n	Burundi suffers from a history of unsustainable land-use, even before colonization. The percentage of people living rurally and dependent on agriculture is extremely high at 90% with the average for sub Saharan Africa at 60%. Land is either held by small farmers, of which 80% is less than 1.5 hectares, or is leased to local communes. However, the majority, around 95%, of the land is under no land protection. As a result, agricultural expansion, overgrazing and fuelwood collection have seriously degraded the soil. Only around 6% of Burundi is forested and, in total, between 1990 and 2005 close to 50% of the forest cover was lost. Rampant deforestation has resulted in serious soil erosion, nutrient poor soils, and decreased water resources. Moreover, the long history of conflicts decimated the livestock populations, decreasing an important source of natural fertilizer. Burundi&#39;s wildlife diversity is also threatened. Many species are considered endangered, including the magnificent mountain gorillas in the highland</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><u><span class=\"fontTXBLKund\">Social Issues </span></u></strong><br />\r\n	Burundi is one of the most impoverished nations in Africa, with average annual income at $100. The ethnic conflicts between the Tutsis and the Hutus, largely over decreased natural resources, throughout the 1980s and 1990s crippled the country. Even worse, the AIDS epidemic that ravages the country has left over half of the 8 million inhabitants under the age of 14. Its current development is being further slowed by climatic events including drought, fires and torrential rains which cause flooding and landslides. This, along with unsustainable land-use practices have deeply affected this agrarian population, to the point that 53% of children under the age of five are suffering from chronic malnutrition. For these reasons and more, Trees for the Future and Hope for Burundi are committed in partnership to combat these issues.</p>\r\n<p>\r\n	<u><strong><span class=\"fontTXBLKund\">Response of Trees For the Future :<br />\r\n	</span></strong></u><span class=\"fontTXBLK\">We began working in Burundi in 1996, supporting small community reforestation projects. Since 2008, TREES has partnered with John Bosco Hakizimana of Hope for Burundi. John&#39;s approach &mdash; utilizing trees to reclaim degraded lands, feed starving people, and provide a source of income &mdash; has effectively brought together people and cultures who have been in conflict for too many years. A strong focus has been placed on the planting of <em>Morinfa oleifera. </em> In a country where 57% of children under 5 suffer from chronic malnutrition, <em>Moringa, </em>also called &ldquo;the miracle tree&rdquo; boasts twice the calcium as milk and four times as much Vitamin A (which prevents blindness) as in carrots. Moreover, Hope for Burundi has brought Hutu and Tutsi together in the staff of his organization and has administered community training in non-violent communication to promote Burundian solidarity. People are being educated about agroforestry technologies, sustainable agriculture production, including the development of the Forest Garden model.</span></p>\r\n','fr','burundi-region-de-ruyigi'),(6,'Indonesia','<p>\r\n	In areas of Deli Serdang - Sumatra, to restore the mangroves, bank protection and biodiversity, and storing carbone.</p>\r\n','<br />\r\n','en','indonesia'),(6,'Indonésie','<p>\r\n	Dans les r&eacute;gions de Deli Serdang - Sumatra, pour restaurer les mangroves, prot&eacute;ger les berges et leur biodiversit&eacute;, et stocker le carbone.</p>\r\n','<p>\r\n	&nbsp;</p>\r\n<br />\r\n<div firebugversion=\"1.5.4\" id=\"_firebugConsole\" style=\"display: none;\">\r\n	&nbsp;</div>\r\n<br />\r\n','fr','indonesie'),(8,'Burkina Faso','<p>\r\n	Reforestation program in the Burkina Sahel desert</p>\r\n','<br />\r\n','en','burkina-faso'),(8,'Burkina Faso','<p>\r\n	<strong>Enjeux : d&eacute;veloppement &eacute;cotourisque + cr&eacute;ation d&#39;activit&eacute; &eacute;conomique.</strong></p>\r\n<p>\r\n	R&eacute;gion : Sahel burkinabais</p>\r\n<p>\r\n	Programme de plantation d&#39;arbres fruitiers et de bois d&#39;oeuvre pour les touaregs et les peuls, et pour la lutte contre l&#39;avanc&eacute;e du d&eacute;sert</p>\r\n','<p>\r\n	<img alt=\"\" src=\"/uploads/ck/images/caseBurkina.jpg\" style=\"width: 391px; height: 259px;\" /><img alt=\"\" src=\"/uploads/ck/images/sitewebBurkina.jpg\" style=\"width: 391px; height: 259px;\" /></p>\r\n<p>\r\n	<strong>Enjeux</strong> : lutter contre l&#39;avanc&eacute;e du d&eacute;sert, lutter contre la pauvret&eacute;</p>\r\n<p>\r\n	<strong>Localisation </strong>: Gandefabou, province de l&#39;Oudalan, sahel du Burkina Faso</p>\r\n<p>\r\n	<strong>B&eacute;n&eacute;ficiaires</strong> : Les villageois du campement touareg de Gandefabou</p>\r\n<p>\r\n	<strong>Partenaires du programme</strong> : Projets plus actions, Up2green Reforestation</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Programme</strong> : Developpement du sahel burkinabais</p>\r\n<p>\r\n	<strong>Implication Up2Green </strong>: contribuer aux activit&eacute;s de reboisement. Former les villageois pour le d&eacute;veloppement de leurs propres p&eacute;pini&egrave;res.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Description plus d&eacute;taill&eacute;e :</strong></p>\r\n<p>\r\n	L&#39;association Projets plus Action poursuit, g&egrave;re et coordonne un programme de d&eacute;veloppement &eacute;conomique dans le Sahel Burkinabais et plus particuli&egrave;rement du campement de Gand&eacute;fabou.</p>\r\n<p>\r\n	Ce campement d&rsquo;accueil est de type solidaire, car en effet, son but est de permettre le de?veloppement local, d&rsquo;ame?liorer les conditions de vie des villageois, de limiter l&rsquo;exode vers la Co?te d&rsquo;Ivoire pour travailler dans les champs de coton et les exploitations bananie?res, de cre?er des emplois et donc de la richesse, de prot&eacute;ger la faune et la flore. Pour se faire, l&rsquo;association me?ne diffe?rentes actions aupre?s de la population du village de Gande?fabou et reverse une partie des be?ne?fices ge?ne?re?s par l&rsquo;activite? touristique pour le de?veloppement local.</p>\r\n<p>\r\n	<br />\r\n	Cette r&eacute;gion du Burkina Faso est en effet particulie?rement aride, difficile et soumise aux variations climatiques.</p>\r\n','fr','burkina-faso'),(9,'','','','en','guinea'),(9,'Guinée','<p>\r\n	Planter 1.000.000 d&#39;arbres en deux ans dans les r&eacute;gions de Haute et de Basse Guin&eacute;e. Lutter contre la d&eacute;forestation de la foret primaire et &eacute;duquer les communaut&eacute;s locales &agrave; l&#39;agro-foresterie.</p>\r\n','<p>\r\n	<img alt=\"\" src=\"/uploads/ck/images/reforestation-eco-kyoto-guinee.jpg\" style=\"width: 101px; height: 150px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Enjeux </strong>: lutter contre la d&eacute;forestation, &eacute;duquer les populations locales &agrave; l&#39;agroforesterie.</p>\r\n<p>\r\n	<strong>Localisation</strong> : Basse et Haute Guin&eacute;e</p>\r\n<p>\r\n	<strong>B&eacute;n&eacute;ficiaires </strong>: groupements, associations, les habitants des r&eacute;gions cibl&eacute;es.</p>\r\n<p>\r\n	<strong>Partenaires</strong> : Fondation Eco-Kyoto Guin&eacute;e</p>\r\n<p>\r\n	<strong>Programme </strong>: Planter 1.000.000 d&#39;arbres</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Implication Up2Green </strong>: Contribuer aux objectifs de la Fondation &agrave; mettre en terre 10 000 plants dans le cadre du programme.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Description plus d&eacute;taill&eacute;e :</strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><em>Les objectifs :</em></strong></p>\r\n<p>\r\n	- Planter <strong>1.000.000 </strong>d&#39;arbres pendant deux (2) ans dans les 16 Pr&eacute;fectures de la Haute et de la Basse Guin&eacute;e, sur une superficie de 2.211,77 ha <strong>.</strong></p>\r\n<p>\r\n	- Sensibiliser les populations en vue de leur implication effective dans la gestion et la protection de l&#39;environnement.</p>\r\n<p>\r\n	- impliquer 160 ONG et groupements au niveau local dans tout le processus du projet.</p>\r\n<p>\r\n	- former 160 ONG/ groupements en technique de reboisement.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><em>R&eacute;sultats attendus :</em></strong></p>\r\n<p>\r\n	-<strong>1.000.000 </strong>d&#39;arbres sont plant&eacute;s en deux (2) ans dans les 16 Pr&eacute;fectures de la Haute et la Basse Guin&eacute;e sur une superficie totale de <strong>2.211,77 ha</strong><strong>.</strong></p>\r\n<p>\r\n	-Les populations des r&eacute;gions travers&eacute;es sont sensibilis&eacute;es et sont impliqu&eacute;es effectivement dans la prot</p>\r\n','fr','guinee'),(10,'Madagascar (Antalaha)','<p>\r\n	In the region of Antalaha in the North-East of the island, for social reintegration of people previously sick of leprosy through reforestation of littoral facing cyclonic risks, and planting of pecious wood (rosewood, palissandra, hintsi).</p>\r\n','<p>\r\n	English version very soon...</p>\r\n','en','madagascar-antalaha'),(10,'Madagascar','<p>\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>Enjeux : r&eacute;habilitation d&#39;anciens malades de la l&egrave;pre + d&eacute;veloppement agro-sylvicole</strong></span></span></p>\r\n<p>\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Dans la r&eacute;gion d&#39;Antalaha, pour la r&eacute;insertion sociale des anciens malades de la l&egrave;pre via la reforestation des littoraux face aux risques cycloniques, et la plantation d&#39;essences de bois pr&eacute;cieux.</span></span></p>\r\n','<p>\r\n	<img alt=\"\" src=\"/uploads/ck/images/P1050437.JPG\" style=\"width: 200px; height: 150px;\" /><img alt=\"\" src=\"/uploads/ck/images/P1020442.JPG\" style=\"width: 200px; height: 150px;\" /></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>Enjeux</strong> : Protection des sols et cultures de l&#39;&icirc;le contre les cyclones, formation p&eacute;dagogique des adolescents, aide aux l&eacute;preux, autonomie alimentaire</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>Localisation</strong> : R&eacute;gion d&#39;Antalaha, c&ocirc;te nord-est de Madagascar</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>B&eacute;n&eacute;ficiaires</strong> : Familles et anciens malades de la l&egrave;pre vivant dans la banlieue sud de la ville d&#39;Antalaha</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>Partenaires</strong> : CALA Madagascar</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>Programme</strong> : Ecole Verte</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	&nbsp;</p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"color: rgb(0, 128, 0);\"><span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>Implication Up2Green </strong>: Participer aux activit&eacute;s de plantations et de formations des adolescents pour planter 10 000 arbres.</span></span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">&nbsp;</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>Description plus d&eacute;taill&eacute;e :</strong></span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">CALA coordonne diff&eacute;rents programmes de reforestation &agrave; Madagascar :</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">- Jules village, 7 km au sud d&#39;Antalaha ;</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">- Belfort village, 6 km an nord d&#39;Antalaha ;</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">- Macolline, 3 km au nord d&#39;Antalaha ;</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">- Commune d&#39;Ampahana ;</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">- Commune d&#39;Ambodikakaze ;</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">- Commune d&#39;Antalaha.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">&nbsp;</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong>Le centre priv&eacute; CALA a &eacute;t&eacute; cr&eacute;&eacute; le 02 ao&ucirc;t 1988</strong></span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Le <strong>Comit&eacute; d&#39;Aide aux L&eacute;preux d&#39;Antalaha</strong> est l&#39;une des rares institutions priv&eacute;es la&iuml;ques oeuvrant pour la r&eacute;insertion sociale et professionnelle des anciens malades de la l&egrave;pre dans la r&eacute;gion d&#39;Antalaha. Ce centre priv&eacute; est soutenu entre autres, par l&#39;Association Fran&ccedil;aise Raoul Follereau. Sa vocation est de venir en aide m&eacute;dicalement et socialement aux plus d&eacute;munis.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Le CALA se donne comme objectif <strong>d&#39;aider les anciens malades de la l&egrave;pre</strong> de la r&eacute;gion d&#39;Antalaha &agrave; vivre comme les autres, au moyen de dons en m&eacute;dicaments, en nature ou financiers et d&#39;activit&eacute;s lucratives.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">Le but est de mettre en place des assistances m&eacute;dicales et p&eacute;cuniaires, une &eacute;ducation sanitaire, des moyens d&#39;exploiter leurs aptitudes professionnelles, des aides au logement et &agrave; l&#39;&eacute;ducation de leurs enfants et donner une autonomie &agrave; tous ceux que la maladie a rendus handicap&eacute;s.</span></span></p>\r\n<p style=\"text-align: justify;\">\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\">La <strong>reforestation des zones d&eacute;vast&eacute;es</strong> par les diff&eacute;rents cyclones par la cr&eacute;ation de p&eacute;pini&egrave;res et d&#39;une activit&eacute; &eacute;conomique li&eacute;e &agrave; l&#39;exploitation de ces plantations, est l&#39;un des moyens de redonner cette autonomie.</span></span></p>\r\n','fr','madagascar-antalaha'),(11,'Senegal','<p>\r\n	The reforestation program conducted by the association gathers Oceanium 11 000 villagers who were massively mobilized to restore mangrove forests in Casamance.</p>\r\n','<br />\r\n','en','senegal-en'),(11,'Sénégal','<p>\r\n	Le programme de reboisement r&eacute;alis&eacute; par l&#39;association Oceanium rassemble 11 000 villageois qui se sont massivement mobilis&eacute;s pour restaurer la mangrove en Casamance.</p>\r\n','<p>\r\n	<img alt=\"\" src=\"/uploads/ck/images/Senegal-Oceanium-reforestation.jpg\" style=\"width: 200px; height: 133px;\" /><img alt=\"\" src=\"/uploads/ck/images/Senegal-Oceanium-reforestation2(1).jpg\" style=\"width: 200px; height: 134px;\" /></p>\r\n<p>\r\n	<strong>Enjeux</strong> : restauration de l&#39;&eacute;cosyst&egrave;me de la mangrove, des ressources halieutiques, protection du littoral</p>\r\n<p>\r\n	<strong>Localisation</strong> : Casamance, de Niafarang &agrave; Elinkine, de Nioumoune &agrave; Marssassoum en passant par Tobor.</p>\r\n<p>\r\n	<strong>B&eacute;n&eacute;ficiaires</strong> : sensibilisation de plus 32 000 villageois de la Casamance</p>\r\n<p>\r\n	<strong>Porteur du projet</strong> : Oceanium</p>\r\n<p>\r\n	<strong>Programme</strong> : Restaurer 6000 ha de mangrove, plantons pour la plan&egrave;te</p>\r\n<p>\r\n	<strong>Implication Up2Green </strong>: Aider Oceanium &agrave; passer de 1200 ha de Mangrove r&eacute;cup&eacute;r&eacute;e &agrave; 6000 ha par la plantation de plus de 40 000 pal&eacute;tuviers</p>\r\n<p>\r\n	Les campagnes de <strong>reboisement de mangrove</strong> pour une gestion durable des ressources marines et c&ocirc;ti&egrave;res.</p>\r\n<p>\r\n	Ces actions de restauration permettent de :</p>\r\n<p>\r\n	- R&eacute;g&eacute;n&eacute;rer les &eacute;cosyst&egrave;mes de mangrove dont les populations d&eacute;pendent pour leur survie et ainsi augmenter leurs sources de revenus.</p>\r\n<p>\r\n	- Agir localement et concr&egrave;tement pour minimiser les changements climatiques mondiaux en augmentant les capacit&eacute;s de stockage de CO2.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Depuis 2006, plus de 40 millions de pal&eacute;tuviers ont ainsi &eacute;t&eacute; plant&eacute;s au S&eacute;n&eacute;gal, en Gambie</p>\r\n<p>\r\n	et en Guin&eacute;e Bissau.</p>\r\n<p>\r\n	L&rsquo;objectif en 2010/2011 est de d&eacute;passer les 100 millions de pal&eacute;tuviers plant&eacute;s et de d&eacute;velopper les autres projets d&rsquo;agroforesterie (arbres fruitiers notamment).</p>\r\n','fr','senegal'),(12,'Benin','<br />\r\n','<br />\r\n','en','benin-en'),(12,'Bénin','<p>\r\n	Projet de mise en oeuvre, dans le village de Firihoun, d&#39;activit&eacute;s alternatives &agrave; l&#39;exploitation abusive des ressources naturelles autour de la r&eacute;serve de la Pendjari.</p>\r\n','<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"/uploads/ck/images/deforestation-Firihoun-benin.JPG\" style=\"width: 200px; height: 150px;\" /><img alt=\"\" src=\"/uploads/ck/images/action-developpement-benin.jpg\" style=\"width: 200px; height: 150px;\" /></p>\r\n<p>\r\n	<strong>Enjeux</strong>: lutter contre l&#39;exploitation abusive des ressources naturelles en p&eacute;riph&eacute;rie de la r&eacute;serve de la biosph&egrave;re de la Pendjari en cr&eacute;ant des activit&eacute;s alternatives</p>\r\n<p>\r\n	<strong>Localisation</strong> : Village de Firihoun, arrondissement de Tant&eacute;ga, commune de Mat&eacute;ri, d&eacute;partement de l&#39;Atacora, B&eacute;nin.</p>\r\n<p>\r\n	<strong>B&eacute;n&eacute;ficiaires</strong> : Village de Firihoun, 375 personnes, dont 120 femmes, 75 hommes et 160 jeunes.</p>\r\n<p>\r\n	<strong>Porteur du projet</strong> : <a href=\"http://www.projetsplusactions.org/\">Projets Plus Actions</a></p>\r\n<p>\r\n	<strong>Programme </strong>: Projet de mise en oeuvre, dans le village de Firihoun, d&#39;activit&eacute;s alternatives &agrave; l&#39;exploitation abusive des ressources naturelles en p&eacute;riph&eacute;rie de la r&eacute;serve de la biosph&egrave;re de Pendjari</p>\r\n<p>\r\n	<strong>Implication Up2Green </strong>: Contribuer aux objectifs de l&#39;association &agrave; mettre en terre 45 000 plants dans le cadre du programme.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Description plus d&eacute;taill&eacute;e :</strong></p>\r\n<p>\r\n	Firihoun est l&#39;un des 23 villages riverains de la R&eacute;serve de Biosph&egrave;re de la Pendjari au nord-ouest du Benin. En compl&eacute;ment de l&#39;agriculture, de la p&ecirc;che et de la chasse, les populations de Firihoun se sont lanc&eacute;es ces derni&egrave;res ann&eacute;es dans la commercialisation du bois de chauffe et du charbon. Cette activit&eacute;, bien que procurant des revenus compl&eacute;mentaires aux populations, est pratiqu&eacute;e anarchiquement et conduit les populations &agrave; couper les arbres et &agrave; braconner.</p>\r\n<p>\r\n	Projets Plus Actions soutient son partenaire local, Aides &amp; D&eacute;veloppement pour la cr&eacute;ation d&#39;activit&eacute;s alternatives agricoles g&eacute;n&eacute;ratrices de revenus. Les habitants de Firihoun pourront rendre cultivable des terres en friche et ainsi ne plus d&eacute;t&eacute;riorer la r&eacute;serve de la Pendjari.</p>\r\n','fr','benin'),(13,'Ecuador','<br />\r\n','<br />\r\n','en','ecuador'),(13,'Equateur','<p>\r\n	Amazonie &eacute;quatorienne. Am&eacute;lioration de vie des populations indig&egrave;nes, d&eacute;veloppement d&#39;une coop&eacute;rative. 2500 indiens Kichwas repartis en 18 communaut&eacute;s.</p>\r\n','<p>\r\n	<img alt=\"\" src=\"/uploads/ck/images/Perou4.jpg\" style=\"width: 200px; height: 150px;\" /></p>\r\n<p>\r\n	<strong>Enjeux : </strong>Am&eacute;lioration de vie des populations indig&egrave;nes, d&eacute;veloppement d&#39;une coop&eacute;rative</p>\r\n<p>\r\n	<strong>Localisation</strong> : Canton du Talag, Province du Napo, Amazonie &eacute;quatorienne</p>\r\n<p>\r\n	<strong>B&eacute;n&eacute;ficiaires</strong> : 2500 indiens Kichwas repartis en 18 communaut&eacute;s</p>\r\n<p>\r\n	<strong>Partenaires</strong>: Ishpingo</p>\r\n<p>\r\n	<strong>Programme</strong> : am&eacute;lioration notable de l&#39;utilisation des terres et la gestion raisonn&eacute;e des ressources foresti&egrave;res</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Implication </strong>Up2green : Participer aux activit&eacute;s de plantations pour passer de 33 000 arbres &agrave; 50 000 arbres plant&eacute;s en 2011</p>\r\n','fr','equateur'),(14,'Peru','<br />\r\n','<br />\r\n','en','perou'),(14,'Pérou','<p>\r\n	Amazonie p&eacute;ruvienne. Lutte contre la d&eacute;forestation, diversification alimentaire, promotion de la biodiversit&eacute;, d&eacute;veloppement de pratiques agricoles durables&nbsp; &quot;chacras int&eacute;grales&quot; aupr&egrave;s de la communaut&eacute; de Fray Martin.</p>\r\n','<p>\r\n	<img alt=\"\" src=\"/uploads/ck/images/7.JPG\" style=\"width: 203px; height: 152px;\" /><img alt=\"\" src=\"../../uploads/ck/images/1.jpg\" style=\"width: 144px; height: 152px;\" /><img alt=\"\" src=\"/uploads/ck/images/macambo.jpg\" style=\"width: 203px; height: 152px;\" /></p>\r\n<p align=\"center\">\r\n	&nbsp;</p>\r\n<p align=\"center\">\r\n	<span style=\"color: rgb(0, 100, 0);\"><strong>Projet co-d&eacute;velopp&eacute; sur le terrain avec Up2green Reforestation</strong></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Enjeux </strong>: lutte contre la d&eacute;forestation en Amazonie, diversification alimentaire, promotion de la biodiversit&eacute;, d&eacute;veloppement de pratiques agricoles durables</p>\r\n<p>\r\n	<strong>Localisation</strong> : R&eacute;gion du Loreto, district d&#39;Iquitos, province de Maynas, communaut&eacute; de Fray Martin</p>\r\n<p>\r\n	<strong>B&eacute;n&eacute;ficiaires </strong>: habitants de la communaut&eacute; de Fray Martin</p>\r\n<p>\r\n	<strong>Partenaires</strong> : Latitud Sur, Forestever</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Programme </strong>: &laquo; Parcelles Int&eacute;grales &raquo;, &laquo; Chacras Integrales &raquo;</p>\r\n<p>\r\n	<strong>Implication Up2Green </strong>: D&eacute;velopper les pratiques agricoles durables par l&#39;incitation &agrave; la plantation d&#39;arbres fruitiers et &agrave; bois &agrave; hauteur de 15000 arbres. L&#39;&eacute;quipe d&#39;Up2green Reforestation r&eacute;alise les formations des populations locales et le support technique sur le terrain.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Description plus d&eacute;taill&eacute;e :</strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<em>Les objectifs du projet :</em></p>\r\n<ul>\r\n	<li>\r\n		<span dir=\"ltr\">Am&eacute;liorer les conditions de vie des communaut&eacute;s</span></li>\r\n	<li>\r\n		<span dir=\"ltr\">Former les populations &agrave; des pratiques agricoles durables et &agrave; une gestion plus raisonn&eacute;e des ressources naturelles</span></li>\r\n	<li>\r\n		<span dir=\"ltr\">Apporter aux communaut&eacute;s un appui humain et technique</span></li>\r\n	<li>\r\n		<span dir=\"ltr\">Lutter contre la d&eacute;forestation (caus&eacute;e essentiellement par une production non durable de bois de chauffe, source de revenus pour les populations)</span></li>\r\n	<li>\r\n		<span dir=\"ltr\">Pr&eacute;server l&#39;environnement et la biodiversit&eacute; locale</span></li>\r\n	<li>\r\n		<span dir=\"ltr\">Planter au minimum 10 000 arbres en 2011</span></li>\r\n</ul>\r\n<p style=\"margin-left: 1cm;\">\r\n	&nbsp;</p>\r\n<p>\r\n	<em>Les b&eacute;n&eacute;ficiaires du projet :</em></p>\r\n<p>\r\n	Les habitants de la communaut&eacute; de Fray Martin, soit 340 personnes, 37 familles. Ils vivent essentiellement de la culture du manioc et de la banane plantain. Leur principal revenu provient de la vente de charbon de bois, activit&eacute; d&eacute;vastatrice pour les for&ecirc;ts. La plantation d&#39;arbres est non seulement essentielle pour le maintien de la for&ecirc;t, mais aussi pour leur apporter les mati&egrave;res premi&egrave;res dont ils ont besoin.</p>\r\n','fr','perou'),(15,'Colombia','<br />\r\n','<br />\r\n','en','2'),(15,'Colombie','<p>\r\n	Amazonie colombienne. Conservation des modes de vie indig&egrave;nes, d&eacute;veloppemen de l&#39;agroforesterie pour l&#39;am&eacute;lioration des conditions alimentaires. <span>Projet d&eacute;velopp&eacute; sur le terrain par Up2green.</span></p>\r\n','<p>\r\n	<img alt=\"\" src=\"/uploads/ck/images/reforestation-forestever-up2green.jpg\" style=\"width: 200px; height: 150px;\" /><img alt=\"\" src=\"/uploads/ck/images/reforestation-forestever-up2green4.jpg\" style=\"width: 267px; height: 150px;\" /></p>\r\n<p align=\"center\">\r\n	&nbsp;</p>\r\n<p align=\"center\">\r\n	<span style=\"color: rgb(0, 100, 0);\"><strong>Projet co-d&eacute;velopp&eacute; sur le terrain avec Up2green Reforestation</strong></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Enjeux</strong> : conservation des modes de vie indig&egrave;nes, d&eacute;veloppement de l&#39;agroforesterie et de l&#39;&eacute;cotourisme</p>\r\n<p>\r\n	<strong>Localisation</strong> : D&eacute;partement de l&#39;Amazonas, P&eacute;riph&eacute;rie de Leticia, Communaut&eacute; San Pedro de los Lagos</p>\r\n<p>\r\n	<strong>B&eacute;n&eacute;ficiaires</strong> : 30 familles au total , communaut&eacute; de San Pedro de los Lagos, Communaut&eacute; du Km 15,</p>\r\n<p>\r\n	<strong>Partenaires</strong> : Green Hope Colombia, Forestever</p>\r\n<p>\r\n	<strong>Programme</strong> : D&eacute;veloppement de pratiques agroforesti&egrave;res en Amazonie</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Implication Up2Green </strong>: Responsable du projet. Sensibilisation et formation des habitants de communaut&eacute;s. Mise en place de p&eacute;pini&egrave;res familiales pour la plantation de 15 000 arbres en 2011.</p>\r\n<p>\r\n	L&#39;&eacute;quipe d&#39;Up2green Reforestation r&eacute;alise les formations des populations locales et le support technique sur le terrain.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Description plus d&eacute;taill&eacute;e :</strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<em>Les objectifs du projet :</em></p>\r\n<ul>\r\n	<li>\r\n		<span dir=\"ltr\">Am&eacute;liorer les conditions de vie des communaut&eacute;s</span></li>\r\n	<li>\r\n		<span dir=\"ltr\">Former les populations &agrave; des pratiques agricoles durables et &agrave; une gestion plus raisonn&eacute;e des ressources naturelles</span></li>\r\n	<li>\r\n		<span dir=\"ltr\">Apporter aux communaut&eacute;s un appui humain et technique</span></li>\r\n	<li>\r\n		<span dir=\"ltr\">Lutter contre la d&eacute;forestation (caus&eacute;e essentiellement par une production non durable de bois de chauffe, source de revenus pour les populations)</span></li>\r\n	<li>\r\n		<span dir=\"ltr\">Pr&eacute;server l&#39;environnement et la biodiversit&eacute; locale</span></li>\r\n	<li>\r\n		<span dir=\"ltr\">Planter au minimum 10 000 arbres en 2011</span></li>\r\n</ul>\r\n<p style=\"margin-left: 1cm;\">\r\n	&nbsp;</p>\r\n<p>\r\n	<em>Les b&eacute;n&eacute;ficiaires du projet :</em></p>\r\n<p>\r\n	La <strong>communaut&eacute; indig&egrave;ne Ticunas </strong>de San Pedro de los Lagos compte elle<strong> une quinzaine de famille</strong>. Elle vit essentiellement de l&#39;agriculture mais son enclavement fait que les habitants ont du mal &agrave; developper des activit&eacute;s &eacute;conomiques g&eacute;n&eacute;ratrices de revenus. La bonne gestion de leur terre et le d&eacute;veloppement de plantations d&#39;arbres &agrave; bois et d&#39;arbres fruitiers permettra d&#39;<strong>entretenir</strong><strong> et de s&eacute;curiser leur mode de vie tr&egrave;s proche de la nature.</strong></p>\r\n','fr','colombie'),(16,'France','<br />\r\n','<br />\r\n','en','1'),(16,'France','<p>\r\n	<font face=\"Arial, Helvetica, sans-serif\"><span class=\"Style9\"><strong>Enjeux : reboisement ma&icirc;tris&eacute; de ch&ecirc;nes sessiles en raison de la disparition du h&ecirc;tre </strong>&agrave; cause du r&eacute;chauffement climatique.<br />\r\n	For&ecirc;t Domaniale de Lyons (Seine maritime &ndash; 76 / Eure &ndash; 27)</span></font></p>\r\n<p>\r\n	Objectif du projet : Reboisement de ch&ecirc;ne sessile et divers feuillus sur 4,13 ha</p>\r\n','<p>\r\n	<font face=\"Arial, Helvetica, sans-serif\"><span class=\"Style9\"><strong>Reboisement en for&ecirc;t domaniale de Lyons</strong><br />\r\n	For&ecirc;t Domaniale de Lyons (Seine maritime &ndash; 76 / Eure &ndash; 27)</span></font></p>\r\n<p style=\"text-align: justify;\">\r\n	<span class=\"Style10\"><strong class=\"bold-orange\">Le contexte :</strong></span><br />\r\n	<br />\r\n	<span class=\"champs-texte\">La for&ecirc;t domaniale de Lyons, d&#39;une superficie de 10695,71 ha, est affect&eacute;e principalement &agrave; la production de bois d&#39;oeuvre feuillus, en particulier de h&ecirc;tre. En effet, la sylviculture pass&eacute;e a fortement favoris&eacute; cette essence qui est aujourd&#39;hui pr&eacute;sente sur environ 60% de la surface du massif. Aujourd&#39;hui, les perspectives de changements climatiques radicaux posent la question de la place du h&ecirc;tre &agrave; grande &eacute;chelle. De plus, plusieurs observations de d&eacute;p&eacute;rissements massifs dans les derni&egrave;res d&eacute;cennies ont conduit les gestionnaires, lors du dernier am&eacute;nagement (2004/2023), &agrave; favoriser le ch&ecirc;ne sessile, notamment en le choisissant de fa&ccedil;on privil&eacute;gi&eacute;e en r&eacute;g&eacute;n&eacute;ration artificielle afin de diversifier les peuplements et d&#39;augmenter la r&eacute;silience de la for&ecirc;t aujourd&#39;hui menac&eacute;e.</span></p>\r\n<center>\r\n	<p style=\"text-align: justify;\">\r\n		<strong>Objectif du projet : Reboisement de ch&ecirc;ne sessile et divers feuillus sur 4,13 ha</strong></p>\r\n	<p style=\"text-align: center;\">\r\n		<br />\r\n		<img alt=\"\" src=\"/uploads/ck/images/ONF-Up2green-Lyonslaforet.jpg\" style=\"width: 450px; height: 356px;\" /></p>\r\n	<p style=\"text-align: justify;\">\r\n		<strong>Descriptif des travaux &agrave; r&eacute;aliser pour l&#39;op&eacute;ration :</strong></p>\r\n</center>\r\n<center>\r\n	<p style=\"text-align: justify;\">\r\n		<u>Travaux pr&eacute;paratoires &agrave; la plantation :</u></p>\r\n</center>\r\n<div style=\"text-align: justify;\">\r\n	Broyage des r&eacute;manents d&#39;exploitation avant plantation Travail pr&eacute;paratoire du sol</div>\r\n<center>\r\n	<p style=\"text-align: justify;\">\r\n		<u>Programme de plantation d&#39;environ 6600 plants :<br />\r\n		</u>Fourniture et mise en place de plants de ch&ecirc;ne sessile (1500pl/ha)<br />\r\n		et de feuillus divers (100pl/ha).</p>\r\n	<p style=\"text-align: justify;\">\r\n		&nbsp;</p>\r\n	<p style=\"text-align: justify;\">\r\n		<span style=\"font-size: 16px;\"><u><strong>La for&ecirc;t de Lyons :</strong></u></span><br />\r\n		<br />\r\n		&laquo; Etendue sur plus de 10 700 hectares entre l&#39;Eure et la Seine Maritime, <strong><em>la for&ecirc;t domaniale de Lyons est tr&egrave;s certainement la plus belle h&ecirc;traie d&#39;Europe.</em></strong><br />\r\n		R&eacute;put&eacute;e pour ses arbres &agrave; haut f&ucirc;t, lui donnant cet aspect &#39; cath&eacute;drale &#39;, qui impressionne d&egrave;s le premier regard, et pour ses sous-bois giboyeux, la for&ecirc;t de Lyons n&#39;en demeure pas moins un massif forestier aux dimensions humaines.<br />\r\n		<br />\r\n		Des clairi&egrave;res, perc&eacute;es d&egrave;s le Moyen Age (avec la pratique de l&#39;essartage), entrecoupent le massif forestier et accueillent villages et cultures dans les vallons abrit&eacute;s et au flanc des coteaux baign&eacute;s de soleil.<br />\r\n		<br />\r\n		Avec plus de 300 kilom&egrave;tres de routes foresti&egrave;res goudronn&eacute;es ou empierr&eacute;es, la for&ecirc;t de Lyons permet toutes les pratiques sportives. La randonn&eacute;e p&eacute;destre b&eacute;n&eacute;ficie d&#39;un cadre d&#39;exception avec une multitude de sentiers balis&eacute;s et entretenus. La randonn&eacute;e &eacute;questre s&#39;y pratique tout aussi ais&eacute;ment et acquiert ses lettres de noblesse lors des journ&eacute;es de chasse &agrave; courre qui se d&eacute;roulent tous les automnes dans le massif (les mardis et samedis d&#39;octobre &agrave; mars).<br />\r\n		Le VTT est &eacute;galement une activit&eacute; tr&egrave;s pratiqu&eacute;e et les routes foresti&egrave;res peu emprunt&eacute;es par les automobilistes font le bonheur des cyclotouristes.<br />\r\n		<br />\r\n		Visites et <a href=\"http://www.lyons.tourisme.free.fr/randonnees.htm\" target=\"_blank\">randonn&eacute;es</a> accompagn&eacute;es en for&ecirc;t au cours de l&#39;ann&eacute;e. &raquo;<br />\r\n		<br />\r\n		<strong>Source : <a href=\"http://www.lyons.tourisme.free.fr/\" target=\"_blank\">Office de Tourisme du Pays de Lyons</a></strong></p>\r\n	<p style=\"text-align: justify;\">\r\n		<strong><img alt=\"\" src=\"/uploads/ck/images/carte-reforestation.jpg\" style=\"width: 500px; height: 288px;\" /></strong></p>\r\n</center>\r\n','fr','france'),(17,'Ethiopia','<br />\r\n','<br />\r\n','en','3'),(17,'Ethiopie','<p>\r\n	<strong>Enjeux : d&eacute;veloppement agro-sylvicole + d&eacute;sertification + activit&eacute; &eacute;conomique</strong></p>\r\n<p>\r\n	R&eacute;gions de Guraghe, Konso et lac Tana.</p>\r\n<p>\r\n	D&eacute;veloppement agricole et lutte contre la d&eacute;forestation. Plantation de multiples essences pour diff&eacute;rents usages : production de fruits, de fourrage pour le b&eacute;tail, de plantes m&eacute;dicinales et de bois de chauffage et de construction.</p>\r\n','<p>\r\n	<img alt=\"\" src=\"/uploads/ck/images/barrenland_198(3).jpg\" style=\"width: 198px; height: 143px;\" /><img alt=\"\" src=\"/uploads/ck/images/honey_198(3).jpg\" style=\"width: 214px; height: 143px;\" /></p>\r\n<p>\r\n	<strong>Environmental Issues </strong><br />\r\n	Ethiopia loses 2 billion tons of topsoil every year because widespread deforestation is leading to massive soil erosion. Land degradation is a serious problem throughout the Ethiopia, due to extensive population pressure, compounded by the large livestock population. The increased demand for cultivable land, deforestation, and tillage of steep slopes and mountains has enhanced soil erosion and decrease productivity. In addition, grazing land scarcity and scarcity of clean drinking water are problems that persist in Southern Regional states.</p>\r\n<p>\r\n	<strong>Social Issues </strong><br />\r\n	With more than 80% of the population dependent on wood for their basic energy needs, there is a real crisis in their fuel supply - women and children must walk miles every day to gather a few twigs to cook with, and fuelwood is very expensive!</p>\r\n<p>\r\n	The main underlying causes of land degradation are socio economic (e.g. population growth and associated activities including deforestation, overgrazing, agricultural expansion, fuel wood scavenging, etc.) natural (e.g. topography, soil type, drought/rainfall intensity, etc), institutional (e.g. coordination and capacity) and policy factors. These situations have a synergistic effect and highly enhance soil degradation which in turn greatly reduces agricultural and other forms of biological production, exacerbates poverty, and leads to the removal of biological resources beyond the replacement capacity of the natural resources. This keeps accelerating further the rate of land degradation, thus creating a vicious circle linking human and environmental degradation.</p>\r\n<p>\r\n	<strong>Trees For the Future response :</strong></p>\r\n<p>\r\n	Our goal is to rehabilitate and improve productive potential of degraded and marginal lands, thereby improving the socio economic conditions of the participating communities. Our philosophy is community driven, and the community participation and ownership of the projects is crucial to the sustainability and success of our approach.</p>\r\n<p>\r\n	Community members, mostly small and disadvantaged farmers, are considered to be at the forefront of project implementation. Their participation from the inception up to the termination of this project will highly be considered and maintained.</p>\r\n<p>\r\n	TREES&#39; technicians have made several trips to Ethiopia over the past few years, combining to provide 160 days of on-site technical assistance. Everywhere we have gone, local groups are asking the same thing:&ldquo;How fast can you get this program started?&rdquo; People are very interested in sustainable harvesting of fuelwood, fuel-efficient stoves, and confinement rearing of animals &ndash; after having seen how livestock have stripped their terrain.</p>\r\n','fr','ethiopie'),(18,'Inde','<br />\r\n','<br />\r\n','en','4'),(18,'Inde','<p>\r\n	<strong>Enjeux :</strong> d&eacute;veloppement agro-sylvicole + d&eacute;sertification + activit&eacute; &eacute;conomique</p>\r\n<p>\r\n	R&eacute;gions de Tamil Nadu, Andhra Pradesh et Uttarkhand.</p>\r\n<p>\r\n	<span>Objectifs : lutter</span> <span>contre</span> la <span>s&eacute;cheresse</span> et <span>l&rsquo;&eacute;rosion</span> en <span>plantant</span> <span>des</span> essences <span>&agrave;</span> <span>croissance</span> <span>rapide</span> ; <span>R&eacute;alimenter</span> <span>les</span> <span>nappes</span> <span>phr&eacute;atiques</span> en eau ; <span>Assurer</span> <span>une</span> <span>utilisation</span> durable <span>des</span> <span>arbres</span> : fruits, <span>chauffage</span> et construction.</p>\r\n','<p>\r\n	<img alt=\"\" src=\"/uploads/ck/images/india3.jpg\" style=\"width: 261px; height: 194px;\" /><img alt=\"\" src=\"/uploads/ck/images/india1.jpg\" style=\"width: 258px; height: 194px;\" /></p>\r\n<p>\r\n	<strong>Social and Environmental Issues</strong></p>\r\n<p>\r\n	While almost one million acres of land in Assam, West Bengal, and other regions in Northwest India and Bangladesh get flooded regularly, the people of Tamil Nadu in southeastern India, 1000 miles away from the flood zones, are struggling with drought and a lack of fresh water. Trees have been cleared, erosion is stripping topsoil from farmlands, and little rainwater is channeled back into aquifers. In the end of 2004, the great tsunami hit Tamil Nadu causing further destruction to an already struggling region.</p>\r\n<p>\r\n	While some sectors of Indian society have greatly improved their standards of living, life for the average farmer continues to be a struggle for survival. Thanks to the vagaries of commodity prices and the weather, the high costs of pesticides and fertilizers, and declining yields, India has experienced a horrifying number of farmer suicides. At the same time, common lands continue to be degraded, as overgrazing and fuelwood harvesting destroy the remaining fertility.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Response planting trees :</strong></p>\r\n<p>\r\n	The majority of all our work over the last two years has been in the region of Tamil Nadu, the southeastern region hit hardest by the devastating 2004 tsunami. We have recently expanded to Andhra Pradesh, a region that is suffering from prolonged droughts, and in 2009 we are starting a new program in the northern state of Uttarakhand, which will be working with villages and local governments to enhance the productivity of common lands.</p>\r\n','fr','inde-1'),(20,'','<p>\r\n	The program is actively engaged in sustainably focused programming for the purpose of wildlife conservation and reforestation.</p>\r\n','<br />\r\n','en',''),(20,'Costa Rica','<p>\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><strong><span>Enjeux</span> : restauration de </strong></span><strong><span>l&rsquo;&eacute;cosyst&egrave;me</span> &laquo;&nbsp;<span>for&ecirc;t</span> tropicale <span>c&ocirc;ti&egrave;re</span>&nbsp;&raquo;, retour de la biodiversit&eacute;, sensibilisation des communaut&eacute;s</strong></span></p>\r\n<p>\r\n	<span style=\"font-size: 12px;\"><span style=\"font-family: arial,helvetica,sans-serif;\"><span>Dans</span> le </span></span>Parc National Manuel Antonio, avec les communaut&eacute;s Coope Silencio et Matapalo, pr&eacute;servation du littoral et cr&eacute;ation d&#39;un corridor de biodiversit&eacute;.</p>\r\n','<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"/uploads/ck/images/costa-rica2.jpg\" style=\"width: 253px; height: 182px;\" /><img alt=\"\" src=\"/uploads/ck/images/costa-rica(1).jpg\" style=\"width: 264px; height: 174px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><span>Enjeux</span></strong> : restauration de l&rsquo;&eacute;cosyst&egrave;me &laquo; for&ecirc;t tropicale c&ocirc;ti&egrave;re &raquo;, retour de la biodiversit&eacute;, sensibilisation des communaut&eacute;s</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><span>Localisation</span></strong> : Costa Rica, Parc National Manuel Antonio, r&eacute;gion Pacifico Central, Playa el Rey</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><span>B&eacute;n&eacute;ficiaires</span></strong> : 100 <span>familles</span> au total, <span>communaut&eacute;s</span> <span>CoopeSilencio</span> et <span>Matapalo</span></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><span>Partenaires</span></strong> :&nbsp;</p>\r\n<p align=\"left\" style=\"margin-left: 36pt;\">\r\n	FORESTEVER<br />\r\n	MINAET (Costa Rica Ministry of the Environment)<br />\r\n	Palazzo Park Resort<br />\r\n	CoopeSilencioCooperativeCommunity<br />\r\n	Parque Nacional Manuel Antonio<br />\r\n	Amigos de Parque Manuel Antonio<br />\r\n	Asociaci&oacute;n de Gu&iacute;as de Parque Manuel Antonio<br />\r\n	Hacienda Matapalo<br />\r\n	ReplantingTheRainforests.org</p>\r\n<p align=\"left\" style=\"margin-left: 36pt;\">\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><span>Programme</span></strong> : Protection et reforestation du parc National Manual Antonio</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Implication <span>Up2Green</span> </strong>: financer et suivre la plantation de 22 000 <span>arbres</span> en 2011.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>Description plus <span>d&eacute;taill&eacute;e</span> :</strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><u>Historique du Projet&nbsp;: </u></strong></p>\r\n<p>\r\n	EPS, en plus de mener des projets deprotection d&rsquo;esp&egrave;ces menac&eacute;es au Costa Rica (tortues marines et singes Titi), a lanc&eacute; en 2010 un projet de pr&eacute;servation du littoral incluant un projet pilote de reforestation (2000 arbres) pour la cr&eacute;ation d&rsquo;un corridor biologique. Des inventaires de biodiversit&eacute; et des relev&eacute;s GPS ont actuellement lieu pour &eacute;tendre le programme en 2011.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><u>Contexte du projet&nbsp;:</u></strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	La c&ocirc;te pacifique du Costa Rica, ancienne jungle, s&rsquo;est continuellement d&eacute;grad&eacute;e au cours de ces 50 derni&egrave;res ann&eacute;es.</p>\r\n<p>\r\n	Le Costa Rica est devenu un pays &eacute;mergeant et s&rsquo;est d&eacute;velopp&eacute; &agrave; travers un programme agricole national. La d&eacute;forestation s&rsquo;est faite au profit de l&rsquo;introduction de cultures telles que la banane, le riz et l&rsquo;extension de l&rsquo;&eacute;levage. Les investisseurs ont import&eacute; leur vision d&rsquo;un paradis tropical en &eacute;rigeant des stations baln&eacute;aires modernes entour&eacute;es de cocotiers, esp&egrave;ce exotique et envahissante ne permettant pas le maintien et le d&eacute;veloppement de la faune et de la flore native.</p>\r\n<p>\r\n	De cette fa&ccedil;on, le singe Titi, plus petit des primates terrestre, a progressivement vu son habitat naturel dispara&icirc;tre ce qui l&rsquo;a confin&eacute; dans des espaces restreints, isol&eacute;s et inhospitaliers le mettant en danger. Sans intervention et cr&eacute;ation de corridor biologique, l&rsquo;esp&egrave;ce serait vou&eacute;e &agrave; dispara&icirc;tre, comme l&rsquo;ensemble de cet &eacute;cosyst&egrave;me unique au monde.</p>\r\n<p>\r\n	Par ailleurs le parc National de Manuel Antonia est le parc national du Costa Rica le plus fr&eacute;quent&eacute;. En plus des cocotiers, se d&eacute;veloppent des herbes invasives et la culture des palmiers &agrave; huile gagne du terrain, tout comme l&rsquo;urbanisme au nord du parc.</p>\r\n<p>\r\n	Il est donc indispensable de proposer des solutions pour contrer l&rsquo;effet des plantes invasives en plantant des esp&egrave;ces tol&eacute;rant la salinit&eacute; de l&rsquo;eau telles que des esp&egrave;ces de mangrove et d&rsquo;autres ,repr&eacute;sentatives de la diversit&eacute; biologique de cet habitat.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><u>Objectifs g&eacute;n&eacute;raux et sp&eacute;cifiques&nbsp;:</u></strong></p>\r\n<p align=\"left\">\r\n	-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Restauration de l&rsquo;&eacute;cosyst&egrave;me &laquo;&nbsp;for&ecirc;t tropical c&ocirc;ti&egrave;re&nbsp;&raquo;</strong></p>\r\n<p>\r\n	+ Planter 22 000 arbres en 2011</p>\r\n<p>\r\n	+ Appliquer les principes d&rsquo;analogie foresti&egrave;res et choisir des esp&egrave;ces&nbsp;telles que&nbsp;:</p>\r\n<p style=\"margin-left: 53.25pt;\">\r\n	-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Roble de savana (<em>Tabebuiarosea)</em></p>\r\n<p style=\"margin-left: 53.25pt;\">\r\n	-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Guanacaste (<em>Enterolobiumcyclocarpum)</em></p>\r\n<p style=\"margin-left: 53.25pt;\">\r\n	-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Guapinol (<em>Hymenaea courbaril</em>)</p>\r\n<p style=\"margin-left: 53.25pt;\">\r\n	-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Guayaba(<em>Psidiumguajava</em>)</p>\r\n<p style=\"margin-left: 53.25pt;\">\r\n	-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Por&oacute; de cerca (<em>Erythrinacostaricensis</em>)</p>\r\n<p style=\"margin-left: 53.25pt;\">\r\n	-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Cen&iacute;zaro (<em>Samaneasaman</em>)</p>\r\n<p style=\"margin-left: 53.25pt;\">\r\n	-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Almendro de playa (<em>Terminaliacatappa)</em></p>\r\n<p style=\"margin-left: 53.25pt;\">\r\n	-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Casco de venado (<em>Bawinhiacoccinea)</em></p>\r\n<p style=\"margin-left: 53.25pt;\">\r\n	-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Carboncillo (<em>Zapotecacostaricensis)</em></p>\r\n<p style=\"margin-left: 53.25pt;\">\r\n	-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Carboncillo (<em>Albiziacarbonaria</em>)</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p align=\"left\">\r\n	-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Faciliter la r&eacute;apparition d&rsquo;esp&egrave;ces v&eacute;g&eacute;tales et animales natives</strong></p>\r\n<p>\r\n	+ Favoriser les esp&egrave;ces ligneuses servant de niche &eacute;cologique</p>\r\n<p>\r\n	+ Cr&eacute;er un couloir &eacute;cologique pour le d&eacute;placement des esp&egrave;ces</p>\r\n<p>\r\n	+ Favoriser les &eacute;changes g&eacute;n&eacute;tiques entres les esp&egrave;ces</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p align=\"left\">\r\n	-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Sensibiliser la soci&eacute;t&eacute; civile</strong></p>\r\n<p>\r\n	+ Impliquer les communaut&eacute;s de CoopeSilencio et de Matapalo pour les travaux de reforestation</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p align=\"left\">\r\n	-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>Sensibiliser les industriels et les investisseurs</strong></p>\r\n<p>\r\n	+ R&eacute;aliser des sensibilisations durant les temps de travail, et introduire des esp&egrave;ces natives dans les parcelles cultiv&eacute;es ou r&eacute;serv&eacute;es aux touristes</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><u>Description des b&eacute;n&eacute;ficiaires&nbsp;:</u></strong></p>\r\n<p>\r\n	CoopeSilencio est une communaut&eacute; coop&eacute;rative qui est situ&eacute;e &agrave; 5 km &agrave; l&rsquo;Est de Playa el Rey, pr&egrave;s de l&rsquo;embouchure de la rivi&egrave;re Savegre, qui repr&eacute;sente un hot-spot de biodiversit&eacute;. CoopeSilencioa &eacute;t&eacute; fond&eacute;e en 1972 par un groupe de 40 familles costaricaines. Elle en compte d&eacute;sormais plus de 100. L&rsquo;&eacute;conomie de ces familles est bas&eacute;e sur une plantation de palmiers &agrave; huile de 500 Ha. On y trouve une tienda, un &eacute;levage de poulet, des plantations de Teak, une scierie et un magasin de meubles. La coop&eacute;rative g&egrave;re &eacute;galement un centre de r&eacute;habilitation d&rsquo;animaux sauvages. La communaut&eacute; met &agrave; disposition des terres pour les p&eacute;pini&egrave;res et produit du biocharen partenariat avec EPS.</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	Matapaloest une communaut&eacute; bien plus grande et diversifi&eacute;e. La plupart de habitations et des commerces sont construits de mani&egrave;re ill&eacute;gale sur des aires prot&eacute;g&eacute;es, &agrave; l&rsquo;int&eacute;rieur de la zone tampon maritime de 200m.&nbsp; L&rsquo;int&eacute;gration de la communaut&eacute; dans les programmes de sensibilisation et de r&eacute;habilitation est indispensable pour &eacute;tendre vers le sud de la c&ocirc;te le programme, d&rsquo;autant plus qu&rsquo;elle repr&eacute;sente un lieu de reproduction phare pour les tortues marines.</p>\r\n','fr','costa-rica');
